INSERT INTO `tbl_edict` (`id`, `word`, `detail`) VALUES
(63842, 'Industrial inertia', '<C><F><I><N><Q>@Industrial inertia<br />- (Econ) Tính ỳ công nghiệp.<br />+ Một cụm thuật ngữ được sử dụng để mô tả một hiện tượng, các doanh nghiệp không thay đổi được vị trí địa lý khi vị trí hiện tại không còn là một vị trí mang lại nhiều lợi nhuận nhất nữa.</Q></N></I></F></C>'),
(63843, 'industrial life insurance', '<C><F><I><N><Q>@industrial life insurance /in''dʌstriəl''laifin''ʃuərəns/<br />*  danh từ<br />- bảo hiểm lao động (đóng góp hằng tuần hay hằng tháng)</Q></N></I></F></C>'),
(63844, 'Industrial organization', '<C><F><I><N><Q>@Industrial organization<br />- (Econ) Tổ chức công nghiệp<br />+ Thông thường, đây là lĩnh vực của LÝ THUYẾT GIÁ CẢ ỨNG DỤNG. Nó quan tâm đến sự vận hành của nền kinh tế thị trường và nhìn chung là nó tiếp cận theo cơ cấu thị trường, sự điều hành và kết quả của thị trường.</Q></N></I></F></C>'),
(63845, 'Industrial policy', '<C><F><I><N><Q>@Industrial policy<br />- (Econ) Chính sách công nghiệp.</Q></N></I></F></C>'),
(63846, 'Industrial relation', '<C><F><I><N><Q>@Industrial relation<br />- (Econ) Các quan hệ lao động.<br />+ Nghiên cứu và thực hành các quy tắc chi phối việc làm.</Q></N></I></F></C>'),
(63847, 'industrial relations', '<C><F><I><N><Q>@industrial relations<br />* danh từ<br />- quan hệ giữa chủ và thợ, quan hệ giữa người sử dụng lao động và người lao động, quan hệ lao động</Q></N></I></F></C>'),
(63848, 'Industrial Reorganization Corporation', '<C><F><I><N><Q>@Industrial Reorganization Corporation<br />- (Econ) Công ty cải tổ công nghiệp.<br />+ Một tổ chức độc lập được một chính phủ Anh lập ra vào năm 1966 rồi sau đó bị một chính phủ Anh khác giải tán vào năm 1971. Mục đích của tổ chức là tăng hiệu quả của khu vực công nghiệp trong nền kinh tế thông qua việc khuyến khich hợp lý hoá và hợp nhất các doanh nghiệp nhỏ thành các đơn vị lơn hơn và hy vọng có hiệu quả lớn hơn.</Q></N></I></F></C>'),
(63849, 'industrial revolution', '<C><F><I><N><Q>@industrial revolution /in''dʌstriəl,revə''lu:ʃn/<br />*  danh từ<br />- cách mạng công nghiệp (ở Anh từ năm 1760)</Q></N></I></F></C>'),
(63850, 'industrial school', '<C><F><I><N><Q>@industrial school /in''dʌstriəl,sku:l/<br />*  danh từ<br />- trường dạy nghề<br />- (sử học) trường dạy nghề cho tre em cầu bơ cầu bất</Q></N></I></F></C>'),
(63851, 'Industrial unions', '<C><F><I><N><Q>@Industrial unions<br />- (Econ) Nghiệp đoàn theo ngành.<br />+ Nghiệp đoàn là tổ chức của tất cả các công nhân trong một ngành bất kể chuyên môn của họ là gì. Xem GENERAL, UNION AND CRAFT UNIONS.</Q></N></I></F></C>'),
(63852, 'Industrial wage differentials', '<C><F><I><N><Q>@Industrial wage differentials<br />- (Econ) Chênh lệch về tiền công giữa các ngành.<br />+ Các chênh lệch về mức trả công trung bình của các nhóm công nhân được phân loại theo ngành mà họ làm việc.</Q></N></I></F></C>'),
(63853, 'Industrial wage structure', '<C><F><I><N><Q>@Industrial wage structure<br />- (Econ) Cơ cấu tiền công theo ngành.<br />+ Việc xếp hạng mức trả công trung bình của các nhóm công nhân khác nhau được phân loại theo ngành mà họ làm việc.</Q></N></I></F></C>'),
(63854, 'industrialisation', '<C><F><I><N><Q>@industrialisation<br />* danh từ<br />- sự công nghiệp hoá</Q></N></I></F></C>'),
(63855, 'industrialise', '<C><F><I><N><Q>@industrialise /in''dʌstriəlaiz/ (industrialise) /in''dʌstriəlaiz/<br />*  động từ<br />- công nghiệp hoá</Q></N></I></F></C>'),
(63856, 'industrialism', '<C><F><I><N><Q>@industrialism /in''dʌstriəlizm/<br />*  danh từ<br />- hệ thống công nghiệp quy mô lớn<br />- tổ chức công nghiệp</Q></N></I></F></C>'),
(63857, 'industrialist', '<C><F><I><N><Q>@industrialist /in''dʌstriəlist/<br />*  danh từ<br />- nhà tư bản công nghiệp</Q></N></I></F></C>'),
(63858, 'industrialists', '<C><F><I><N><Q>@industrialist /in''dʌstriəlist/<br />*  danh từ<br />- nhà tư bản công nghiệp</Q></N></I></F></C>'),
(63859, 'Industrialization', '<C><F><I><N><Q>@Industrialization<br />- (Econ) Công nghiệp hoá (ở các nước đang phát triển).<br />+ Sự phát triển của các ngành công nghiệp được coi là chiến lược phát triển chung.</Q></N></I></F></C>'),
(63860, 'industrialization', '<C><F><I><N><Q>@industrialization /in,dʌstriəlai''zeiʃn/<br />*  danh từ<br />- sự công nghiệp hoá</Q></N></I></F></C>'),
(63861, 'industrializations', '<C><F><I><N><Q>@Industrialization<br />- (Econ) Công nghiệp hoá (ở các nước đang phát triển).<br />+ Sự phát triển của các ngành công nghiệp được coi là chiến lược phát triển chung.</Q></N></I></F></C><C><F><I><N><Q>@industrialization /in,dʌstriəlai''zeiʃn/<br />*  danh từ<br />- sự công nghiệp hoá</Q></N></I></F></C>'),
(63862, 'industrialize', '<C><F><I><N><Q>@industrialize /in''dʌstriəlaiz/ (industrialise) /in''dʌstriəlaiz/<br />*  động từ<br />- công nghiệp hoá</Q></N></I></F></C>'),
(63863, 'industrialized', '<C><F><I><N><Q>@industrialize /in''dʌstriəlaiz/ (industrialise) /in''dʌstriəlaiz/<br />*  động từ<br />- công nghiệp hoá</Q></N></I></F></C>'),
(63864, 'industrializes', '<C><F><I><N><Q>@industrialize /in''dʌstriəlaiz/ (industrialise) /in''dʌstriəlaiz/<br />*  động từ<br />- công nghiệp hoá</Q></N></I></F></C>'),
(63865, 'industrializing', '<C><F><I><N><Q>@industrialize /in''dʌstriəlaiz/ (industrialise) /in''dʌstriəlaiz/<br />*  động từ<br />- công nghiệp hoá</Q></N></I></F></C>'),
(63866, 'industrially', '<C><F><I><N><Q>@industrially<br />* phó từ<br />- về phương diện kỹ nghệ, về mặt công nghiệp</Q></N></I></F></C>'),
(63867, 'industrials', '<C><F><I><N><Q>@industrial /in''dʌstriəl/<br />*  tính từ<br />- (thuộc) công nghiệp<br /><br />@industrial<br />- (thuộc) công nghiệp</Q></N></I></F></C>'),
(63868, 'industries', '<C><F><I><N><Q>@Industry<br />- (Econ) Ngành công nghiệp.<br />+ Một ngành trong khuôn khổ CƠ CẤU THỊ TRƯỜNG CẠNH TRANH HOÀN HẢO có thể được định nghĩa là một số lớn doanh nghiệp cạnh tranh với nhau trong việc sản xuất MỘT SẢN PHẨM ĐỒNG NHẤT.</Q></N></I></F></C><C><F><I><N><Q>@industry /''indəstri/<br />*  danh từ<br />- công nghiệp<br />=heavy industry+ công nghiệp nặng<br />=light industry+ công nghiệp nhẹ<br />- sự chăm chỉ, tính cần cù, tính siêng năng ((cũng) industriousness)<br />- ngành kinh doanh; nghề làm ăn<br />=tourist industry+ ngành kinh doanh du lịch<br /><br />@industry<br />- công nghiệp, lĩnh vực công nghiệp</Q></N></I></F></C>'),
(63869, 'industrious', '<C><F><I><N><Q>@industrious /in''dʌstriəs/<br />*  tính từ<br />- cần cù, siêng năng</Q></N></I></F></C>'),
(63870, 'industriously', '<C><F><I><N><Q>@industriously<br />* phó từ<br />- cần cù, siêng năng</Q></N></I></F></C>'),
(63871, 'industriousness', '<C><F><I><N><Q>@industriousness /in''dʌstriəsnis/<br />*  danh từ<br />- sự chăm chỉ, tính cần cù, tính siêng năng ((cũng) industry)</Q></N></I></F></C>'),
(63872, 'Industry', '<C><F><I><N><Q>@Industry<br />- (Econ) Ngành công nghiệp.<br />+ Một ngành trong khuôn khổ CƠ CẤU THỊ TRƯỜNG CẠNH TRANH HOÀN HẢO có thể được định nghĩa là một số lớn doanh nghiệp cạnh tranh với nhau trong việc sản xuất MỘT SẢN PHẨM ĐỒNG NHẤT.</Q></N></I></F></C>'),
(63873, 'industry', '<C><F><I><N><Q>@industry /''indəstri/<br />*  danh từ<br />- công nghiệp<br />=heavy industry+ công nghiệp nặng<br />=light industry+ công nghiệp nhẹ<br />- sự chăm chỉ, tính cần cù, tính siêng năng ((cũng) industriousness)<br />- ngành kinh doanh; nghề làm ăn<br />=tourist industry+ ngành kinh doanh du lịch<br /><br />@industry<br />- công nghiệp, lĩnh vực công nghiệp</Q></N></I></F></C>'),
(63874, 'Industry-wide bargaining', '<C><F><I><N><Q>@Industry-wide bargaining<br />- (Econ) Thương lượng trong toàn ngành.<br />+ Xem NATIONAL BARGAINING</Q></N></I></F></C>'),
(63875, 'indwell', '<C><F><I><N><Q>@indwell /''in''dwel/<br />*  động từ (indwelt)<br />- ở trong, nằm trong (nguyên lý, động lực...)</Q></N></I></F></C>'),
(63876, 'indweller', '<C><F><I><N><Q>@indweller /''in,dwelə/<br />*  danh từ<br />- người ở (nơi nào...)<br />- nguyên lý trong, động lực trong)</Q></N></I></F></C>'),
(63877, 'indwelt', '<C><F><I><N><Q>@indwelt /''in''dwel/<br />*  động từ (indwelt)<br />- ở trong, nằm trong (nguyên lý, động lực...)</Q></N></I></F></C><C><F><I><N><Q>@indwell /''in''dwel/<br />*  động từ (indwelt)<br />- ở trong, nằm trong (nguyên lý, động lực...)</Q></N></I></F></C>'),
(63878, 'inebriant', '<C><F><I><N><Q>@inebriant /i''ni:briənt/<br />*  tính từ<br />- làm say<br />*  danh từ<br />- chất làm say</Q></N></I></F></C>'),
(63879, 'inebriants', '<C><F><I><N><Q>@inebriant /i''ni:briənt/<br />*  tính từ<br />- làm say<br />*  danh từ<br />- chất làm say</Q></N></I></F></C>'),
(63880, 'inebriate', '<C><F><I><N><Q>@inebriate /i''ni:briit/<br />*  tính từ<br />- say<br />*  danh từ<br />- người say rượu<br />- người nghiện rượu<br />*  ngoại động từ<br />- làm say<br />- làm mê mẩn tâm thần</Q></N></I></F></C>'),
(63881, 'inebriated', '<C><F><I><N><Q>@inebriated<br />* tính từ<br />- say sưa như uống rượu</Q></N></I></F></C><C><F><I><N><Q>@inebriate /i''ni:briit/<br />*  tính từ<br />- say<br />*  danh từ<br />- người say rượu<br />- người nghiện rượu<br />*  ngoại động từ<br />- làm say<br />- làm mê mẩn tâm thần</Q></N></I></F></C>'),
(63882, 'inebriates', '<C><F><I><N><Q>@inebriate /i''ni:briit/<br />*  tính từ<br />- say<br />*  danh từ<br />- người say rượu<br />- người nghiện rượu<br />*  ngoại động từ<br />- làm say<br />- làm mê mẩn tâm thần</Q></N></I></F></C>'),
(63883, 'inebriating', '<C><F><I><N><Q>@inebriate /i''ni:briit/<br />*  tính từ<br />- say<br />*  danh từ<br />- người say rượu<br />- người nghiện rượu<br />*  ngoại động từ<br />- làm say<br />- làm mê mẩn tâm thần</Q></N></I></F></C>'),
(63884, 'inebriation', '<C><F><I><N><Q>@inebriation /i,ni:bri''eiʃn/<br />*  danh từ<br />- sự làm say; sự say rượu</Q></N></I></F></C>'),
(63885, 'inebrieties', '<C><F><I><N><Q>@inebriety /,ini:''braiəti/<br />*  danh từ<br />- sự say rượu<br />- tật say sưa, tật nghiện rượu</Q></N></I></F></C>'),
(63886, 'inebriety', '<C><F><I><N><Q>@inebriety /,ini:''braiəti/<br />*  danh từ<br />- sự say rượu<br />- tật say sưa, tật nghiện rượu</Q></N></I></F></C>'),
(63887, 'inedibility', '<C><F><I><N><Q>@inedibility /,inedi''biliti/<br />*  danh từ<br />- tính chất không ăn được</Q></N></I></F></C>'),
(63888, 'inedible', '<C><F><I><N><Q>@inedible /in''edibl/<br />*  tính từ<br />- không ăn được (vì độc...)</Q></N></I></F></C>'),
(63889, 'inedibly', '<C><F><I><N><Q>@inedibly<br />- xem inedible</Q></N></I></F></C>'),
(63890, 'inedited', '<C><F><I><N><Q>@inedited /in''editid/<br />*  tính từ<br />- không in ra, không xuất bản</Q></N></I></F></C>'),
(63891, 'ineducability', '<C><F><I><N><Q>@ineducability /in,edjukə''biliti/<br />*  danh từ<br />- tính không học hành được (vì ngu đần...)</Q></N></I></F></C>'),
(63892, 'ineducable', '<C><F><I><N><Q>@ineducable /in''edjukəbl/<br />*  tính từ<br />- không học hành được (vì ngu đần...)</Q></N></I></F></C>'),
(63893, 'ineducation', '<C><F><I><N><Q>@ineducation /in,edju''keiʃn/<br />*  danh từ<br />- sự thiếu học</Q></N></I></F></C>'),
(63894, 'ineffability', '<C><F><I><N><Q>@ineffability<br />- xem ineffable</Q></N></I></F></C>'),
(63895, 'ineffable', '<C><F><I><N><Q>@ineffable /in''efəbl/<br />*  tính từ<br />- không tả được, không nói lên được<br />- không thể nói ra được, huý</Q></N></I></F></C>'),
(63896, 'ineffableness', '<C><F><I><N><Q>@ineffableness /in''efəblnis/<br />*  danh từ<br />- tính không tả được, tính không nói lên được<br />- tính không thể nói ra được, tính huý</Q></N></I></F></C>'),
(63897, 'ineffably', '<C><F><I><N><Q>@ineffably<br />* phó từ<br />- không tả được, không tả xiết</Q></N></I></F></C>'),
(63898, 'ineffaceability', '<C><F><I><N><Q>@ineffaceability<br />- xem ineffaceable</Q></N></I></F></C>'),
(63899, 'ineffaceable', '<C><F><I><N><Q>@ineffaceable /,ini''feisəbl/<br />*  tính từ<br />- không thể xoá được</Q></N></I></F></C>'),
(63900, 'ineffaceableness', '<C><F><I><N><Q>@ineffaceableness /,ini''feisəblnis/<br />*  danh từ<br />- tính không thể xoá được</Q></N></I></F></C>'),
(63901, 'ineffaceably', '<C><F><I><N><Q>@ineffaceably<br />- xem ineffaceable</Q></N></I></F></C>'),
(63902, 'ineffective', '<C><F><I><N><Q>@ineffective /,ini''fektiv/<br />*  tính từ<br />- không có hiệu quả<br />- vô tích sự, không làm được trò trống gì (người)<br />- (nghệ thuật) không gây được ấn tượng, không tác động</Q></N></I></F></C>'),
(63903, 'ineffectively', '<C><F><I><N><Q>@ineffectively<br />* phó từ<br />- chẳng tới đâu, vô hiệu quả, vô ích</Q></N></I></F></C>'),
(63904, 'ineffectiveness', '<C><F><I><N><Q>@ineffectiveness<br />* danh từ<br />- tính vô hiệu quả, sự vô hiệu quả</Q></N></I></F></C>'),
(63905, 'ineffectual', '<C><F><I><N><Q>@ineffectual /,ini''fektjuəl/<br />*  tính từ<br />- không đem lại kết quả mong nuốn; không đem lại kết quả quyết định (thuốc...), không ăn thua<br />- vô ích<br />- bất lực</Q></N></I></F></C>'),
(63906, 'ineffectuality', '<C><F><I><N><Q>@ineffectuality<br />- xem ineffectual</Q></N></I></F></C>'),
(63907, 'ineffectually', '<C><F><I><N><Q>@ineffectually<br />* phó từ<br />- vô ích, vô hiệu quả</Q></N></I></F></C>'),
(63908, 'ineffectualness', '<C><F><I><N><Q>@ineffectualness /,ini''fektjuəlnis/<br />*  danh từ<br />- sự không đem lại kết quả mong nuốn; sự không đem lại kết quả quyết định, sự không ăn thua<br />- tính vô ích<br />- tính bất lực</Q></N></I></F></C>'),
(63909, 'inefficacious', '<C><F><I><N><Q>@inefficacious /,inefi''keiʃəs/<br />*  tính từ<br />- không thể đem lại kết quả mong nuốn; không có hiệu quả, không công hiệu (thuốc...)</Q></N></I></F></C>'),
(63910, 'inefficaciously', '<C><F><I><N><Q>@inefficaciously<br />- xem inefficacious</Q></N></I></F></C>'),
(63911, 'inefficaciousness', '<C><F><I><N><Q>@inefficaciousness /,inefi''keiʃəsnis/<br />*  danh từ<br />- tính không thể đem lại kết quả mong nuốn; tính không có hiệu quả, tính không công hiệu</Q></N></I></F></C>'),
(63912, 'inefficacy', '<C><F><I><N><Q>@inefficacy /in''efikəsi/<br />*  danh từ<br />- sự không thể đem lại kết quả mong nuốn; sự không có hiệu quả, sự không công hiệu</Q></N></I></F></C>'),
(63913, 'inefficiencies', '<C><F><I><N><Q>@inefficiency /,ini''fiʃənsi/<br />*  danh từ<br />- sự thiếu khả năng, sự không có khả năng, sự bất tài (người); điều chứng tỏ thiếu khả năng; điều chứng tỏ không có khả năng<br />- sự không có hiệu quả<br /><br />@inefficiency<br />- tính không hiệu quả</Q></N></I></F></C>'),
(63914, 'inefficiency', '<C><F><I><N><Q>@inefficiency /,ini''fiʃənsi/<br />*  danh từ<br />- sự thiếu khả năng, sự không có khả năng, sự bất tài (người); điều chứng tỏ thiếu khả năng; điều chứng tỏ không có khả năng<br />- sự không có hiệu quả<br /><br />@inefficiency<br />- tính không hiệu quả</Q></N></I></F></C>'),
(63915, 'inefficient', '<C><F><I><N><Q>@inefficient /,ini''fiʃənt/<br />*  tính từ<br />- thiếu khả năng, không có khả năng, bất tài<br />- không có hiệu quả<br /><br />@inefficient<br />- không hiệu quả<br /><br />@inefficient<br />- không hiệu quả</Q></N></I></F></C>'),
(63916, 'inefficiently', '<C><F><I><N><Q>@inefficiently<br />* phó từ<br />- kém cỏi, yếu kém<br />- vô ích, vô hiệu quả</Q></N></I></F></C>'),
