(63919, 'Inelastic and unit elastic demand', '<C><F><I><N><Q>@Inelastic and unit elastic demand<br />- (Econ)</Q></N></I></F></C>'),
(63920, 'inelasticity', '<C><F><I><N><Q>@inelasticity /,inilæs''tisiti/<br />*  danh từ<br />- tính không co dân, tính không đàn hồi<br />- tính không mềm dẻo, tính khó thích nghi<br />- (kinh tế) sự phản ứng chậm đối với những sự thay đổi (thị trường...)</Q></N></I></F></C>'),
(63921, 'inelegance', '<C><F><I><N><Q>@inelegance /in''eligəns/<br />*  danh từ<br />- tính thiếu trang nhã, tính không thanh nhã; cái thiếu trang nhã, cái không thanh nhã<br />- tính thiếu chải chuốt (văn)</Q></N></I></F></C>'),
