(63924, 'ineligibility', '<C><F><I><N><Q>@ineligibility /in,elidʤə''biliti/<br />*  danh từ<br />- sự không đủ tư cách, sự không đủ tiêu chuẩn; sự không đủ khả năng; sự không đạt tiêu chuẩn tòng quân</Q></N></I></F></C>'),
