(63940, 'inequalities', '<C><F><I><N><Q>@Inequality<br />- (Econ) Bất đẳng thức.<br />+ Quan hệ nói lên một hàm số của một biến (hay một tập hợp các biến) lớn hơn hay nhỏ hơn một số nào đó.</Q></N></I></F></C><C><F><I><N><Q>@inequality /,ini:''kwɔliti/<br />*  danh từ<br />- sự không bằng nhau; sự không bình đẳng<br />- tính không đều<br />- sự khác nhau<br />- tính hay thay đổi<br />- sự không công minh<br />- (toán học) bất đẳng thức<br /><br />@inequality<br />- bất đẳng thức<br />- absolute i. bất đẳng thức tuyệt đối <br />- conditinal i. bất đẳng thức có điều kiện <br />- integral i. bất đẳng thức tích phân<br />- isoperimetric (al) i. (hình học) bất đẳng thức chu<br />- strric i. bất đẳng thức ngặt<br />- triangle i. bất đẳng thức tam giác<br />- unconditional i. bất đẳng thức vô điều kiện</Q></N></I></F></C>'),
(63941, 'Inequality', '<C><F><I><N><Q>@Inequality<br />- (Econ) Bất đẳng thức.<br />+ Quan hệ nói lên một hàm số của một biến (hay một tập hợp các biến) lớn hơn hay nhỏ hơn một số nào đó.</Q></N></I></F></C>'),
