(64073, 'infancies', '<C><F><I><N><Q>@infancy /''infənsi/<br />*  danh từ<br />- tuổi còn ãm ngửa, tuổi thơ ấu<br />- lúc còn trứng nước<br />- (pháp lý) thời kỳ vị thành niên</Q></N></I></F></C>'),
(64074, 'infancy', '<C><F><I><N><Q>@infancy /''infənsi/<br />*  danh từ<br />- tuổi còn ãm ngửa, tuổi thơ ấu<br />- lúc còn trứng nước<br />- (pháp lý) thời kỳ vị thành niên</Q></N></I></F></C>');
INSERT INTO `tbl_edict` (`id`, `word`, `detail`) VALUES
(64075, 'infant', '<C><F><I><N><Q>@infant /''infənt/<br />*  danh từ<br />- đứa bé còn ãm ngửa, đứa bé (dưới 7 tuổi)<br />- (pháp lý) người vị thành niên<br />- (từ Mỹ,nghĩa Mỹ) (nghĩa bóng) người mới vào nghề, lính mới<br />*  tính từ<br />- còn thơ ấu, ở tuổi còn thơ<br />- còn trứng nước<br />- (pháp lý) vị thành niên</Q></N></I></F></C>'),
(64076, 'Infant industry', '<C><F><I><N><Q>@Infant industry<br />- (Econ) Ngành công nghiệp non trẻ.<br />+ Ngành công nghiệp trong thời kỳ đầu phát triển, thị phần nội địa của nó hiện còn nhỏ do sự cạnh tranh của các đối thủ nước ngoài.</Q></N></I></F></C>'),
(64077, 'Infant industry argument for protection', '<C><F><I><N><Q>@Infant industry argument for protection<br />- (Econ) Luận điểm bảo hộ ngành công nghiệp non trẻ.<br />+ Một trong những lý lẽ bảo hộ lâu đời nhất cho rằng một ngành công nghiệp là mới đối với đất nước và nhỏ hơn quy mô tối ưu có thể không có khả năg đứng vững trong cạnh tranh với nước ngoài trong thời kỳ non trẻ.</Q></N></I></F></C>'),
(64078, 'Infant industry tariff argument', '<C><F><I><N><Q>@Infant industry tariff argument<br />- (Econ) Luận điểm về lập thuế quan bảo hộ ngành công nghiệp non trẻ.</Q></N></I></F></C>'),
(64079, 'infant prodigy', '<C><F><I><N><Q>@infant prodigy<br />* danh từ<br />- đứa trẻ thông minh lạ thường, thần đồng</Q></N></I></F></C>'),
