(64207, 'infinitesimals', '<C><F><I><N><Q>@infinitesimal /,infini''tesiməl/<br />*  tính từ<br />- rất nhỏ, nhỏ vô cùng<br />- (toán học) vi phân<br />=infinitesimal geometry+ hình học vi phân<br />=infinitesimal transformation+ biến đổi vi phân<br />*  danh từ<br />- số lượng rất nhỏ, số lượng nhỏ vô cùng<br />- (toán học) vi phân<br /><br />@infinitesimal<br />- vi phân, vô cùng bé<br />- primary i. vi phân cơ bản; (giải tích) vô cùng bé cơ bản<br />- standard i. vi phân tiêu chuẩn; (giải tích) vô cùng bé cơ sở</Q></N></I></F></C>'),
(64208, 'infinities', '<C><F><I><N><Q>@infinity /in''finiti/<br />*  danh từ<br />- (như) infinitude<br />- (toán học) vô cực, vô tận<br />!to infinity<br />- vô cùng, vô tận<br /><br />@infinity<br />- vô số, vô cực, vô hạn, vô tận at i. ở vô cực; to end at i. kết thúc ở<br />- vô cực; to extend to i. kéo dài đến vô cực; to let... <br />- approach i. để tiến dần đến vô cực <br />- actual i. vô hạn thực tại<br />- completed i. (logic học) vô hạn [thực tại, hoàn chỉnh]<br />- constructive i. (logic học) vô hạn kiến thiết <br />- potential i. (logic học) vô hạn tiềm năng<br />- single i. vô hạn đơn</Q></N></I></F></C>'),
(64209, 'infinitival', '<C><F><I><N><Q>@infinitival /in,fini''taivəl/<br />*  tính từ<br />- (ngôn ngữ học) vô định, ở lối vô định</Q></N></I></F></C>'),
(64210, 'infinitive', '<C><F><I><N><Q>@infinitive /in''finitiv/<br />*  tính từ<br />- (ngôn ngữ học) vô định<br />*  danh từ<br />- (ngôn ngữ học) lối vô định</Q></N></I></F></C>'),
(64211, 'infinitives', '<C><F><I><N><Q>@infinitive /in''finitiv/<br />*  tính từ<br />- (ngôn ngữ học) vô định<br />*  danh từ<br />- (ngôn ngữ học) lối vô định</Q></N></I></F></C>'),
(64212, 'infinitize', '<C><F><I><N><Q>@infinitize /in''finitaiz/<br />*  ngoại động từ<br />- làm cho không có bờ bến, làm thành vô tận</Q></N></I></F></C>'),
(64213, 'infinitude', '<C><F><I><N><Q>@infinitude /in''finitju:d/<br />*  danh từ ((cũng) infinity)<br />- tính không bờ bến, tính vô tận<br />- số lượng vô cùng lớn; quy mô vô cùng lớn</Q></N></I></F></C>'),
(64214, 'infinity', '<C><F><I><N><Q>@infinity /in''finiti/<br />*  danh từ<br />- (như) infinitude<br />- (toán học) vô cực, vô tận<br />!to infinity<br />- vô cùng, vô tận<br /><br />@infinity<br />- vô số, vô cực, vô hạn, vô tận at i. ở vô cực; to end at i. kết thúc ở<br />- vô cực; to extend to i. kéo dài đến vô cực; to let... <br />- approach i. để tiến dần đến vô cực <br />- actual i. vô hạn thực tại<br />- completed i. (logic học) vô hạn [thực tại, hoàn chỉnh]<br />- constructive i. (logic học) vô hạn kiến thiết <br />- potential i. (logic học) vô hạn tiềm năng<br />- single i. vô hạn đơn</Q></N></I></F></C>'),
(64215, 'infirm', '<C><F><I><N><Q>@infirm /in''fə:m/<br />*  tính từ<br />- yếu đuối, ốm yếu, hom hem<br />- yếu ớt; nhu nhược, không cương quyết<br />- không kiên định</Q></N></I></F></C>'),
