(64224, 'infixed', '<C><F><I><N><Q>@infix /''infiks/<br />*  danh từ<br />- (ngôn ngữ học) trung tố<br />*  ngoại động từ<br />- gắn (cái gì vào cái gì)<br />- in sâu, khắc sâu (vào trí óc...)<br />- (ngôn ngữ học) thêm trung tố</Q></N></I></F></C>'),
