(64227, 'inflame', '<C><F><I><N><Q>@inflame /in''fleim/<br />*  ngoại động từ<br />- đốt, châm lửa vào<br />- khích động mạnh<br />- làm nóng bừng, làm đỏ bừng<br />- (y học) làm viêm, làm sưng tấy<br />*  nội động từ<br />- cháy<br />- bị khích động mạnh<br />- nóng bừng, đỏ bừng<br />- (y học) viêm, sưng tấy</Q></N></I></F></C>'),
(64228, 'inflamed', '<C><F><I><N><Q>@inflamed<br />* tính từ<br />- (inflamed by / with something) đỏ tấy và đau; viêm<br />= inflamed eyes+mắt sưng tấy<br />= a nose inflamed by an infection+mũi viêm do nhiễm trùng<br />- căm phẫn; phẫn nộ<br />= inflamed by one''s colleague''s remarks+nổi giận vì lời nhận xét của đồng nghiệp<br />= inflamed with passion+bừng bừng nổi giận</Q></N></I></F></C><C><F><I><N><Q>@inflame /in''fleim/<br />*  ngoại động từ<br />- đốt, châm lửa vào<br />- khích động mạnh<br />- làm nóng bừng, làm đỏ bừng<br />- (y học) làm viêm, làm sưng tấy<br />*  nội động từ<br />- cháy<br />- bị khích động mạnh<br />- nóng bừng, đỏ bừng<br />- (y học) viêm, sưng tấy</Q></N></I></F></C>'),
