(64231, 'inflaming', '<C><F><I><N><Q>@inflame /in''fleim/<br />*  ngoại động từ<br />- đốt, châm lửa vào<br />- khích động mạnh<br />- làm nóng bừng, làm đỏ bừng<br />- (y học) làm viêm, làm sưng tấy<br />*  nội động từ<br />- cháy<br />- bị khích động mạnh<br />- nóng bừng, đỏ bừng<br />- (y học) viêm, sưng tấy</Q></N></I></F></C>'),
(64232, 'inflammabilities', '<C><F><I><N><Q>@inflammability /in,flæmə''biliti/ (inflammableness) /in''flæməblnis/<br />*  danh từ<br />- tính dễ cháy<br />- tính dễ bị khích động</Q></N></I></F></C>'),
