(64238, 'inflammations', '<C><F><I><N><Q>@inflammation /,inflə''meiʃn/<br />*  danh từ<br />- sự đốt cháy; sự bốc cháy<br />- sự khích động; sự bị khích động<br />- (y học) viêm</Q></N></I></F></C>'),
