(64240, 'inflammatory', '<C><F><I><N><Q>@inflammatory /in''flæmətəri/<br />*  tính từ<br />- có tính chất khích động, nhằm khích động<br />- (y học) dễ viên, do viêm</Q></N></I></F></C>'),
(64241, 'inflatable', '<C><F><I><N><Q>@inflatable /in''fleitəbl/<br />*  tính từ<br />- có thể bơm phồng, có thể thổi phồng</Q></N></I></F></C>'),
(64242, 'inflate', '<C><F><I><N><Q>@inflate /in''fleit/<br />*  ngoại động từ<br />- thổi phồng, bơm phồng<br />- làm tự mãn, tự túc, làm vênh váo<br />- làm vui mừng<br />- (kinh tế) lạm phát (tiền); gây lạm phát<br />- tăng (giá) một cách giả tạo<br />*  nội động từ<br />- phồng lên, được thổi phồng</Q></N></I></F></C>'),
(64243, 'inflated', '<C><F><I><N><Q>@inflated /in''fleitid/<br />*  tính từ<br />- phồng lên, được thổi phồng<br />- tự mãn, tự túc, vênh váo<br />- khoa trương (văn)<br />- (kinh tế) lạm phát<br />- tăng giả tạo (giá)</Q></N></I></F></C><C><F><I><N><Q>@inflate /in''fleit/<br />*  ngoại động từ<br />- thổi phồng, bơm phồng<br />- làm tự mãn, tự túc, làm vênh váo<br />- làm vui mừng<br />- (kinh tế) lạm phát (tiền); gây lạm phát<br />- tăng (giá) một cách giả tạo<br />*  nội động từ<br />- phồng lên, được thổi phồng</Q></N></I></F></C>'),
(64244, 'inflater', '<C><F><I><N><Q>@inflater<br />- xem inflate</Q></N></I></F></C>'),
(64245, 'inflates', '<C><F><I><N><Q>@inflate /in''fleit/<br />*  ngoại động từ<br />- thổi phồng, bơm phồng<br />- làm tự mãn, tự túc, làm vênh váo<br />- làm vui mừng<br />- (kinh tế) lạm phát (tiền); gây lạm phát<br />- tăng (giá) một cách giả tạo<br />*  nội động từ<br />- phồng lên, được thổi phồng</Q></N></I></F></C>'),
(64246, 'inflating', '<C><F><I><N><Q>@inflate /in''fleit/<br />*  ngoại động từ<br />- thổi phồng, bơm phồng<br />- làm tự mãn, tự túc, làm vênh váo<br />- làm vui mừng<br />- (kinh tế) lạm phát (tiền); gây lạm phát<br />- tăng (giá) một cách giả tạo<br />*  nội động từ<br />- phồng lên, được thổi phồng</Q></N></I></F></C>'),
(64247, 'Inflation', '<C><F><I><N><Q>@Inflation<br />- (Econ) Lạm phát.<br />+ Sự gia tăng đáng kể trong mức giá chung hay tỉ lệ tăng của mức giá chung trên một đơn vị thời gian.</Q></N></I></F></C>'),
(64248, 'inflation', '<C><F><I><N><Q>@inflation /in''fleiʃn/<br />*  danh từ<br />- sự bơm phồng, sự thổi phồng; tình trạng được bơm phồng, tình trạng được thổi phồng<br />- sự lạm phát<br />- sự tăng giá giả tạo</Q></N></I></F></C>'),
(64249, 'Inflation accounting', '<C><F><I><N><Q>@Inflation accounting<br />- (Econ) Hạch toán lạm phát.<br />+ Chỉ các kỹ thuật xác định tác động của lạm phát đến các tài khoản và các thủ tục hạch toán.</Q></N></I></F></C>'),
(64250, 'Inflation-adjusted budget', '<C><F><I><N><Q>@Inflation-adjusted budget<br />- (Econ) Ngân sách được điều chỉnh theo lạm phát.</Q></N></I></F></C>'),
(64251, 'Inflation rate', '<C><F><I><N><Q>@Inflation rate<br />- (Econ) Tỷ lệ lạm phát.</Q></N></I></F></C>'),
(64252, 'Inflation subsidy', '<C><F><I><N><Q>@Inflation subsidy<br />- (Econ) Trợ cấp lạm phát.<br />+ Do tính không linh hoạt về thể chế mà lãi suất và thanh toán nợ có thể không cùng tăng với lạm phát, do đó LÃI SUẤT THỰC TẾ và giá trị thực tế của nợ giảm xuống.</Q></N></I></F></C>'),
(64253, 'Inflation, suppressed', '<C><F><I><N><Q>@Inflation, suppressed<br />- (Econ) Lạm phát bị nén.<br />+ Lạm phát bị nén nảy sinh nếu việc kiểm soát giá giữ giá cả ở mức thấp trong khi nền kinh tế đang có xu hướng lạm phát nói chung. Xem Inflation.</Q></N></I></F></C>'),
(64254, 'Inflation tax', '<C><F><I><N><Q>@Inflation tax<br />- (Econ) Thuế lạm phát.<br />+ Tình huống khi chính phủ thực hiện chính sách tăng lạm phát thay cho việc tăng thuế để thanh toán cho các khoản chi tiêu của mình.</Q></N></I></F></C>'),
(64255, 'inflationary', '<C><F><I><N><Q>@inflationary /in''fleiʃnəri/<br />*  tính từ<br />- (thuộc) lạm phát; gây lạm phát</Q></N></I></F></C>'),
(64256, 'Inflationary gap', '<C><F><I><N><Q>@Inflationary gap<br />- (Econ) Hố cách / khoảng trống lạm phát, chênh lệch lạm phát.<br />+ Tổng chi tiêu vượt quá mức sản lượng tối đa có thể đạt được dẫn đến kết quả gây sức ép làm cho giá cả tăng lên.</Q></N></I></F></C>'),
(64257, 'Inflationary spiral', '<C><F><I><N><Q>@Inflationary spiral<br />- (Econ) Vòng xoáy ốc của lạm phát.<br />+ Xem HYPERINFLATION, INFLATION.</Q></N></I></F></C>'),
(64258, 'inflationism', '<C><F><I><N><Q>@inflationism /in''fleiʃənizm/<br />*  danh từ<br />- chính sách lạm phát</Q></N></I></F></C>'),
(64259, 'inflationist', '<C><F><I><N><Q>@inflationist /in''fleiʃənist/<br />*  danh từ<br />- người theo chính sách lạm phát</Q></N></I></F></C>'),
(64260, 'inflationists', '<C><F><I><N><Q>@inflationist /in''fleiʃənist/<br />*  danh từ<br />- người theo chính sách lạm phát</Q></N></I></F></C>'),
(64261, 'inflations', '<C><F><I><N><Q>@Inflation<br />- (Econ) Lạm phát.<br />+ Sự gia tăng đáng kể trong mức giá chung hay tỉ lệ tăng của mức giá chung trên một đơn vị thời gian.</Q></N></I></F></C><C><F><I><N><Q>@inflation /in''fleiʃn/<br />*  danh từ<br />- sự bơm phồng, sự thổi phồng; tình trạng được bơm phồng, tình trạng được thổi phồng<br />- sự lạm phát<br />- sự tăng giá giả tạo</Q></N></I></F></C>'),
(64262, 'inflator', '<C><F><I><N><Q>@inflator /in''fleitə/<br />*  danh từ<br />- cái bơm<br />- người bơm phồng, người thổi phồng</Q></N></I></F></C>'),
