(64325, 'Informal sector', '<C><F><I><N><Q>@Informal sector<br />- (Econ) Khu vực không chính thức.<br />+ Chỉ một số lượng lớn những người tự làm việc cho mình trong một nước đang phát triển, những người này tham gia vào các công việc quy mô nhỏ, chẳng hạn chủ may vá, dịch vụ ăn uống, buôn bán, sửa chữa giày dép….</Q></N></I></F></C>'),
