(64595, 'initiate', '<C><F><I><N><Q>@initiate /i''niʃiit/<br />*  danh từ<br />- người đã được vỡ lòng, người đã được khai tâm, người được bắt đầu làm quen với một bộ môn<br />- người đã được làm lễ kết nạp; người đã được thụ giáo<br />*  tính từ<br />- đã được vỡ lòng, đã được khai tâm, đã được bắt đầu làm quen với (một bộ môn khoa học...)<br />- đã được làm lễ kết nạp; đã được thụ giáo<br />*  ngoại động từ<br />- bắt đầu, khởi đầu, đề xướng<br />- vỡ lòng, khai tâm, bắt đầu làm quen cho (ai về một bộ môn gì...)<br />- làm lễ kết nạp; làm lễ thụ giáo cho (ai)<br /><br />@initiate<br />- bắt đầu; khởi đầu</Q></N></I></F></C>'),
(64596, 'initiated', '<C><F><I><N><Q>@initiate /i''niʃiit/<br />*  danh từ<br />- người đã được vỡ lòng, người đã được khai tâm, người được bắt đầu làm quen với một bộ môn<br />- người đã được làm lễ kết nạp; người đã được thụ giáo<br />*  tính từ<br />- đã được vỡ lòng, đã được khai tâm, đã được bắt đầu làm quen với (một bộ môn khoa học...)<br />- đã được làm lễ kết nạp; đã được thụ giáo<br />*  ngoại động từ<br />- bắt đầu, khởi đầu, đề xướng<br />- vỡ lòng, khai tâm, bắt đầu làm quen cho (ai về một bộ môn gì...)<br />- làm lễ kết nạp; làm lễ thụ giáo cho (ai)<br /><br />@initiate<br />- bắt đầu; khởi đầu</Q></N></I></F></C>'),
