(64598, 'initiating', '<C><F><I><N><Q>@initiate /i''niʃiit/<br />*  danh từ<br />- người đã được vỡ lòng, người đã được khai tâm, người được bắt đầu làm quen với một bộ môn<br />- người đã được làm lễ kết nạp; người đã được thụ giáo<br />*  tính từ<br />- đã được vỡ lòng, đã được khai tâm, đã được bắt đầu làm quen với (một bộ môn khoa học...)<br />- đã được làm lễ kết nạp; đã được thụ giáo<br />*  ngoại động từ<br />- bắt đầu, khởi đầu, đề xướng<br />- vỡ lòng, khai tâm, bắt đầu làm quen cho (ai về một bộ môn gì...)<br />- làm lễ kết nạp; làm lễ thụ giáo cho (ai)<br /><br />@initiate<br />- bắt đầu; khởi đầu</Q></N></I></F></C>'),
(64599, 'initiation', '<C><F><I><N><Q>@initiation /i,niʃi''eiʃn/<br />*  danh từ<br />- sự bắt đầu, sự khởi đầu, sự khởi xướng<br />- sự vỡ lòng, sự khai tâm, sự bắt đầu làm quen với (một bộ môn khoa học...)<br />- sự chính thức làm lễ kết nạp, lễ kết nạp</Q></N></I></F></C>'),
(64600, 'initiations', '<C><F><I><N><Q>@initiation /i,niʃi''eiʃn/<br />*  danh từ<br />- sự bắt đầu, sự khởi đầu, sự khởi xướng<br />- sự vỡ lòng, sự khai tâm, sự bắt đầu làm quen với (một bộ môn khoa học...)<br />- sự chính thức làm lễ kết nạp, lễ kết nạp</Q></N></I></F></C>'),
(64601, 'initiative', '<C><F><I><N><Q>@initiative /i''niʃiətiv/<br />*  tính từ<br />- bắt đầu, khởi đầu<br />*  danh từ<br />- bước đầu, sự khởi đầu, sự khởi xướng<br />=to take the initiative in something+ dẫn đầu trong việc gì, làm đầu tàu trong việc gì; khởi xướng việc gì<br />=to have the initiative+ có khả năng dẫn đầu; có quyền dẫn đầu<br />- sáng kiến, óc sáng kiến<br />- (quân sự) thế chủ động<br />=to hold the initiative+ nắm thế chủ động<br />- quyền đề xướng luật lệ của người công dân (Thuỵ sĩ...)</Q></N></I></F></C>'),
(64602, 'initiatively', '<C><F><I><N><Q>@initiatively<br />- xem initiative</Q></N></I></F></C>'),
(64603, 'initiatives', '<C><F><I><N><Q>@initiative /i''niʃiətiv/<br />*  tính từ<br />- bắt đầu, khởi đầu<br />*  danh từ<br />- bước đầu, sự khởi đầu, sự khởi xướng<br />=to take the initiative in something+ dẫn đầu trong việc gì, làm đầu tàu trong việc gì; khởi xướng việc gì<br />=to have the initiative+ có khả năng dẫn đầu; có quyền dẫn đầu<br />- sáng kiến, óc sáng kiến<br />- (quân sự) thế chủ động<br />=to hold the initiative+ nắm thế chủ động<br />- quyền đề xướng luật lệ của người công dân (Thuỵ sĩ...)</Q></N></I></F></C>'),
(64604, 'initiator', '<C><F><I><N><Q>@initiator /i''niʃieitə/<br />*  danh từ<br />- người bắt đầu, người khởi đầu, người khởi xướng<br />- người vỡ lòng, người khai tâm<br />- người làm lễ kết nạp; người cho thụ giáo</Q></N></I></F></C>'),
(64605, 'initiators', '<C><F><I><N><Q>@initiator /i''niʃieitə/<br />*  danh từ<br />- người bắt đầu, người khởi đầu, người khởi xướng<br />- người vỡ lòng, người khai tâm<br />- người làm lễ kết nạp; người cho thụ giáo</Q></N></I></F></C>'),
(64606, 'initiatory', '<C><F><I><N><Q>@initiatory /i''niʃiətəri/<br />*  tính từ<br />- mở đầu, bắt đầu, đầu<br />- để vỡ lòng, để khai tâm<br />- để kết nạp; để thụ giáo</Q></N></I></F></C>'),
(64607, 'initiatress', '<C><F><I><N><Q>@initiatress /i''niʃieitris/<br />*  danh từ ((cũng) initiatrix)<br />- người bắt đầu, người khởi đầu, người khởi xướng (đàn bà)<br />- người vỡ lòng, người khai tâm (đàn bà)<br />- người làm lễ kết nạp; người cho thụ giáo (đàn bà)</Q></N></I></F></C>'),
