(64610, 'initio', '<C><F><I><N><Q>@initio /i''niʃiou/<br />*  phó từ<br />- ((viết tắt) init) ab initio ở đầu (đoạn trong sách...)</Q></N></I></F></C>'),
(64611, 'inject', '<C><F><I><N><Q>@inject /in''dʤekt/<br />*  ngoại động từ<br />- tiêm (thuốc...), tiêm thuốc<br />- (từ Mỹ,nghĩa Mỹ) xen (lời nhận xét...) vào câu chuyện, xen (cái gì) vào một cách vũ đoán, xen (cái gì) một cách lạc lõng<br />*  danh từ<br />- (viết tắt) của injection (trong đơn thuốc)<br /><br />@inject<br />- nội xạ, đưa vào, phun vào</Q></N></I></F></C>'),
(64612, 'injectable', '<C><F><I><N><Q>@injectable<br />* tính từ<br />- có thể tiêm vào</Q></N></I></F></C>'),
(64613, 'injectant', '<C><F><I><N><Q>@injectant<br />* danh từ<br />- chất tiêm vào một cái gì</Q></N></I></F></C>'),
(64614, 'injected', '<C><F><I><N><Q>@inject /in''dʤekt/<br />*  ngoại động từ<br />- tiêm (thuốc...), tiêm thuốc<br />- (từ Mỹ,nghĩa Mỹ) xen (lời nhận xét...) vào câu chuyện, xen (cái gì) vào một cách vũ đoán, xen (cái gì) một cách lạc lõng<br />*  danh từ<br />- (viết tắt) của injection (trong đơn thuốc)<br /><br />@inject<br />- nội xạ, đưa vào, phun vào</Q></N></I></F></C>'),
(64615, 'injecting', '<C><F><I><N><Q>@inject /in''dʤekt/<br />*  ngoại động từ<br />- tiêm (thuốc...), tiêm thuốc<br />- (từ Mỹ,nghĩa Mỹ) xen (lời nhận xét...) vào câu chuyện, xen (cái gì) vào một cách vũ đoán, xen (cái gì) một cách lạc lõng<br />*  danh từ<br />- (viết tắt) của injection (trong đơn thuốc)<br /><br />@inject<br />- nội xạ, đưa vào, phun vào</Q></N></I></F></C>'),
(64616, 'injection', '<C><F><I><N><Q>@injection /in''dʤekʃn/<br />*  danh từ<br />- sự tiêm<br />- chất tiêm, thuốc tiêm<br />- mũi tiêm, phát tiêm<br />- (kỹ thuật) sự phun<br />- (toán học) phép nội xạ<br /><br />@injection<br />- phép nội xạ đơn ánh<br />- diagonal i. đơn ánh chéo<br />- natural i. đơn ánh tự nhiên</Q></N></I></F></C>'),
(64617, 'Injections', '<C><F><I><N><Q>@Injections<br />- (Econ) Sự bơm tiền.<br />+ Sự bổ sung ngoại sinh vào số thu nhập của các doanh nghiệp và hộ gia đình.</Q></N></I></F></C>'),
