(64623, 'injudicious', '<C><F><I><N><Q>@injudicious /,indʤu:''diʃəs/<br />*  tính từ<br />- thiếu cân nhắc, thiếu suy nghĩ; dại dột, tếu</Q></N></I></F></C>'),
