(64685, 'inmate', '<C><F><I><N><Q>@inmate /''immeit/<br />*  danh từ<br />- người ở cùng (trong một nhà...)<br />- người bệnh (nằm trong bệnh viện, nhà thương điên...)<br />- người ở tù</Q></N></I></F></C>'),
(64686, 'inmates', '<C><F><I><N><Q>@inmate /''immeit/<br />*  danh từ<br />- người ở cùng (trong một nhà...)<br />- người bệnh (nằm trong bệnh viện, nhà thương điên...)<br />- người ở tù</Q></N></I></F></C>'),
(64687, 'inmost', '<C><F><I><N><Q>@inmost /''inəmoust/ (inmost) /''inmoust/<br />*  tính từ<br />- ở tận trong cùng<br />- ở tận đáy lòng, trong thâm tâm<br />*  danh từ<br />- nơi tận trong cùng; phần ở tận trong cùng</Q></N></I></F></C>'),
(64688, 'inn', '<C><F><I><N><Q>@inn /in/<br />*  danh từ<br />- quán trọ, khách sạn nhỏ (ở nông thôn, thị trấn)<br />- (Inn) nhà nội trú (của học sinh đại học)<br />*  ngoại động từ<br />- (từ Mỹ,nghĩa Mỹ) cho ở trọ<br />*  nội động từ<br />- (từ Mỹ,nghĩa Mỹ) ở trọ</Q></N></I></F></C>'),
(64689, 'inn of court', '<C><F><I><N><Q>@inn of court<br />* danh từ<br />- dinh thự do một trong bốn hội luật gia Anh nắm giữ</Q></N></I></F></C>'),
(64690, 'innage', '<C><F><I><N><Q>@innage /''inidʤ/<br />*  danh từ<br />- số hàng tồn dư (còn lại sau khi cho lên tàu)<br />- (hàng không) lượng chất đốt tồn dư (còn trong thùng sau một chuyến bay)</Q></N></I></F></C>'),
(64691, 'innards', '<C><F><I><N><Q>@innards /''inədz/<br />*  danh từ số nhiều<br />- bộ lòng<br />- những bộ phận bên trong (cái gì)</Q></N></I></F></C>'),
