(64695, 'innavigable', '<C><F><I><N><Q>@innavigable /i''nævigəbl/<br />*  tính từ<br />- thuyền bè không đi lại được</Q></N></I></F></C>'),
(64696, 'inner', '<C><F><I><N><Q>@inner /''inə/<br />*  tính từ<br />- ở trong nước, nội bộ<br />- thân nhất, thân cận<br />- (thuộc) tinh thần; bên trong<br />=inner life+ cuộc sống bên trong, cuộc sống tinh thần<br />- trong thâm tâm, thầm kín<br />=inner emotion+ mối xúc cảm thầm kín<br />*  danh từ<br />- bên trong<br />- vòng sát điểm đen (của bia); phát bắn trúng vòng sát điểm đen (của bia)<br /><br />@inner<br />- ở trong, bên trong</Q></N></I></F></C>'),
