(64714, 'innervation', '<C><F><I><N><Q>@innervation /,inə:''veiʃn/<br />*  danh từ<br />- sự làm cho có gân cốt, sự làm cho cứng cáp; sự làm cho rắn rỏi; sự kích thích<br />- (giải phẫu) sự phân bố dây thần kinh</Q></N></I></F></C>'),
