(64718, 'innholder', '<C><F><I><N><Q>@innholder /''in,ki:pə/ (innholder) /''in,houldə/<br />*  danh từ<br />- chủ quán trọ, chủ khách sạn nhỏ (ở nông thôn, thị trấn)</Q></N></I></F></C>'),
