(64720, 'inning', '<C><F><I><N><Q>@inning /''iniɳ/<br />*  danh từ<br />- lượt chơi của một phía; lượt chơi của một cầu thủ (crickê, bóng chày) ((cũng) inngs)</Q></N></I></F></C>'),
(64721, 'innings', '<C><F><I><N><Q>@innings /''iniɳz/<br />*  danh từ,  số nhiều inning  /''iniɳ/ (thông tục),  inningses  /''iniɳziz/<br />- lượt chơi của một phía; lượt chơi của một cầy thủ (crickê, bóng chày)<br />- lúc cờ đến tay, lúc cơ hội đến tay; thời kỳ cầm quyền<br />- (từ Mỹ,nghĩa Mỹ) sự gặt hái<br />- (từ Mỹ,nghĩa Mỹ) đất khai hoang (do biển bồi lên; sự khai hoang đất lầy)</Q></N></I></F></C><C><F><I><N><Q>@inning /''iniɳ/<br />*  danh từ<br />- lượt chơi của một phía; lượt chơi của một cầu thủ (crickê, bóng chày) ((cũng) inngs)</Q></N></I></F></C>'),
(64722, 'innit', '<C><F><I><N><Q>@innit<br />- (Anh không chuẩn) isn''t it - dùng ở cuối một đoạn phát biểu để biểu thị sự đồng ý hoặc nhấn mạnh<br />= Well,  that''s up to them innit ?+ờ,  tùy ở họ thôi, có phải không?</Q></N></I></F></C>'),
(64723, 'innkeeper', '<C><F><I><N><Q>@innkeeper /''in,ki:pə/ (innholder) /''in,houldə/<br />*  danh từ<br />- chủ quán trọ, chủ khách sạn nhỏ (ở nông thôn, thị trấn)</Q></N></I></F></C>'),
(64724, 'innkeepers', '<C><F><I><N><Q>@innkeeper /''in,ki:pə/ (innholder) /''in,houldə/<br />*  danh từ<br />- chủ quán trọ, chủ khách sạn nhỏ (ở nông thôn, thị trấn)</Q></N></I></F></C>'),
(64725, 'innocence', '<C><F><I><N><Q>@innocence /''inəsns/ (innocency) /''inəsnsi/<br />*  danh từ<br />- tính vô tội, tính không có tội<br />- (từ Mỹ,nghĩa Mỹ) tính trong trắng; sự còn trinh<br />- tính ngây thơ<br />- tính không có hại, tính không hại<br />- (từ Mỹ,nghĩa Mỹ) người vô tội; người ngây thơ</Q></N></I></F></C>'),
(64726, 'innocency', '<C><F><I><N><Q>@innocency /''inəsns/ (innocency) /''inəsnsi/<br />*  danh từ<br />- tính vô tội, tính không có tội<br />- (từ Mỹ,nghĩa Mỹ) tính trong trắng; sự còn trinh<br />- tính ngây thơ<br />- tính không có hại, tính không hại<br />- (từ Mỹ,nghĩa Mỹ) người vô tội; người ngây thơ</Q></N></I></F></C>'),
(64727, 'innocent', '<C><F><I><N><Q>@innocent /''inəsnt/<br />*  tính từ<br />- vô tội; không có tội<br />- (từ Mỹ,nghĩa Mỹ) còn trong trắng; còn trinh<br />- ngây thơ<br />- không có hại, không hại<br />!windows innocent of glass<br />- (thông tục) cửa sổ không có kính<br />*  danh từ<br />- người vô tội; người không có tội<br />- đứa bé ngây thơ<br />- thằng ngốc, thằng bé ngớ ngẩn<br />!massacre (slaughter) of innocents<br />- (từ lóng) sự bỏ qua của một số dự luật vì hết ngày giờ (ở cuối khoá họp nghị viện)</Q></N></I></F></C>'),
(64728, 'Innocent entry barrier', '<C><F><I><N><Q>@Innocent entry barrier<br />- (Econ) Cản trở vô tình đối với việc nhập ngành; Cản trở ngẫu nhiên đối với việc nhập ngành.</Q></N></I></F></C>'),
(64729, 'innocently', '<C><F><I><N><Q>@innocently<br />* phó từ<br />- ngây thơ, vô tội</Q></N></I></F></C>'),
(64730, 'innocents', '<C><F><I><N><Q>@innocent /''inəsnt/<br />*  tính từ<br />- vô tội; không có tội<br />- (từ Mỹ,nghĩa Mỹ) còn trong trắng; còn trinh<br />- ngây thơ<br />- không có hại, không hại<br />!windows innocent of glass<br />- (thông tục) cửa sổ không có kính<br />*  danh từ<br />- người vô tội; người không có tội<br />- đứa bé ngây thơ<br />- thằng ngốc, thằng bé ngớ ngẩn<br />!massacre (slaughter) of innocents<br />- (từ lóng) sự bỏ qua của một số dự luật vì hết ngày giờ (ở cuối khoá họp nghị viện)</Q></N></I></F></C>'),
(64731, 'innocuity', '<C><F><I><N><Q>@innocuity /,inə''kju:iti/ (innocuousness) /i''nɔkjuəsnis/<br />*  danh từ<br />- tính chất không độc, tính chất không có hại; tính chất vô thưởng, vô phạt<br />- (từ Mỹ,nghĩa Mỹ) tính chất tẻ nhạt</Q></N></I></F></C>'),
(64732, 'innocuous', '<C><F><I><N><Q>@innocuous /i''nɔkjuəs/<br />*  tính từ<br />- không độc, không có hại; vô thưởng, vô phạt<br />- (từ Mỹ,nghĩa Mỹ) tẻ nhạt (tiểu thuyết...)</Q></N></I></F></C>'),
