(64734, 'innocuousness', '<C><F><I><N><Q>@innocuousness /,inə''kju:iti/ (innocuousness) /i''nɔkjuəsnis/<br />*  danh từ<br />- tính chất không độc, tính chất không có hại; tính chất vô thưởng, vô phạt<br />- (từ Mỹ,nghĩa Mỹ) tính chất tẻ nhạt</Q></N></I></F></C>'),
