(64750, 'innoxious', '<C><F><I><N><Q>@innoxious /i''nɔkʃəs/<br />*  tính từ<br />- không độc, không hại</Q></N></I></F></C>'),
(64751, 'innoxiousness', '<C><F><I><N><Q>@innoxiousness /i''nɔkʃəsnis/<br />*  danh từ<br />- tính không độc, tính không hại</Q></N></I></F></C>'),
(64752, 'inns', '<C><F><I><N><Q>@inn /in/<br />*  danh từ<br />- quán trọ, khách sạn nhỏ (ở nông thôn, thị trấn)<br />- (Inn) nhà nội trú (của học sinh đại học)<br />*  ngoại động từ<br />- (từ Mỹ,nghĩa Mỹ) cho ở trọ<br />*  nội động từ<br />- (từ Mỹ,nghĩa Mỹ) ở trọ</Q></N></I></F></C>'),
(64753, 'innuendo', '<C><F><I><N><Q>@innuendo /,inju:''endou/<br />*  danh từ,  số nhiều innuendoes<br />- lời ám chi, lời nói bóng nói gió, lời nói cạnh<br />*  nội động từ<br />- nói bóng nói gió, nói cạnh</Q></N></I></F></C>'),
(64754, 'innuendoes', '<C><F><I><N><Q>@innuendo /,inju:''endou/<br />*  danh từ,  số nhiều innuendoes<br />- lời ám chi, lời nói bóng nói gió, lời nói cạnh<br />*  nội động từ<br />- nói bóng nói gió, nói cạnh</Q></N></I></F></C>'),
(64755, 'innuendos', '<C><F><I><N><Q>@innuendo /,inju:''endou/<br />*  danh từ,  số nhiều innuendoes<br />- lời ám chi, lời nói bóng nói gió, lời nói cạnh<br />*  nội động từ<br />- nói bóng nói gió, nói cạnh</Q></N></I></F></C>'),
(64756, 'innumerability', '<C><F><I><N><Q>@innumerability /i,nju:mərə''biliti/ (innumerableness) /i''nju:mərəblnis/<br />*  danh từ<br />- tính không đếm được, tính vô số</Q></N></I></F></C>'),
(64757, 'innumerable', '<C><F><I><N><Q>@innumerable /i''nju:mərəbl/ (innumerous) /i''nju:mərəs/<br />*  tính từ<br />- không đếm được, vô số, hàng hà sa số</Q></N></I></F></C>'),
(64758, 'innumerableness', '<C><F><I><N><Q>@innumerableness /i,nju:mərə''biliti/ (innumerableness) /i''nju:mərəblnis/<br />*  danh từ<br />- tính không đếm được, tính vô số</Q></N></I></F></C>'),
(64759, 'innumerably', '<C><F><I><N><Q>@innumerably<br />- xem innumerable</Q></N></I></F></C>'),
(64760, 'innumeracy', '<C><F><I><N><Q>@innumeracy<br />* danh từ<br />- (giáo dục) tình trạng không biết làm toán</Q></N></I></F></C>'),
(64761, 'innumerate', '<C><F><I><N><Q>@innumerate<br />* tính từ<br />- (giáo dục) không biết làm toán<br />* danh từ<br />- người không biết làm toán</Q></N></I></F></C>'),
(64762, 'innumerous', '<C><F><I><N><Q>@innumerous /i''nju:mərəbl/ (innumerous) /i''nju:mərəs/<br />*  tính từ<br />- không đếm được, vô số, hàng hà sa số</Q></N></I></F></C>'),
(64763, 'innutrition', '<C><F><I><N><Q>@innutrition /,inju:''triʃn/<br />*  danh từ<br />- sự thiếu nuôi dưỡng</Q></N></I></F></C>'),
(64764, 'innutritious', '<C><F><I><N><Q>@innutritious /,inju:''triʃəs/<br />*  tính từ<br />- thiếu chất bổ, không bổ</Q></N></I></F></C>'),
(64765, 'inobservance', '<C><F><I><N><Q>@inobservance /,inəb''zə:vəns/<br />*  danh từ<br />- sự thiếu quan sát, sự thiếu chú ý<br />- sự không thi hành, sự không chấp hành (luật lệ...)</Q></N></I></F></C>'),
(64766, 'inobservant', '<C><F><I><N><Q>@inobservant /,inəb''zə:vənt/<br />*  tính từ<br />- thiếu quan sát, thiếu chú ý<br />- không thi hành, không chấp hành (luật lệ...)</Q></N></I></F></C>'),
(64767, 'inoccupation', '<C><F><I><N><Q>@inoccupation /''in,ɔkju''peiʃn/<br />*  danh từ<br />- tình trạng không mắc bệnh</Q></N></I></F></C>'),
(64768, 'inocula', '<C><F><I><N><Q>@inoculum /i''nɔkjuləm/ (inoculant) /i''nɔkjulənt/<br />*  danh từ<br />- chất để chủng, chất để tiêm chủng</Q></N></I></F></C>'),
(64769, 'inoculability', '<C><F><I><N><Q>@inoculability /i,nɔkjulə''biliti/<br />*  danh từ<br />- tính có thể chủng được, tính có thể tiêm truyền được</Q></N></I></F></C>'),
(64770, 'inoculable', '<C><F><I><N><Q>@inoculable /i''nɔkjuləbl/<br />*  tính từ<br />- có thể chủng được, có thể tiêm chủng được</Q></N></I></F></C>'),
(64771, 'inoculant', '<C><F><I><N><Q>@inoculant /i''nɔkjuləm/ (inoculant) /i''nɔkjulənt/<br />*  danh từ<br />- chất để chủng, chất để tiêm chủng</Q></N></I></F></C>'),
(64772, 'inoculants', '<C><F><I><N><Q>@inoculant /i''nɔkjuləm/ (inoculant) /i''nɔkjulənt/<br />*  danh từ<br />- chất để chủng, chất để tiêm chủng</Q></N></I></F></C>'),
(64773, 'inoculate', '<C><F><I><N><Q>@inoculate /i''nɔkleit/<br />*  ngoại động từ<br />- chủng, tiêm chủng<br />=to inoculate somebody with the smallpox+ chủng phòng bệnh đậu mùa cho ai<br />- tiêm nhiễm cho (ai)<br />- (nông nghiệp) ghép (cây)</Q></N></I></F></C>'),
(64774, 'inoculated', '<C><F><I><N><Q>@inoculate /i''nɔkleit/<br />*  ngoại động từ<br />- chủng, tiêm chủng<br />=to inoculate somebody with the smallpox+ chủng phòng bệnh đậu mùa cho ai<br />- tiêm nhiễm cho (ai)<br />- (nông nghiệp) ghép (cây)</Q></N></I></F></C>'),
(64775, 'inoculates', '<C><F><I><N><Q>@inoculate /i''nɔkleit/<br />*  ngoại động từ<br />- chủng, tiêm chủng<br />=to inoculate somebody with the smallpox+ chủng phòng bệnh đậu mùa cho ai<br />- tiêm nhiễm cho (ai)<br />- (nông nghiệp) ghép (cây)</Q></N></I></F></C>'),
(64776, 'inoculating', '<C><F><I><N><Q>@inoculate /i''nɔkleit/<br />*  ngoại động từ<br />- chủng, tiêm chủng<br />=to inoculate somebody with the smallpox+ chủng phòng bệnh đậu mùa cho ai<br />- tiêm nhiễm cho (ai)<br />- (nông nghiệp) ghép (cây)</Q></N></I></F></C>'),
(64777, 'inoculation', '<C><F><I><N><Q>@inoculation /i,nɔkju''leiʃn/<br />*  danh từ<br />- sự chủng, sự tiêm chủng<br />- sự tiêm nhiễm<br />- (nông nghiệp) sự ghép (cây)</Q></N></I></F></C>'),
(64778, 'inoculations', '<C><F><I><N><Q>@inoculation /i,nɔkju''leiʃn/<br />*  danh từ<br />- sự chủng, sự tiêm chủng<br />- sự tiêm nhiễm<br />- (nông nghiệp) sự ghép (cây)</Q></N></I></F></C>'),
(64779, 'inoculative', '<C><F><I><N><Q>@inoculative /i''nɔkjulətiv/<br />*  tính từ<br />- để chủng, để tiêm chủng<br />- làm tiêm nhiễm</Q></N></I></F></C>'),
(64780, 'inoculator', '<C><F><I><N><Q>@inoculator /i''nɔkjuleitə/<br />*  danh từ<br />- người chủng, người tiêm chủng<br />- người tiêm nhiễm</Q></N></I></F></C>'),
(64781, 'inoculators', '<C><F><I><N><Q>@inoculator /i''nɔkjuleitə/<br />*  danh từ<br />- người chủng, người tiêm chủng<br />- người tiêm nhiễm</Q></N></I></F></C>'),
(64782, 'inoculum', '<C><F><I><N><Q>@inoculum /i''nɔkjuləm/ (inoculant) /i''nɔkjulənt/<br />*  danh từ<br />- chất để chủng, chất để tiêm chủng</Q></N></I></F></C>'),
(64783, 'inodorous', '<C><F><I><N><Q>@inodorous /in''oudərəs/<br />*  tính từ<br />- không có mùi</Q></N></I></F></C>'),
(64784, 'inodorousness', '<C><F><I><N><Q>@inodorousness /in''oudərəsnis/<br />*  danh từ<br />- tính không có mùi</Q></N></I></F></C>'),
(64785, 'inoffensive', '<C><F><I><N><Q>@inoffensive /,inə''fensiv/<br />*  tính từ<br />- không có hại; vô thưởng vô phạt<br />- không làm mếch lòng; không có gì đáng chê trách</Q></N></I></F></C>'),
(64786, 'inoffensively', '<C><F><I><N><Q>@inoffensively<br />* phó từ<br />- vô thưởng vô phạt</Q></N></I></F></C>'),
(64787, 'inoffensiveness', '<C><F><I><N><Q>@inoffensiveness /,inə''fensivnis/<br />*  danh từ<br />- tính không có hại; tính vô thưởng vô phạt<br />- tính không làm mếch lòng; tính không có gì đáng chê trách</Q></N></I></F></C>'),
(64788, 'inofficious', '<C><F><I><N><Q>@inofficious /,inə''fiʃəs/<br />*  tính từ<br />- không có chức vị<br />- (pháp lý) không hợp với đạo lý<br />=an inofficious will+ một chúc thư không hợp với đạo lý (tước quyền con thừa tự...)</Q></N></I></F></C>'),
(64789, 'inofficiousness', '<C><F><I><N><Q>@inofficiousness /,inə''fiʃəsnis/<br />*  danh từ<br />- sự không có chức vị<br />- (pháp lý) sự không hợp với đạo lý</Q></N></I></F></C>'),
(64790, 'inoperable', '<C><F><I><N><Q>@inoperable /in''ɔpərəbl/<br />*  tính từ<br />- không mổ được (ung thư...)</Q></N></I></F></C>'),
(64791, 'inoperably', '<C><F><I><N><Q>@inoperably<br />- xem inoperable</Q></N></I></F></C>'),
(64792, 'inoperative', '<C><F><I><N><Q>@inoperative /in''ɔpərətiv/<br />*  tính từ<br />- không chạy, không làm việc, không sản xuất<br />- không có hiệu quả<br />=an inoperative medicine+ một loại thuốc không có hiệu quả<br /><br />@inoperative<br />- không có hiệu lực, không hoạt động b&gt;</Q></N></I></F></C>'),
(64793, 'inoperativeness', '<C><F><I><N><Q>@inoperativeness /in''ɔpərətivnis/<br />*  danh từ<br />- sự không chạy, sự không làm việc, sự không sản xuất<br />- tính không có hiệu quả</Q></N></I></F></C>'),
(64794, 'inopportune', '<C><F><I><N><Q>@inopportune /in''ɔpətju:n/<br />*  tính từ<br />- không thích hợp, không đúng lúc, lạc lõng</Q></N></I></F></C>'),
(64795, 'inopportunely', '<C><F><I><N><Q>@inopportunely<br />* phó từ<br />- không đúng lúc, không hợp thời</Q></N></I></F></C>'),
(64796, 'inopportuneness', '<C><F><I><N><Q>@inopportuneness /in''ɔpətju:nnis/<br />*  danh từ<br />- tính không thích hợp, tính không đúng lúc, tính lạc lõng</Q></N></I></F></C>'),
(64797, 'inordinacy', '<C><F><I><N><Q>@inordinacy<br />- xem inordinate</Q></N></I></F></C>'),
(64798, 'inordinate', '<C><F><I><N><Q>@inordinate /in''ɔ:dinit/<br />*  tính từ<br />- quá mức, quá xá, quá quắt, quá chừng<br />- thất thường<br />=inordinate hours+ giờ giấc thất thường</Q></N></I></F></C>'),
(64799, 'inordinately', '<C><F><I><N><Q>@inordinately<br />* phó từ<br />- quá quắt, quá đáng</Q></N></I></F></C>'),
(64800, 'inordinateness', '<C><F><I><N><Q>@inordinateness /in''ɔ:dinitnis/<br />*  danh từ<br />- tính quá mức, tính quá xá, tính quá quắt, tính quá chừng<br />- tính thất thường (giờ giấc...)</Q></N></I></F></C>'),
(64801, 'inorganic', '<C><F><I><N><Q>@inorganic /,inɔ:''gænik/<br />*  tính từ<br />- vô cơ<br />=inorganic chemistry+ hoá học vô cơ<br />- không cơ bản; ngoại lai</Q></N></I></F></C>'),
(64802, 'inorganically', '<C><F><I><N><Q>@inorganically<br />* phó từ<br />- không cơ bản, ngoại lai</Q></N></I></F></C>'),
(64803, 'inorganization', '<C><F><I><N><Q>@inorganization /in,ɔ:gənai''zeiʃn/<br />*  danh từ<br />- sự thiếu tổ chức; sự vô tổ chức</Q></N></I></F></C>'),
(64804, 'inornate', '<C><F><I><N><Q>@inornate /,inɔ:''neit/<br />*  tính từ<br />- không trang trí rườm rà; không hoa mỹ (văn)</Q></N></I></F></C>'),
(64805, 'inosculate', '<C><F><I><N><Q>@inosculate /i''nɔskjuleit/<br />*  động từ<br />- (giải phẫu) tiếp hợp nhau, nối nhau (hai đầu mạch máu)<br />- kết lại với nhau (sợi)</Q></N></I></F></C>'),
(64806, 'inosculation', '<C><F><I><N><Q>@inosculation /i,nɔskju''leiʃn/<br />*  danh từ<br />- (giải phẫu) sự tiếp hợp nhau, sự nối nhau<br />- sự kết lại với nhau, sự đan lại với nhau (sợi)</Q></N></I></F></C>'),
(64807, 'inotropic', '<C><F><I><N><Q>@inotropic<br />* tính từ<br />- có ảnh hưởng tới sự co thắt của tim</Q></N></I></F></C>'),
(64808, 'inpatient', '<C><F><I><N><Q>@inpatient<br />* danh từ<br />- người sống trong bệnh viện trong thời gian điều trị; bệnh nhân nội trú</Q></N></I></F></C>'),
(64809, 'inpatients', '<C><F><I><N><Q>@inpatient<br />* danh từ<br />- người sống trong bệnh viện trong thời gian điều trị; bệnh nhân nội trú</Q></N></I></F></C>'),
(64810, 'inpectable', '<C><F><I><N><Q>@inpectable /in''spektəbl/<br />*  tính từ<br />- có thể xem xét kỹ được, có thể kiểm tra được, có thể thanh tra được</Q></N></I></F></C>'),
(64811, 'inpetto', '<C><F><I><N><Q>@inpetto<br />* phó từ, adj<br />- riêng; bí mật<br />- thu nhỏ lại</Q></N></I></F></C>'),
(64812, 'inpour', '<C><F><I><N><Q>@inpour /in''pɔ:/<br />*  động từ<br />- đổ vào, rót vào</Q></N></I></F></C>'),
(64813, 'inpouring', '<C><F><I><N><Q>@inpouring /in''pɔ:riɳ/<br />*  danh từ<br />- sự đổ vào, sự rót vào</Q></N></I></F></C>'),
(64814, 'Input', '<C><F><I><N><Q>@Input<br />- (Econ) Đầu vào.<br />+ Xem FACTOR OF PRODUCTION.</Q></N></I></F></C>'),
(64815, 'input', '<C><F><I><N><Q>@input /''input/<br />*  danh từ<br />- cái cho vào<br />- lực truyền vào (máy...); dòng điện truyền vào (máy...)<br />- (kỹ thuật) tài liệu viết bằng ký hiệu (cung cấp vào máy tính điện tử); sự cung cấp tài liệu (cho máy tính điện tử)<br />- (Ê-cốt) số tiền cúng<br />*  động từ<br />- cung cấp tài liệu (cho máy tính điện tử)</Q></N></I></F></C>'),
(64816, 'input circuit', '<C><F><I><N><Q>@input circuit<br />* danh từ<br />- mạch điện kiểm tra việc nhập liệu</Q></N></I></F></C>'),
(64817, 'input device', '<C><F><I><N><Q>@input device<br />* danh từ<br />- thiết bị chuyển dữ liệu từ bộ nhớ sang máy tính</Q></N></I></F></C>'),
(64818, 'Input orientation', '<C><F><I><N><Q>@Input orientation<br />- (Econ) Định hướng theo đầu vào.<br />+ Xu hướng của một số phương thức sản xuất và chế tạo muốn ở gần nguồn nguyên vật liệu hay đầu vào.</Q></N></I></F></C>'),
(64819, 'Input - output', '<C><F><I><N><Q>@Input - output<br />- (Econ) Đầu vào - đầu ra (I-O), bảng cân đối liên ngành.<br />+ Một phương pháp phân tích trong đó nền kinh tế được thể hiện bằng một tập hợp các HÀM SẢN XUẤT TUYẾN TÍNH mô tả mối quan hệ tương tác giữa các ngành.</Q></N></I></F></C>'),
(64820, 'inputs', '<C><F><I><N><Q>@Input<br />- (Econ) Đầu vào.<br />+ Xem FACTOR OF PRODUCTION.</Q></N></I></F></C><C><F><I><N><Q>@input /''input/<br />*  danh từ<br />- cái cho vào<br />- lực truyền vào (máy...); dòng điện truyền vào (máy...)<br />- (kỹ thuật) tài liệu viết bằng ký hiệu (cung cấp vào máy tính điện tử); sự cung cấp tài liệu (cho máy tính điện tử)<br />- (Ê-cốt) số tiền cúng<br />*  động từ<br />- cung cấp tài liệu (cho máy tính điện tử)</Q></N></I></F></C>'),
(64821, 'inqiury', '<C><F><I><N><Q>@inqiury<br />- sự hỏi; sự điều tra nghiên cứu; (toán kinh tế) nhu cầu</Q></N></I></F></C>'),
(64822, 'inquest', '<C><F><I><N><Q>@inquest /''inkwest/<br />*  danh từ<br />- cuộc điều tra chính thức, cuộc thẩm tra chính thức (của toà án...)<br />- cuộc điều tra một vụ chết bất thường ((cũng) coroner''s inquest); ban điều tra một vụ chết bất thường<br />!grand inquest of the nation<br />- hạ nghị viện Anh<br />!great (last) inquest<br />- (tôn giáo) phán quyết cuối cùng (của Chúa)</Q></N></I></F></C>'),
(64823, 'inquests', '<C><F><I><N><Q>@inquest /''inkwest/<br />*  danh từ<br />- cuộc điều tra chính thức, cuộc thẩm tra chính thức (của toà án...)<br />- cuộc điều tra một vụ chết bất thường ((cũng) coroner''s inquest); ban điều tra một vụ chết bất thường<br />!grand inquest of the nation<br />- hạ nghị viện Anh<br />!great (last) inquest<br />- (tôn giáo) phán quyết cuối cùng (của Chúa)</Q></N></I></F></C>'),
