(64854, 'ins', '<C><F><I><N><Q>@in /in/<br />*  giới từ<br />- ở, tại, trong (nơi chốn, không gian...)<br />=in the room+ trong phòng<br />=in the Soviet Union+ ở Liên Xô<br />=in the sky+ trong bầu trời<br />=in the crowed+ trong đám đông<br />=in the dark+ trong bóng tối<br />=in the rain+ trong mưa, dưới trời mưa<br />=in a storm+ trong cơn bão<br />=to serve in the army+ phục vụ trong quân đội<br />=in Shakespeare+ trong (những tác phẩm của) Sếch-xpia<br />- về, vào, vào lúc, trong, trong lúc (thời gian)<br />=in spring+ về mùa xuân<br />=in 1945+ vào năm 1945<br />=in the morning+ vào buổi sáng<br />=the first time in one''s life+ lần đầu tiên trong đời<br />=in an hour+ trong một tiếng đồng hồ, trong một giờ<br />=it was done in a day+ việc đó làm xong trong một ngày<br />- ở vào, trong (phạm vi, hoàn cảnh, điều kiện, trạng thái, tâm trạng...); trong khi, trong lúc, đang lúc, đang<br />=to be in a favourable postision+ ở vào thế thuận lợi<br />=in any case+ trong bất kỳ trường hợp nào<br />=in someone''s power+ trong phạm vi quyền lực của ai<br />=in someone''s place+ ở vào địa vị ai<br />=blind in one eye+ chột mắt<br />=small in stature+ vóc người nhỏ bé<br />=in perplexity+ đang bối rối lúng túng<br />=in a firy+ trong cơn giận dữ<br />=in tears+ đang khóc<br />=in debt+ mang công mắc nợ<br />=in fruit+ đang ra quả<br />=in crosssing the river+ trong khi qua sông<br />=in my absence+ trong lúc tôi vắng mặt<br />=in the very act+ khi đang hành động, quả tang<br />- vào, vào trong<br />=to throw in the fire+ ném vào lửa<br />=to look in a mirror+ nhìn vào gương<br />=to be absorbed in work+ mải mê công việc<br />- theo<br />=in my opinion+ theo ý kiến tôi<br />=in his fancy+ theo trí tưởng tượng của hắn; trong trí tưởng tượng của hắn<br />- thành<br />=packed in dozens+ đóng thành từng tá<br />=to go in twos and threes+ đi thành từng nhóm hai, ba<br />=to cut in two+ cắt thành hai phần, chia làm đôi<br />=falling in folds+ rủ xuống thành nếp<br />- bằng<br />=writter in English+ viết bằng tiếng Anh<br />=to build in wood+ xây dựng bằng gỗ<br />=a statue in marble+ pho tượng bằng cẩm thạch<br />- mặc, đeo...<br />=a lady in in red+ một bà mặc áo màu đỏ<br />=in decorations+ đeo huân chương<br />- vì<br />=to cry in pain+ kêu khóc vì đau<br />- để<br />=in my defence+ để bảo vệ cho tôi<br />=in reply to...+ để trả lời cho...<br />=in return for something+ để đền đáp lại cái gì, để trả lại cái gì<br />=in opposition to+ để chống lại, để phản đối lại<br />- về, ở<br />=to be weak in English+ kém về môn tiếng Anh<br />=a lecture in anatomy+ bài thuyết trình về giải phẫu<br />=to differ in something+ khác nhau về cái gì<br />=to change in volume+ thay đổi về khối lượng<br />=to diminish in size+ thu nhỏ về kích thước<br />=rich in quality+ phong phú về chất lượng<br />=to believe in something+ tin tưởng ở cái gì<br />=the latest thing in electronics+ (thông tục) cái mới nhất về điện tử<br />=four meters in length+ bốn mét (về) chiều dài<br />=three metters in width+ bốn mét (về) chiều rộng<br />!in all<br />- (xem) all<br />!in fact<br />- (xem) fact<br />!in itself<br />- (xem) itself<br />!in so far as<br />- (xem) far<br />!in that<br />- bởi vì<br />!in truth<br />- thực vậy<br />!to be not in it<br />- không nước gì, không ăn thua gì; không phải là một đối thủ đáng gờm<br />!he has it in him<br />- hắn có đủ khả năng làm điều đó<br />!there is not one in a hundred<br />- trăm phần không có lấy một phần<br />*  phó từ<br />- vào<br />=to walk in+ đi vào, bước vào<br />=to lock somebody in+ giam ai vào<br />- ở nhà<br />=is anyone in?+ có ai ở nhà không?<br />- đến, đến bến, cặp bến<br />=summer is in+ mùa hạ đã đến<br />=the train is in+ xe lửa đã đến<br />=the boat is in+ tàu đã cặp bến<br />- đang nắm chính quyền<br />=the Vietnam Workres'' Party is one which is in+ Đảng Lao động Việt nam là đảng nắm chính quyền<br />- đang mùa; đang thịnh hành, đang là cái mốt<br />=pineapples are in+ đang mùa dứa<br />=nylon stocking are in+ bít tất ny lông đang là cái mốt<br />- ở trong, ở bên trong<br />=a coat with the woolly side in+ áo choàng có lượt len lót trong<br />!to be in for<br />- mắc vào, lâm vào<br />=to be in for trouble+ lâm vào cảnh khó chịu phiền muộn<br />=to be in for it+ gặp chịu khó chuyện, gặp chuyện bực mình (do chính mình gây ra)<br />- dự thi (một cuộc đua...)<br />=to be in for an examination+ đi thi<br />!to be in with somebody<br />- giận ai, bực mình với ai<br />!in and out<br />- ra ra vào vào, đi đi lại lại<br />!in on it<br />- (thông tục) biết thừa đi rồi, biết tỏng đi rồi<br />!in with it!<br />- để vào!, đem vào!<br />*  danh từ<br />- (số nhiều) (chính trị) (the ins) Đảng đang nắm chính quyền<br />=the ins and the outs+ đảng đang nắm chính quyền và đảng không nắm chính quyền<br />- đảng viên đảng nắm chính quyền<br />- (từ Mỹ,nghĩa Mỹ),  (thông tục) nơi vào, chỗ vào; sự đưa vào<br />- (từ Mỹ,nghĩa Mỹ),  (thông tục) thế lực<br />!the ins and outs<br />- những chỗ lồi ra lõm vào, những chỗ ngoằn ngoèo (của một nơi nào)<br />- những chi tiết (của một vấn đề...)<br />*  tính từ<br />- trong, nội<br />- (từ Mỹ,nghĩa Mỹ) cầm quyền<br />=the in party+ đảng cầm quyền<br />*  ngoại động từ,  (từ Mỹ,nghĩa Mỹ); (tiếng địa phương)<br />- thu thập lại, thu vén lại, thu lại; gặt<br />=to in the hay before it rains+ thu vén cỏ khô trước khi trời mưa<br />- bao quanh, quây lại<br /><br />@in<br />- trong, ở trong i. case trong trường hợp; i. fact thực vậy, thực ra; i. the<br />- large, i. general nói chung; i. order to để; i. particular nói riêng, đặc<br />- biệt; i. particularr nói riêng, đặc biệt; i. the small cục bộ<br /><br />@in<br />- o. that, in o to để<br />- o. of congruence cấp của một đoàn<br />- o. of contact bậc tiếp xúc<br />- o. of a curve cấp của một đường cong <br />- o. of a determinant cấp của một định thức <br />- o. of a differential equation (giải tích) cấp của một phương trình vi phân<br />- o. of an element in a groupcấp của một phần tử trong một nh