INSERT INTO `tbl_edict` (`id`, `word`, `detail`) VALUES
(64934, 'insensateness', '<C><F><I><N><Q>@insensateness /in''senseitnis/<br />*  danh từ<br />- tính vô tri vô giác<br />- tính không cảm xúc; tính nhẫn tâm<br />- tính điên rồ, tính ngu dại</Q></N></I></F></C>'),
(64935, 'insensibility', '<C><F><I><N><Q>@insensibility /in''sensə''biliti/<br />*  danh từ<br />- sự bất tỉnh, sự mê<br />- tính không xúc cảm, tính không có tình cảm; tính vô tình</Q></N></I></F></C>'),
(64936, 'insensible', '<C><F><I><N><Q>@insensible /in''sensəbl/<br />*  tính từ<br />- bất tỉnh, mê<br />- không xúc cảm, không có tình cảm; vô tình<br />- không biết, không cảm thấy<br />=insensible to cold+ không cảm thấy lạnh<br />- không cảm thấy được</Q></N></I></F></C>'),
