(64947, 'inseparability', '<C><F><I><N><Q>@inseparability /in,sepərə''biliti/ (inseparableness) /inseparableness/<br />*  danh từ<br />- tính không thể tách rời được, tính không thể chia lìa được</Q></N></I></F></C>'),
(64948, 'inseparable', '<C><F><I><N><Q>@inseparable /in''sepərəbl/<br />*  tính từ<br />- không thể tách rời được, không thể chia lìa được<br />*  danh từ,  (thường) số nhiều<br />- những người (bạn...) không rời nhau, những vật không tách rời được<br /><br />@inseparable<br />- không tách được<br />- purely i. (đại số) thuần tuý không tách được</Q></N></I></F></C>'),
(64949, 'inseparableness', '<C><F><I><N><Q>@inseparableness /in,sepərə''biliti/ (inseparableness) /inseparableness/<br />*  danh từ<br />- tính không thể tách rời được, tính không thể chia lìa được</Q></N></I></F></C>'),
(64950, 'inseparables', '<C><F><I><N><Q>@inseparable /in''sepərəbl/<br />*  tính từ<br />- không thể tách rời được, không thể chia lìa được<br />*  danh từ,  (thường) số nhiều<br />- những người (bạn...) không rời nhau, những vật không tách rời được<br /><br />@inseparable<br />- không tách được<br />- purely i. (đại số) thuần tuý không tách được</Q></N></I></F></C>'),
(64951, 'inseparably', '<C><F><I><N><Q>@inseparably<br />* phó từ<br />- không tách rời được, không chia lìa được</Q></N></I></F></C>'),
