(64954, 'insert', '<C><F><I><N><Q>@insert /''insə:t/<br />*  danh từ,  (từ Mỹ,nghĩa Mỹ)<br />- vật lồng vào, vật gài vào<br />- tờ in rời;, tờ ảnh rời (để cho vào sách báo); tờ thông tri (gài vào sách báo...)<br />- (điện ảnh) cảnh xem<br />*  ngoại động từ<br />- lồng vào, gài vào<br />- (+ in,  into) cho (chữ, từ...) vào (tài liệu...); đăng (bài...) vào (báo...)<br /><br />@insert<br />- (máy tính) đưa (các dữ kiện) vào; lắp (băng) vào</Q></N></I></F></C>'),
(64955, 'inserted', '<C><F><I><N><Q>@insert /''insə:t/<br />*  danh từ,  (từ Mỹ,nghĩa Mỹ)<br />- vật lồng vào, vật gài vào<br />- tờ in rời;, tờ ảnh rời (để cho vào sách báo); tờ thông tri (gài vào sách báo...)<br />- (điện ảnh) cảnh xem<br />*  ngoại động từ<br />- lồng vào, gài vào<br />- (+ in,  into) cho (chữ, từ...) vào (tài liệu...); đăng (bài...) vào (báo...)<br /><br />@insert<br />- (máy tính) đưa (các dữ kiện) vào; lắp (băng) vào</Q></N></I></F></C>'),
(64956, 'inserter', '<C><F><I><N><Q>@inserter<br />- xem insert</Q></N></I></F></C>'),
(64957, 'inserting', '<C><F><I><N><Q>@insert /''insə:t/<br />*  danh từ,  (từ Mỹ,nghĩa Mỹ)<br />- vật lồng vào, vật gài vào<br />- tờ in rời;, tờ ảnh rời (để cho vào sách báo); tờ thông tri (gài vào sách báo...)<br />- (điện ảnh) cảnh xem<br />*  ngoại động từ<br />- lồng vào, gài vào<br />- (+ in,  into) cho (chữ, từ...) vào (tài liệu...); đăng (bài...) vào (báo...)<br /><br />@insert<br />- (máy tính) đưa (các dữ kiện) vào; lắp (băng) vào</Q></N></I></F></C>'),
(64958, 'insertion', '<C><F><I><N><Q>@insertion /in''sə:ʃn/<br />*  danh từ<br />- sự lồng vào, sự gài vào<br />- sự cho (chữ, từ...) vào (tài liệu...); lần đăng bài... (trong báo...)<br />- (từ Mỹ,nghĩa Mỹ) bài quảng cáo (đăng trong báo)<br />- viền ren<br />- (số nhiều) chỗ dính; cách dính (một cơ quan trên cơ thể)<br /><br />@insertion<br />- (máy tính) sự đưa vào, sự điền vào<br />- orbital i. sự đưa lên quỹ đạo</Q></N></I></F></C>'),
