(64960, 'insertions', '<C><F><I><N><Q>@insertion /in''sə:ʃn/<br />*  danh từ<br />- sự lồng vào, sự gài vào<br />- sự cho (chữ, từ...) vào (tài liệu...); lần đăng bài... (trong báo...)<br />- (từ Mỹ,nghĩa Mỹ) bài quảng cáo (đăng trong báo)<br />- viền ren<br />- (số nhiều) chỗ dính; cách dính (một cơ quan trên cơ thể)<br /><br />@insertion<br />- (máy tính) sự đưa vào, sự điền vào<br />- orbital i. sự đưa lên quỹ đạo</Q></N></I></F></C>'),
(64961, 'inserts', '<C><F><I><N><Q>@insert /''insə:t/<br />*  danh từ,  (từ Mỹ,nghĩa Mỹ)<br />- vật lồng vào, vật gài vào<br />- tờ in rời;, tờ ảnh rời (để cho vào sách báo); tờ thông tri (gài vào sách báo...)<br />- (điện ảnh) cảnh xem<br />*  ngoại động từ<br />- lồng vào, gài vào<br />- (+ in,  into) cho (chữ, từ...) vào (tài liệu...); đăng (bài...) vào (báo...)<br /><br />@insert<br />- (máy tính) đưa (các dữ kiện) vào; lắp (băng) vào</Q></N></I></F></C>'),
(64962, 'insessorial', '<C><F><I><N><Q>@insessorial /,insə''sɔ:riəl/<br />*  tính từ<br />- (động vật học) để đậu; thích nghi với sự đậu (chim)</Q></N></I></F></C>'),
(64963, 'inset', '<C><F><I><N><Q>@inset /''inset/<br />*  danh từ<br />- trang rời (xen vào sách...)<br />- bản đồ lồng (lồng vào bản đồ to hơn)<br />- cái may ghép (vào áo...)<br />- sự may ghép, sự dát<br />- (từ Mỹ,nghĩa Mỹ) sự chảy vào<br />*  ngoại động từ<br />- ghép, dát</Q></N></I></F></C>'),
(64964, 'insets', '<C><F><I><N><Q>@inset /''inset/<br />*  danh từ<br />- trang rời (xen vào sách...)<br />- bản đồ lồng (lồng vào bản đồ to hơn)<br />- cái may ghép (vào áo...)<br />- sự may ghép, sự dát<br />- (từ Mỹ,nghĩa Mỹ) sự chảy vào<br />*  ngoại động từ<br />- ghép, dát</Q></N></I></F></C>'),
(64965, 'insetting', '<C><F><I><N><Q>@inset /''inset/<br />*  danh từ<br />- trang rời (xen vào sách...)<br />- bản đồ lồng (lồng vào bản đồ to hơn)<br />- cái may ghép (vào áo...)<br />- sự may ghép, sự dát<br />- (từ Mỹ,nghĩa Mỹ) sự chảy vào<br />*  ngoại động từ<br />- ghép, dát</Q></N></I></F></C>'),
(64966, 'inseverable', '<C><F><I><N><Q>@inseverable /in''sevərəbl/<br />*  tính từ<br />- không cắt đứt được, không thể tách rời được</Q></N></I></F></C>'),
(64967, 'inshore', '<C><F><I><N><Q>@inshore /''in:''ʃɔ:/<br />*  tính từ<br />- ven bờ<br />*  phó từ<br />- gần bờ; ở bờ; về phía bờ</Q></N></I></F></C>'),
(64968, 'inside', '<C><F><I><N><Q>@inside /''in''said/<br />*  danh từ<br />- mặt trong, phía trong, phần trong, bên trong<br />- phần giữa<br />=the inside of a week+ phần giữa tuần<br />- (thông tục) lòng, ruột<br />!to turn inside out<br />- lộn trong ra ngoài<br />*  tính từ &amp; phó từ<br />- ở trong, từ trong, nội bộ<br />=inside information+ tin tức nội bộ<br />=an inside job+ một công việc làm ở trong; (thông tục) một vụ trộm nội bộ<br />=inside of a week+ trong vòng một tuần<br />*  giới từ<br />- ở phía trong; vào trong<br /><br />@inside<br />- phần trong, mặt trong, tính chất trong // bên trong i. out lộn trái</Q></N></I></F></C>'),
(64969, 'Inside lag', '<C><F><I><N><Q>@Inside lag<br />- (Econ) Độ trễ bên trong.<br />+ Sự chậm trễ giữa việc nhận thức ra nhu cầu phải có hành động chính sách và sự thực hiện chính sách.</Q></N></I></F></C>'),
(64970, 'inside lane', '<C><F><I><N><Q>@inside lane<br />* danh từ<br />- phần đường mà xe cộ phải chạy chậm</Q></N></I></F></C>'),
(64971, 'inside left', '<C><F><I><N><Q>@inside left<br />* danh từ<br />- (bóng đá) hộ công cánh trái</Q></N></I></F></C>'),
(64972, 'Inside money', '<C><F><I><N><Q>@Inside money<br />- (Econ) Tiền bên trong.<br />+ Các dạng tiền dựa trên số nợ của khu vực tư nhân , ví dụ quan trọng nhất là tiền gửi ngân hàng thương mại ứng với số tiền ngân hàng cho khu vực tư nhân vay.</Q></N></I></F></C>'),
(64973, 'inside right', '<C><F><I><N><Q>@inside right<br />* danh từ<br />- (bóng đá) hộ công cánh phải</Q></N></I></F></C>'),
(64974, 'inside track', '<C><F><I><N><Q>@inside track /''in''said''træk/<br />*  danh từ,  (từ Mỹ,nghĩa Mỹ)<br />- vòng trong (trường đua ngựa)<br />- (thông tục) vị trí có lợi, thế lợi</Q></N></I></F></C>'),
(64975, 'insider', '<C><F><I><N><Q>@insider /''in''saidə/<br />*  danh từ<br />- người ở trong<br />- người của nội bộ (một hội...); người nắm được tình hình nội bộ (một tổ chức...)<br />- người trong cuộc<br />- (từ Mỹ,nghĩa Mỹ),  (thông tục) người được hưởng một đặc quyền</Q></N></I></F></C>'),
(64976, 'insider dealing', '<C><F><I><N><Q>@insider dealing<br />* danh từ<br />- việc giao dịch mà chỉ những người liên quan mới biết</Q></N></I></F></C>'),
(64977, 'Insider - outsider', '<C><F><I><N><Q>@Insider - outsider<br />- (Econ) Người trong cuộc - người ngoài cuộc.</Q></N></I></F></C>'),
(64978, 'Insider - outsider model', '<C><F><I><N><Q>@Insider - outsider model<br />- (Econ) Mô hình Người trong cuộc - người ngoài cuộc.<br />+ Các mô hình phân biệt những người hiện đang làm việc, gọi là những người bên trong - những người này được coi là có một ít sức mạnh đối với thị trường - với những người không có việc làm nhưng đang muốn làm việc, gọi là những người bên ngoài.</Q></N></I></F></C>'),
(64979, 'insiders', '<C><F><I><N><Q>@insider /''in''saidə/<br />*  danh từ<br />- người ở trong<br />- người của nội bộ (một hội...); người nắm được tình hình nội bộ (một tổ chức...)<br />- người trong cuộc<br />- (từ Mỹ,nghĩa Mỹ),  (thông tục) người được hưởng một đặc quyền</Q></N></I></F></C>'),
(64980, 'insides', '<C><F><I><N><Q>@inside /''in''said/<br />*  danh từ<br />- mặt trong, phía trong, phần trong, bên trong<br />- phần giữa<br />=the inside of a week+ phần giữa tuần<br />- (thông tục) lòng, ruột<br />!to turn inside out<br />- lộn trong ra ngoài<br />*  tính từ &amp; phó từ<br />- ở trong, từ trong, nội bộ<br />=inside information+ tin tức nội bộ<br />=an inside job+ một công việc làm ở trong; (thông tục) một vụ trộm nội bộ<br />=inside of a week+ trong vòng một tuần<br />*  giới từ<br />- ở phía trong; vào trong<br /><br />@inside<br />- phần trong, mặt trong, tính chất trong // bên trong i. out lộn trái</Q></N></I></F></C>'),
(64981, 'insidious', '<C><F><I><N><Q>@insidious /in''sidiəs/<br />*  tính từ<br />- quỷ quyệt, xảo quyệt<br />- (y học) âm ỉ, âm thầm (bệnh)</Q></N></I></F></C>'),
(64982, 'insidiously', '<C><F><I><N><Q>@insidiously<br />* phó từ<br />- âm thầm, lẳng lặng</Q></N></I></F></C>'),
(64983, 'insidiousness', '<C><F><I><N><Q>@insidiousness /in''sidiəsnis/<br />*  danh từ<br />- tính quỷ quyệt, tính xảo quyệt<br />- (y học) tính âm ỉ, tính âm thầm (bệnh)</Q></N></I></F></C>'),
(64984, 'insight', '<C><F><I><N><Q>@insight /''insait/<br />*  danh từ<br />- sự nhìn thấu được bên trong sự vật, sự hiểu thấu được bên trong sự vật; sự hiểu biết sâu sắc, sự sáng suốt<br /><br />@insight<br />- sự thấm vào; quan niệm, nhận thức</Q></N></I></F></C>'),
