(65146, 'instancy', '<C><F><I><N><Q>@instancy /''instənsi/<br />*  danh từ<br />- tính chất khẩn trương, tính chất cấp bách</Q></N></I></F></C>'),
(65147, 'instant', '<C><F><I><N><Q>@instant /''instənt/<br />*  danh từ<br />- lúc, chốc lát<br />=come here this instant+ hây đến đây, ngay bây giờ<br />=on the instant+ ngay lập tức<br />- (từ Mỹ,nghĩa Mỹ),  (thông tục) đồ ăn uống dùng ngay được<br />*  tính từ<br />- xảy ra ngay lập tức, sắp xảy ra<br />- khẩn trương, cấp bách, gấp<br />- ngay tức khắc, lập tức<br />=instant obedience+ sự tuân lệnh ngay tức khắc<br />- ăn ngay được, uống ngay được<br />=instant coffee+ cà phê pha vào nước sôi uống ngay (không cần lọc)<br />- (viết tắt),  inst (của) tháng này<br />=the 1st instant+ mồng một tháng này<br />*  phó từ<br />- lập tức<br /><br />@instant<br />- một lúc, một khoảnh khắc</Q></N></I></F></C>'),
(65148, 'instantane', '<C><F><I><N><Q>@instantané /,e:nstæn''tɑ:nei/<br />*  danh từ<br />- (nhiếp ảnh) ảnh chụp nhanh<br />- kịch ngắn vài dòng</Q></N></I></F></C>'),
(65149, 'instantaneity', '<C><F><I><N><Q>@instantaneity /,instəntə''teinjəs/ (instantaneousness) /,instən''teinjəsnis/<br />*  danh từ<br />- tính chất xảy ra ngay lập tức, tính chất được làm ngay lập tức<br />- tính chất khẩn trương</Q></N></I></F></C>'),
(65150, 'instantaneous', '<C><F><I><N><Q>@instantaneous /,instən''teinjəs/<br />*  tính từ<br />- xảy ra ngay lập tức, tức thời, được làm ngay<br />=an instantaneous response+ câu trả lời ngay lập tức<br />- có ở một lúc nào đó, thuộc một lúc nào đó<br />- (vật lý) tức thời<br /><br />@instantaneous<br />- tức thời</Q></N></I></F></C>'),
