(65154, 'instanter', '<C><F><I><N><Q>@instanter /in''stæntə/<br />*  phó từ<br />- (thường)(đùa cợt) lập tức, tức thời, ngay</Q></N></I></F></C>'),
(65155, 'instantiate', '<C><F><I><N><Q>@instantiate<br />* ngoại động từ<br />- thuyết minh (một điều trừu tượng) bằng một thí dụ cụ thể</Q></N></I></F></C>'),
