(65163, 'instaurator', '<C><F><I><N><Q>@instaurator /''instɔ:reitə/<br />*  danh từ<br />- người phục chế, người tu sửa</Q></N></I></F></C>'),
(65164, 'instead', '<C><F><I><N><Q>@instead /in''sted/<br />*  phó từ<br />- để thay vào, để thế cho; đáng lẽ là<br />=instead of this+ để thế cho cái này<br />=since we had no sugar, we used honey instead+ vì không có đường chúng tôi dùng mật để thay thế<br />=instead of going out, he stayed at home+ đáng lẽ phải đi ra ngoài, hắn ta cứ ở xó nhà<br /><br />@instead<br />- thay cho, thay thế<br />- i. of this thay cho điều này</Q></N></I></F></C>'),
(65165, 'instep', '<C><F><I><N><Q>@instep /''instep/<br />*  danh từ<br />- mu bàn chân<br />- phần mu (của giày, bít tất...); da mặt (giày)<br />- vật hình mu bàn chân</Q></N></I></F></C>'),
