(65194, 'institutional', '<C><F><I><N><Q>@institutional /,insti''tju:ʃənl/<br />*  tính từ<br />- (thuộc) cơ quan, có tính chất là cơ quan<br />- (từ Mỹ,nghĩa Mỹ) với mục đích gây tiếng hơn là để bán hằng ngày (quảng cáo)<br />- (tôn giáo) (thuộc) tổ chức, (thuộc) hội (từ thiện...)</Q></N></I></F></C>'),
(65195, 'Institutional economics', '<C><F><I><N><Q>@Institutional economics<br />- (Econ) Kinh tế học thể chế.<br />+ Một loại phân tích kinh tế nhấn mạnh đến vai trò của các tổ chức xã hội, chính trị và kinh tế trong việc hình thành các sự kiện kinh tế.</Q></N></I></F></C>'),
