(65226, 'instructresses', '<C><F><I><N><Q>@instructor /in''strʌktə/<br />*  danh từ<br />- người dạy, thầy giáo<br />- (từ Mỹ,nghĩa Mỹ) trợ giáo (đại học)</Q></N></I></F></C>'),
(65227, 'instructs', '<C><F><I><N><Q>@instruct /in''strʌkt/<br />*  ngoại động từ<br />- chỉ dẫn, chỉ thị cho<br />- dạy, đào tạo<br />- truyền kiến thức cho; cung cấp tin tức cho, cung cấp tài liệu cho, cho hay, cho biết</Q></N></I></F></C>'),
(65228, 'instrument', '<C><F><I><N><Q>@instrument /''instrumənt/<br />*  danh từ<br />- dụng cụ ((nghĩa đen) &amp; (nghĩa bóng))<br />- nhạc khí<br />- công cụ, phương tiện<br />=an instrument of government+ một công cụ cai trị<br />- văn kiện<br />*  ngoại động từ<br />- cung cấp dụng cụ máy móc cho<br />- phối dàn nhạc<br /><br />@instrument<br />- dụng cụ<br />- dial i. dụng cụ có mặt số, đồng hồ đo <br />- measuring i. (máy tính) dụng cụ đo</Q></N></I></F></C>'),
(65229, 'instrumental', '<C><F><I><N><Q>@instrumental /,instru''mentl/<br />*  tính từ<br />- dùng làm dụng cụ, dùng làm công cụ, dùng làm phương tiện<br />- (thuộc) dụng cụ, (thuộc) công cụ, (thuộc) phương tiện<br />- (âm nhạc) trinh diễn bằng nhạc khí, viết cho nhạc khí<br />=instrumental case+ ((ngôn ngữ học)) cách công cụ<br />*  danh từ<br />- (âm nhạc) bản nhạc trình diễn bằng nhạc khí<br />- (ngôn ngữ học) cách công cụ</Q></N></I></F></C>'),
(65230, 'Instrumental variables', '<C><F><I><N><Q>@Instrumental variables<br />- (Econ) Các biến công cụ (IV).<br />+ Biến số thay thế BIẾN GIẢI THÍCH THỰC TẾ để làm trọng số trong phân tích hồi quy.</Q></N></I></F></C>'),
(65231, 'instrumentalism', '<C><F><I><N><Q>@instrumentalism /,instru''mentəlizm/<br />*  danh từ<br />- (triết học) thuyết công cụ</Q></N></I></F></C>'),
