(65238, 'instrumentations', '<C><F><I><N><Q>@instrumentation /,instrumen''teiʃn/<br />*  danh từ<br />- sự phối dàn nhạc<br />- danh sách những nhạc khí dùng cho một bản nhạc<br />- (như) instrumentality<br />- khoa học nghiên cứu dụng cụ<br />- việc làm (mổ...) bằng dụng cụ; sự sử dụng dụng cụ (khoa học)<br />- sự trang bị dụng cụ, sự trang bị máy móc</Q></N></I></F></C>'),
(65239, 'Instruments', '<C><F><I><N><Q>@Instruments<br />- (Econ) Các công cụ.<br />+ Còn gọi là các CÔNG CỤ CHÍNH SÁCH. Thuật ngữ này xuất phát từ việc phân loại các biến trong quá trình ổn định hoá kinh tế thành các công cụ chính sách, mục tiêu chính sách và các biến ngoại sinh.</Q></N></I></F></C>'),
(65240, 'instruments', '<C><F><I><N><Q>@instrument /''instrumənt/<br />*  danh từ<br />- dụng cụ ((nghĩa đen) &amp; (nghĩa bóng))<br />- nhạc khí<br />- công cụ, phương tiện<br />=an instrument of government+ một công cụ cai trị<br />- văn kiện<br />*  ngoại động từ<br />- cung cấp dụng cụ máy móc cho<br />- phối dàn nhạc<br /><br />@instrument<br />- dụng cụ<br />- dial i. dụng cụ có mặt số, đồng hồ đo <br />- measuring i. (máy tính) dụng cụ đo</Q></N></I></F></C>'),
(65241, 'insubordinate', '<C><F><I><N><Q>@insubordinate /,insə''bɔ:dnit/<br />*  tính từ<br />- không chịu phục tùng, không chịu vâng lời<br />- không thấp hơn<br />=an insubordinate hill+ một quả đồi không thấp hơn (những quả đồi khác)<br />*  danh từ<br />- người không chịu phục tùng, người không chịu vâng lời</Q></N></I></F></C>'),
