(65294, 'Insurance', '<C><F><I><N><Q>@Insurance<br />- (Econ) Bảo hiểm<br />+ Bảo hiểm cho phép mọi người đổi rủi ro của việc thua thiệt lớn để lấy sự chắc chắn của việc thua thiệt nhỏ.</Q></N></I></F></C>'),
