(65355, 'Integer', '<C><F><I><N><Q>@Integer<br />- (Econ) Số nguyên<br />+ Một số tròn, không có phần thập phân hay phân số.</Q></N></I></F></C>'),
(65356, 'integer', '<C><F><I><N><Q>@integer /''intidʤə/<br />*  danh từ<br />- (toán học) số nguyên<br />- cái nguyên, vật trọn vẹn, tổng thể, toàn bộ<br /><br />@integer<br />- số nguyên<br />- complex i. số nguyên phức, số nguyên Gauxơ <br />- Gaussian i. số nguyên Gauxơ<br />- multidigit i. số nguyên nhiều chữ số<br />- negative i. số nguyên âm<br />- positive i. số nguyên dương</Q></N></I></F></C>'),
(65357, 'Integerated economy', '<C><F><I><N><Q>@Integerated economy<br />- (Econ) Nền kinh tế liên kết.<br />+ Cụm thuật ngữ chỉ tình huống khi mà các khu vực tư nhân khác nhau của một nền kinh tế, thường là các khu vực công nghiệp và nông nghiệp, hoạt động phối hợp với nhau một cách có hiệu quả và phụ thuộc lẫn nhau.</Q></N></I></F></C>'),
(65358, 'Integerated time series', '<C><F><I><N><Q>@Integerated time series<br />- (Econ) Chuỗi thời gian được lấy tích phân.</Q></N></I></F></C>'),
(65359, 'integers', '<C><F><I><N><Q>@Integer<br />- (Econ) Số nguyên<br />+ Một số tròn, không có phần thập phân hay phân số.</Q></N></I></F></C><C><F><I><N><Q>@integer /''intidʤə/<br />*  danh từ<br />- (toán học) số nguyên<br />- cái nguyên, vật trọn vẹn, tổng thể, toàn bộ<br /><br />@integer<br />- số nguyên<br />- complex i. số nguyên phức, số nguyên Gauxơ <br />- Gaussian i. số nguyên Gauxơ<br />- multidigit i. số nguyên nhiều chữ số<br />- negative i. số nguyên âm<br />- positive i. số nguyên dương</Q></N></I></F></C>'),
(65360, 'integraaph', '<C><F><I><N><Q>@integraaph<br />- (máy tính) máy đo điện tích</Q></N></I></F></C>'),
(65361, 'integrability', '<C><F><I><N><Q>@integrability<br />* danh từ<br />- (toán học) tính khả tích<br /><br />@integrability<br />- [sự, tính] khả tích<br />- absolute i. [sự, tính] khả tích tuyệt đối <br />- complete i. tính khả tích đầy đủ</Q></N></I></F></C>'),
