(65363, 'integral', '<C><F><I><N><Q>@integral /''intigrəl/<br />*  danh từ<br />- (toán học) tích phân<br />*  tính từ<br />- (thuộc) tính toàn bộ; (thuộc) tính nguyên, cần cho tính toàn bộ, cần cho tính nguyên<br />- toàn bộ, nguyên<br />- (toán học) tích phân<br /><br />@integral<br />- tích phân // nguyên<br />- i. about a closed path tích phân một đường cong kín; i. between th<br />- limits a and b tích phân giới hạn của a và b; to take an i. of... lấy tích<br />- phân một đường con kín; i. (taken) along a line lấy tích phân (theo)<br />- đường; i taken through a surface lấy tích phân mặt; under the i. dưới<br />- dấu tích phân <br />- action i. tích phân tác dụng<br />- auxiliarry i. tích phân bổ trợ<br />- complete i. tích phân đầy đủ<br />- complete elliptic i. tích phân elliptic đầy đủ<br />- contour i. (giải tích) tích phân theo chu tuyến, tích phân theo đường đáy<br />- convergent i. tích phân hội tụ<br />- consine i. tích phân cosin<br />- curvilinear i. tích phân đường<br />- definite i. tích phân xác định<br />- double i. tích phân hai lớp<br />- elementary i. tích phân sơ cấp<br />- energy i. tích phân năng lượng<br />- faltung i. tích phân chập<br />- first i. tích phân đầu<br />- fractional i. tích phana cấp phân số<br />- general i. tích phân tổng quát<br />- hyperelliptic i. tích phân siêu eliptic<br />- improper i. tích phân phi chính<br />- infinite i. tích phân vơí cận vô hạn<br />- intermadiary i., intermediate i. tích phân trung gian<br />- invariant i. tích phân bất biến<br />- interated i. tích phân lặp<br />- line i. tích phân đường<br />- logarithm i. tích phân lôga<br />- lower i. tích phân dưới<br />- multiple i. tích phân bội<br />- multiple iterated i. (giải tích) tích phân lặp<br />- particular i. tích phân riêng<br />- phase area i. tích phân diện tích pha<br />- potential i. tích phân thế<br />- probability i. tích phân xác suất <br />- proper i. tích phân thông thường<br />- pseudo-elliptic i. tích phân giả định<br />- pseudo-hyperelliptic i. tích phân giả siêu eliptic<br />- rationalizable i. tích phân hữu tỷ hoá được<br />- reactance i. tích phân điện kháng<br />- repeated i. tích phân lặp<br />- simple i. tích phân đơn<br />- sine i. sin tích phân<br />- singular i. tích phân kỳ dị<br />- special i. tích phân đặc biệt<br />- subnormal i. tích phân phản ánh<br />- surface i. tích phân mặt<br />- trigonometric(al) i. (giải tích) tích phân hàm lượng giác<br />- triple i. tích phân ba lớp<br />- upper i. tích phân trên<br />- volume i. tích phân khối</Q></N></I></F></C>'),
(65364, 'integral calculus', '<C><F><I><N><Q>@integral calculus<br />* danh từ<br />- phép tính tích phân</Q></N></I></F></C>'),
(65365, 'integrality', '<C><F><I><N><Q>@integrality /''inti''græliti/<br />*  danh từ<br />- tính toàn bộ; tính nguyên</Q></N></I></F></C>'),
