(65369, 'integrand', '<C><F><I><N><Q>@integrand /''intigrænd/<br />*  danh từ<br />- (toán học) hàm bị tích<br /><br />@integrand<br />- hàm lấy tích phân; [biểu thức, hàm] dưới dấu tích phân<br />- exact i. hàm lấy tích phân là một vi phân toàn phần</Q></N></I></F></C>'),
(65370, 'integrant', '<C><F><I><N><Q>@integrant /''intigrənt/<br />*  tính từ<br />- bộ phận cấu thành toàn bộ, bộ phận tạo thành toàn bộ<br />- (từ Mỹ,nghĩa Mỹ) mảnh nguyên liệu xây dựng (gồm) nhiều lớp</Q></N></I></F></C>'),
(65371, 'integrate', '<C><F><I><N><Q>@integrate /''intigreit/<br />*  ngoại động từ<br />- hợp thành một thể thống nhất, bổ sung thành một thể thống nhất, hợp nhất<br />- chỉ tổng số, chỉ giá trị trung bình của<br />- (toán học) tích phân<br />- (từ Mỹ,nghĩa Mỹ) hợp lại thành một hệ thống thống nhất (những cái trước kia bị sự phân biệt chủng tộc tách ra)<br />- (từ Mỹ,nghĩa Mỹ) mở rộng cho mọi người, mở rộng cho mọi chủng tộc<br />- (từ Mỹ,nghĩa Mỹ) dành quyền bình đẳng cho (một chủng tộc...)<br />*  nội động từ<br />- hợp nhất<br />- (từ Mỹ,nghĩa Mỹ) hợp lại thành một hệ thống thống nhất (những cái trước kia bị sự phân biệt chủng tộc tách ra)<br />- (từ Mỹ,nghĩa Mỹ) được mở rộng cho mọi người, được mở rộng cho mọi chủng tộc<br />- (từ Mỹ,nghĩa Mỹ) hoà hợp và trở thành một bộ phận của nền văn hoá chính<br /><br />@integrate<br />- lấy tích phân; làm thành nguyên, hợp nhất lại<br />- i. by parts lấy tích phana từng phần<br />- i. by substitutionlấy tích phân bằng phép thế</Q></N></I></F></C>'),
(65372, 'integrated', '<C><F><I><N><Q>@integrated<br />- được lấy tích phân, được hợp nhất lại; được nhóm lại</Q></N></I></F></C><C><F><I><N><Q>@integrate /''intigreit/<br />*  ngoại động từ<br />- hợp thành một thể thống nhất, bổ sung thành một thể thống nhất, hợp nhất<br />- chỉ tổng số, chỉ giá trị trung bình của<br />- (toán học) tích phân<br />- (từ Mỹ,nghĩa Mỹ) hợp lại thành một hệ thống thống nhất (những cái trước kia bị sự phân biệt chủng tộc tách ra)<br />- (từ Mỹ,nghĩa Mỹ) mở rộng cho mọi người, mở rộng cho mọi chủng tộc<br />- (từ Mỹ,nghĩa Mỹ) dành quyền bình đẳng cho (một chủng tộc...)<br />*  nội động từ<br />- hợp nhất<br />- (từ Mỹ,nghĩa Mỹ) hợp lại thành một hệ thống thống nhất (những cái trước kia bị sự phân biệt chủng tộc tách ra)<br />- (từ Mỹ,nghĩa Mỹ) được mở rộng cho mọi người, được mở rộng cho mọi chủng tộc<br />- (từ Mỹ,nghĩa Mỹ) hoà hợp và trở thành một bộ phận của nền văn hoá chính<br /><br />@integrate<br />- lấy tích phân; làm thành nguyên, hợp nhất lại<br />- i. by parts lấy tích phana từng phần<br />- i. by substitutionlấy tích phân bằng phép thế</Q></N></I></F></C>'),
