(65374, 'integrated software', '<C><F><I><N><Q>@integrated software<br />* danh từ<br />- &lt;tin&gt; phần mềm tích hợp</Q></N></I></F></C>'),
(65375, 'integrates', '<C><F><I><N><Q>@integrate /''intigreit/<br />*  ngoại động từ<br />- hợp thành một thể thống nhất, bổ sung thành một thể thống nhất, hợp nhất<br />- chỉ tổng số, chỉ giá trị trung bình của<br />- (toán học) tích phân<br />- (từ Mỹ,nghĩa Mỹ) hợp lại thành một hệ thống thống nhất (những cái trước kia bị sự phân biệt chủng tộc tách ra)<br />- (từ Mỹ,nghĩa Mỹ) mở rộng cho mọi người, mở rộng cho mọi chủng tộc<br />- (từ Mỹ,nghĩa Mỹ) dành quyền bình đẳng cho (một chủng tộc...)<br />*  nội động từ<br />- hợp nhất<br />- (từ Mỹ,nghĩa Mỹ) hợp lại thành một hệ thống thống nhất (những cái trước kia bị sự phân biệt chủng tộc tách ra)<br />- (từ Mỹ,nghĩa Mỹ) được mở rộng cho mọi người, được mở rộng cho mọi chủng tộc<br />- (từ Mỹ,nghĩa Mỹ) hoà hợp và trở thành một bộ phận của nền văn hoá chính<br /><br />@integrate<br />- lấy tích phân; làm thành nguyên, hợp nhất lại<br />- i. by parts lấy tích phana từng phần<br />- i. by substitutionlấy tích phân bằng phép thế</Q></N></I></F></C>'),
(65376, 'integrating', '<C><F><I><N><Q>@integrate /''intigreit/<br />*  ngoại động từ<br />- hợp thành một thể thống nhất, bổ sung thành một thể thống nhất, hợp nhất<br />- chỉ tổng số, chỉ giá trị trung bình của<br />- (toán học) tích phân<br />- (từ Mỹ,nghĩa Mỹ) hợp lại thành một hệ thống thống nhất (những cái trước kia bị sự phân biệt chủng tộc tách ra)<br />- (từ Mỹ,nghĩa Mỹ) mở rộng cho mọi người, mở rộng cho mọi chủng tộc<br />- (từ Mỹ,nghĩa Mỹ) dành quyền bình đẳng cho (một chủng tộc...)<br />*  nội động từ<br />- hợp nhất<br />- (từ Mỹ,nghĩa Mỹ) hợp lại thành một hệ thống thống nhất (những cái trước kia bị sự phân biệt chủng tộc tách ra)<br />- (từ Mỹ,nghĩa Mỹ) được mở rộng cho mọi người, được mở rộng cho mọi chủng tộc<br />- (từ Mỹ,nghĩa Mỹ) hoà hợp và trở thành một bộ phận của nền văn hoá chính<br /><br />@integrate<br />- lấy tích phân; làm thành nguyên, hợp nhất lại<br />- i. by parts lấy tích phana từng phần<br />- i. by substitutionlấy tích phân bằng phép thế</Q></N></I></F></C>'),
(65377, 'Integration', '<C><F><I><N><Q>@Integration<br />- (Econ) Tích phân hoá.<br />+ Đây là quá trình ngược lại của vi phân. Xem DERIVATIVE.</Q></N></I></F></C>'),
(65378, 'integration', '<C><F><I><N><Q>@integration /,inti''greiʃn/<br />*  danh từ<br />- sự hợp lại thành một hệ thống thống nhất, sự bổ sung thành một thể thống nhất, sự hợp nhất<br />- sự hoà hợp với môi trường<br />- (toán học) phép tích phân; sự tích phân<br />- (từ Mỹ,nghĩa Mỹ) sự hợp lại thành một hệ thống thống nhất (những cái trước kia bị sự phân biệt chủng tộc tách ra)<br />- (từ Mỹ,nghĩa Mỹ) sự mở rộng cho mọi người, sự mở rộng cho mọi chủng tộc<br />- (từ Mỹ,nghĩa Mỹ) sự dành quyền bình đẳng cho (một chủng tộc...)<br /><br />@integration<br />- (giải tích) phép lấy tích phân i. by decomposition phép lấy tích<br />- phân bằng phân tích; i. by partial fractions phép lấy tích phân bằng<br />- phân thức đơn giản; i. by substitution phép lấy tích phân bằng phép thế;<br />- i. in infinite terms phép lấy tích phân các số hạng hữu hạn <br />- i. of sequences and series phép lấy tích phân chuỗi vô hạn<br />- approximate i. phép lấy tích phân [xấp xỉ, gần đúng]<br />- asymptotic i. phép lấy tích phân tiệm cận<br />- complex i. phép lấy tích phân thức<br />- formal i. phép lấy tích phân <br />- graphic(al) i. phép lấy tích phân bằng đồ thị<br />- group i. phép lấy tích phân theo nhóm<br />- immediate i. phép lấy tích phân trực tiếp<br />- machanical i. phép lấy tích phân cơ giới<br />- numerical i. phép lấy tích phân bằng số<br />- point by point i. phép lấy tích phân theo điểm<br />- successive i. lấy tích phân liên tiếp</Q></N></I></F></C>'),
(65379, 'integrationist', '<C><F><I><N><Q>@integrationist /,inti''greiʃnist/<br />*  danh từ<br />- (từ Mỹ,nghĩa Mỹ) người tán thành mở rộng (mở rộng trường học... cho mọi người, cho mọi chủng tộc...)</Q></N></I></F></C>'),
(65380, 'integrationists', '<C><F><I><N><Q>@integrationist /,inti''greiʃnist/<br />*  danh từ<br />- (từ Mỹ,nghĩa Mỹ) người tán thành mở rộng (mở rộng trường học... cho mọi người, cho mọi chủng tộc...)</Q></N></I></F></C>'),
(65381, 'integrations', '<C><F><I><N><Q>@Integration<br />- (Econ) Tích phân hoá.<br />+ Đây là quá trình ngược lại của vi phân. Xem DERIVATIVE.</Q></N></I></F></C><C><F><I><N><Q>@integration /,inti''greiʃn/<br />*  danh từ<br />- sự hợp lại thành một hệ thống thống nhất, sự bổ sung thành một thể thống nhất, sự hợp nhất<br />- sự hoà hợp với môi trường<br />- (toán học) phép tích phân; sự tích phân<br />- (từ Mỹ,nghĩa Mỹ) sự hợp lại thành một hệ thống thống nhất (những cái trước kia bị sự phân biệt chủng tộc tách ra)<br />- (từ Mỹ,nghĩa Mỹ) sự mở rộng cho mọi người, sự mở rộng cho mọi chủng tộc<br />- (từ Mỹ,nghĩa Mỹ) sự dành quyền bình đẳng cho (một chủng tộc...)<br /><br />@integration<br />- (giải tích) phép lấy tích phân i. by decomposition phép lấy tích<br />- phân bằng phân tích; i. by partial fractions phép lấy tích phân bằng<br />- phân thức đơn giản; i. by substitution phép lấy tích phân bằng phép thế;<br />- i. in infinite terms phép lấy tích phân các số hạng hữu hạn <br />- i. of sequences and series phép lấy tích phân chuỗi vô hạn<br />- approximate i. phép lấy tích phân [xấp xỉ, gần đúng]<br />- asymptotic i. phép lấy tích phân tiệm cận<br />- complex i. phép lấy tích phân thức<br />- formal i. phép lấy tích phân <br />- graphic(al) i. phép lấy tích phân bằng đồ thị<br />- group i. phép lấy tích phân theo nhóm<br />- immediate i. phép lấy tích phân trực tiếp<br />- machanical i. phép lấy tích phân cơ giới<br />- numerical i. phép lấy tích phân bằng số<br />- point by point i. phép lấy tích phân theo điểm<br />- successive i. lấy tích phân liên tiếp</Q></N></I></F></C>'),
(65382, 'integrative', '<C><F><I><N><Q>@integrative /''intigreitiv/<br />*  tính từ<br />- để trở thành một hệ thống thống nhất, để bỏ sung thành một thể thống nhất để hợp nhất<br />- (từ Mỹ,nghĩa Mỹ) để hợp lại thành một hệ thống thống nhất (những cái trước kia bị sự phân biệt chủng tộc tách ra)<br />- (từ Mỹ,nghĩa Mỹ) để mở rộng cho mọi người, để mở rộng cho mọi chủng tộc<br />- (từ Mỹ,nghĩa Mỹ) để dành quyền bình đẳng cho (một chủng tộc...)</Q></N></I></F></C>'),
(65383, 'integrator', '<C><F><I><N><Q>@integrator /''intigreitə/<br />*  danh từ<br />- người hợp nhất<br />- (toán học) máy tích phân<br /><br />@integrator<br />- (máy tính) máy lấy tích phân, thiết bị lấy tích phân<br />- ball-and-disc i. máy lấy tích phân có đĩa và quả cầu<br />- bootstrap i. máy lấy tích phân có tham biến điều chỉnh độ sai<br />- current i. máy lấy tích phân dòng<br />- electromic i. máy lấy tích phân điện tử<br />- flyball i. máy lấy tích phân hình cầu bay ly tâm<br />- gyroscopic i. máy lấy tích phana hồi chuyển<br />- optic (al) i. máy lấy tích phân quang học<br />- perfect i. máy lấy tích phân lý tưởng<br />- photo-clectric i. máy lấy tích phân quang điện<br />- product i. máy lấy tích phân các tích<br />- summing i. máy lấy tích phân các tổng<br />- nelocity i. máy lấy tích phân vận tốc<br />- wheel-and-disc i. máy lấy tích phân có đĩa và bánh</Q></N></I></F></C>'),
(65384, 'integrators', '<C><F><I><N><Q>@integrator /''intigreitə/<br />*  danh từ<br />- người hợp nhất<br />- (toán học) máy tích phân<br /><br />@integrator<br />- (máy tính) máy lấy tích phân, thiết bị lấy tích phân<br />- ball-and-disc i. máy lấy tích phân có đĩa và quả cầu<br />- bootstrap i. máy lấy tích phân có tham biến điều chỉnh độ sai<br />- current i. máy lấy tích phân dòng<br />- electromic i. máy lấy tích phân điện tử<br />- flyball i. máy lấy tích phân hình cầu bay ly tâm<br />- gyroscopic i. máy lấy tích phana hồi chuyển<br />- optic (al) i. máy lấy tích phân quang học<br />- perfect i. máy lấy tích phân lý tưởng<br />- photo-clectric i. máy lấy tích phân quang điện<br />- product i. máy lấy tích phân các tích<br />- summing i. máy lấy tích phân các tổng<br />- nelocity i. máy lấy tích phân vận tốc<br />- wheel-and-disc i. máy lấy tích phân có đĩa và bánh</Q></N></I></F></C>'),
(65385, 'integrities', '<C><F><I><N><Q>@integrity /in''tegriti/<br />*  danh từ<br />- tính chính trực, tính liêm chính<br />- tính toàn bộ, tính toàn vẹn, tính nguyên; tình trạng không bị sứt mẻ, tình trạng toàn vẹn, tình trạng nguyên vẹn<br /><br />@integrity<br />- tính nguyên</Q></N></I></F></C>'),
(65386, 'integrity', '<C><F><I><N><Q>@integrity /in''tegriti/<br />*  danh từ<br />- tính chính trực, tính liêm chính<br />- tính toàn bộ, tính toàn vẹn, tính nguyên; tình trạng không bị sứt mẻ, tình trạng toàn vẹn, tình trạng nguyên vẹn<br /><br />@integrity<br />- tính nguyên</Q></N></I></F></C>'),
(65387, 'integro-differential', '<C><F><I><N><Q>@integro-differential<br />- vi tích phân</Q></N></I></F></C>'),
