(65389, 'integumental', '<C><F><I><N><Q>@integumental<br />* tính từ<br />- thuộc vỏ bọc; thuộc lớp bọc ngoài (da, vỏ v v...)</Q></N></I></F></C>'),
(65390, 'integumentary', '<C><F><I><N><Q>@integumentary /in,tegju''mentəri/<br />*  tính từ<br />- (thuộc) da, (thuộc) vỏ, (thuộc) vỏ bọc</Q></N></I></F></C>'),
