(65392, 'intel', '<C><F><I><N><Q>@intel<br />- Tên hãng sản xuất linmh kiện điện tử Mỹ</Q></N></I></F></C>'),
(65393, 'intellect', '<C><F><I><N><Q>@intellect /''intilekt/<br />*  danh từ<br />- khả năng hiểu biết, khả năng lập luận; trí tuệ, trí năng<br />- sự hiểu biết<br />- người hiểu biết; người tài trí<br /><br />@intellect<br />- thông minh; tri thức</Q></N></I></F></C>'),
(65394, 'intellection', '<C><F><I><N><Q>@intellection /,inti''lekʃn/<br />*  danh từ<br />- sự hiểu biết, quá trình hiểu biết</Q></N></I></F></C>'),
