(65397, 'intellects', '<C><F><I><N><Q>@intellect /''intilekt/<br />*  danh từ<br />- khả năng hiểu biết, khả năng lập luận; trí tuệ, trí năng<br />- sự hiểu biết<br />- người hiểu biết; người tài trí<br /><br />@intellect<br />- thông minh; tri thức</Q></N></I></F></C>'),
(65398, 'intellectual', '<C><F><I><N><Q>@intellectual /,inti''lektjuəl/<br />*  tính từ<br />- (thuộc) trí óc; vận dụng trí óc<br />- có trí thức, hiểu biết rộng; tài trí<br />*  danh từ<br />- người trí thức, người lao động trí óc</Q></N></I></F></C>'),
(65399, 'intellectualisation', '<C><F><I><N><Q>@intellectualisation<br />* danh từ<br />- sự trí thức hoá<br />- sự nặng suy nghĩ bằng trí óc</Q></N></I></F></C>'),
(65400, 'intellectualise', '<C><F><I><N><Q>@intellectualise /,inti''lektjuəlaiz/ (intellectualise) /,inti''lektjuəlaiz/<br />*  động từ<br />- trí thức hoá<br />- nặng suy nghĩ bằng trí óc</Q></N></I></F></C>'),
(65401, 'intellectualism', '<C><F><I><N><Q>@intellectualism /,inti''lektjuəlizm/<br />*  danh từ<br />- sự say mê công việc trí óc<br />- sự quá nặng về trí óc<br />- (triết học) thuyết duy lý trí</Q></N></I></F></C>'),
(65402, 'intellectualist', '<C><F><I><N><Q>@intellectualist /,inti''lektjuəlist/<br />*  danh từ<br />- (triết học) người duy lý trí</Q></N></I></F></C>'),
(65403, 'intellectualistic', '<C><F><I><N><Q>@intellectualistic /''inti,lektjuə''listik/<br />*  tính từ<br />- (triết học) duy lý trí</Q></N></I></F></C>'),
(65404, 'intellectualists', '<C><F><I><N><Q>@intellectualist /,inti''lektjuəlist/<br />*  danh từ<br />- (triết học) người duy lý trí</Q></N></I></F></C>'),
(65405, 'intellectuality', '<C><F><I><N><Q>@intellectuality /''inti,lektju''æliti/<br />*  danh từ<br />- tính chất trí thức<br />- khả năng làm việc bằng trí óc</Q></N></I></F></C>'),
(65406, 'intellectualization', '<C><F><I><N><Q>@intellectualization /''inti,lektjuəlai''zeiʃn/<br />*  danh từ<br />- sự trí thức hoá<br />- sự nặng suy nghĩ bằng trí óc</Q></N></I></F></C>'),
(65407, 'intellectualize', '<C><F><I><N><Q>@intellectualize /,inti''lektjuəlaiz/ (intellectualise) /,inti''lektjuəlaiz/<br />*  động từ<br />- trí thức hoá<br />- nặng suy nghĩ bằng trí óc</Q></N></I></F></C>'),
(65408, 'intellectualizer', '<C><F><I><N><Q>@intellectualizer<br />- xem intellectualize</Q></N></I></F></C>'),
(65409, 'intellectually', '<C><F><I><N><Q>@intellectually<br />* phó từ<br />- về mặt trí tuệ, trí thức</Q></N></I></F></C>'),
(65410, 'intellectualness', '<C><F><I><N><Q>@intellectualness<br />- xem intellectual</Q></N></I></F></C>'),
(65411, 'intellectuals', '<C><F><I><N><Q>@intellectual /,inti''lektjuəl/<br />*  tính từ<br />- (thuộc) trí óc; vận dụng trí óc<br />- có trí thức, hiểu biết rộng; tài trí<br />*  danh từ<br />- người trí thức, người lao động trí óc</Q></N></I></F></C>'),
(65412, 'intelligence', '<C><F><I><N><Q>@intelligence /in''telidʤəns/<br />*  danh từ<br />- sự hiểu biết<br />- khả năng hiểu biết, trí thông minh; trí óc<br />- tin tức, tình báo; sự thu thập tin tức, sự làm tình báo, sự trao đổi tình báo; sự đánh giá tình hình trên cơ sở tình báo<br />- cơ quan tình báo<br /><br />@intelligence<br />- thông minh, tri thức</Q></N></I></F></C>'),
(65413, 'intelligence bureau', '<C><F><I><N><Q>@intelligence bureau /in''telidʤənsbjuə''rou/ (intelligence_department) /in''telidʤənsdi''pɑ:tmənt/<br />*  danh từ<br />- vụ tình báo</Q></N></I></F></C>'),
(65414, 'intelligence department', '<C><F><I><N><Q>@intelligence department /in''telidʤənsbjuə''rou/ (intelligence_department) /in''telidʤənsdi''pɑ:tmənt/<br />*  danh từ<br />- vụ tình báo</Q></N></I></F></C>'),
(65415, 'intelligence office', '<C><F><I><N><Q>@intelligence office /in''telidʤəns''ɔfis/<br />*  danh từ<br />- (như) intelligence_bureau<br />- (từ cổ,nghĩa cổ) sở giới thiệu người giúp việc trong nhà</Q></N></I></F></C>'),
(65416, 'intelligence quotient', '<C><F><I><N><Q>@intelligence quotient /in''telidʤəns''kwouʃənt/<br />*  danh từ<br />- (tâm lý học) (viết tắt) I.Q., hệ số thông minh (so với một người bình thường)</Q></N></I></F></C>'),
(65417, 'intelligence test', '<C><F><I><N><Q>@intelligence test /in''telidʤəns''test/<br />*  danh từ<br />- sự thử trí thông minh</Q></N></I></F></C>'),
(65418, 'intelligencer', '<C><F><I><N><Q>@intelligencer /in''telidʤənsə/<br />*  danh từ<br />- người đưa tin đến, người cho tin<br />- đặc vụ, gián điệp</Q></N></I></F></C>'),
(65419, 'intelligences', '<C><F><I><N><Q>@intelligence /in''telidʤəns/<br />*  danh từ<br />- sự hiểu biết<br />- khả năng hiểu biết, trí thông minh; trí óc<br />- tin tức, tình báo; sự thu thập tin tức, sự làm tình báo, sự trao đổi tình báo; sự đánh giá tình hình trên cơ sở tình báo<br />- cơ quan tình báo<br /><br />@intelligence<br />- thông minh, tri thức</Q></N></I></F></C>'),
(65420, 'intelligent', '<C><F><I><N><Q>@intelligent /in''telidʤənt/<br />*  tính từ<br />- thông minh, sáng dạ<br />- nhanh trí<br />- biết<br />=to be intelligent of something+ biết cái gì<br /><br />@intelligent<br />- thông minh</Q></N></I></F></C>'),
