(65424, 'intelligentzia', '<C><F><I><N><Q>@intelligentzia /in,teli''dʤentsiə/ (intelligentzia) /in,teli''dʤentsiə/<br />*  danh từ<br />- giới trí thức</Q></N></I></F></C>'),
