(65426, 'intelligibility', '<C><F><I><N><Q>@intelligibility /in,telidʤə''biliti/<br />*  danh từ<br />- tính dễ hiểu ((cũng) intelligibleness)<br />- điều dễ hiểu<br /><br />@intelligibility<br />- tính hiểu được, tính đọc được</Q></N></I></F></C>'),
