(65434, 'intemperateness', '<C><F><I><N><Q>@intemperateness /in''tempəritnis/<br />*  danh từ<br />- tính quá độ, tính không điều độ<br />- tính không đúng mức<br />- (từ Mỹ,nghĩa Mỹ) tính không đều (khí hậu)</Q></N></I></F></C>'),
(65435, 'intend', '<C><F><I><N><Q>@intend /in''tend/<br />*  ngoại động từ<br />- định, có ý định, có ý muốn<br />- định dùng, dành<br />=he intend s his son for the air force+ ông ta định cho con vào không quân<br />- định nói, ý muốn nói<br />=what do you intend by this word+ lời này của anh ý muốn nói gì?<br />*  nội động từ<br />- có ý định, có mục đích<br /><br />@intend<br />- có ý định; có nghĩa là; hiểu là</Q></N></I></F></C>'),
(65436, 'intendance', '<C><F><I><N><Q>@intendance /in''tendəns/ (intendancy) /in''tendənsi/<br />*  danh từ<br />- chức vị quản đốc<br />- nơi ở chính thức của quản đốc</Q></N></I></F></C>'),
