(65440, 'intended', '<C><F><I><N><Q>@intended /in''tendid/<br />*  tính từ<br />- có định ý, có dụng ý, đã được nhằm; chờ đợi<br />=the intended effect+ kết quả chờ đợi<br />- sắp cưới, đã hứa hôn<br />=an intended wife+ vợ sắp cưới<br />*  danh từ<br />- (thông tục) vợ sắp cưới, chồng sắp cưới</Q></N></I></F></C><C><F><I><N><Q>@intend /in''tend/<br />*  ngoại động từ<br />- định, có ý định, có ý muốn<br />- định dùng, dành<br />=he intend s his son for the air force+ ông ta định cho con vào không quân<br />- định nói, ý muốn nói<br />=what do you intend by this word+ lời này của anh ý muốn nói gì?<br />*  nội động từ<br />- có ý định, có mục đích<br /><br />@intend<br />- có ý định; có nghĩa là; hiểu là</Q></N></I></F></C>'),
(65441, 'Intended inventory investment', '<C><F><I><N><Q>@Intended inventory investment<br />- (Econ) Đầu tư vào hàng tồn kho có chủ ý <br />+ Sự gia tăng dự trữ có chủ tâm. Xem INVESTORIES.</Q></N></I></F></C>'),
