(65463, 'intension', '<C><F><I><N><Q>@intension /in''tenʃn/<br />*  danh từ<br />- độ cao; đọ tăng cường<br />- tính mãnh liệt, tính dữ dội<br />- sự cố gắng căng thẳng về tinh thần; quyết tâm cao<br /><br />@intension<br />- (logic học) nội hàm (của khái niệm); (vật lí) cường độ</Q></N></I></F></C>'),
