(65466, 'intensity', '<C><F><I><N><Q>@intensity /in''tensiti/<br />*  danh từ<br />- độ mạnh, cường độ<br />- sức mạnh; tính mãnh liệt, tính dữ dội<br />- sự xúc cảm mãnh liệt<br /><br />@intensity<br />- cường độ<br />- i. of force cường độ lực<br />- i. of pressure cường độ áp lực<br />- i. of sound cường độ âm thanh<br />- electrostatic i. cường độ trường tĩnh điện<br />- luminous i. cường độ ánh sáng<br />- sound i. cường độ âm thanh</Q></N></I></F></C>'),
(65467, 'intensive', '<C><F><I><N><Q>@intensive /in''tensiv/<br />*  tính từ<br />- mạnh, có cường độ lớn<br />- làm mạnh mẽ, làm sâu sắc<br />- tập trung sâu<br />=intensive bombing+ sự ném bom tập trung<br />=intensive study+ sự nghiên cứu sâu<br />- (y học) tăng liều, ngày càng tăng liều<br />- (ngôn ngữ học) nhấn mạnh<br />!intensive farming<br />- thâm canh</Q></N></I></F></C>'),
(65468, 'intensive care', '<C><F><I><N><Q>@intensive care<br />* danh từ<br />- sự săn sóc đặc biệt đối với những người bệnh nặng</Q></N></I></F></C>'),
