(65472, 'intensiveness', '<C><F><I><N><Q>@intensiveness /in''tensivnis/<br />*  danh từ<br />- độ mạnh, sự có cường độ lớn; khả năng làm mạnh lên<br />- tính mạnh liệt, tính sâu sắc<br />- tính tập trung, tính sâu (nghiên cứu...)</Q></N></I></F></C>'),
(65473, 'intensives', '<C><F><I><N><Q>@intensive /in''tensiv/<br />*  tính từ<br />- mạnh, có cường độ lớn<br />- làm mạnh mẽ, làm sâu sắc<br />- tập trung sâu<br />=intensive bombing+ sự ném bom tập trung<br />=intensive study+ sự nghiên cứu sâu<br />- (y học) tăng liều, ngày càng tăng liều<br />- (ngôn ngữ học) nhấn mạnh<br />!intensive farming<br />- thâm canh</Q></N></I></F></C>'),
(65474, 'intent', '<C><F><I><N><Q>@intent /in''tent/<br />*  danh từ<br />- ý định, mục đích<br />- nghĩa<br />!to all intents and purposes<br />- hầu như, thực tế là<br />=his news statement was to all intents and purposes not different from the old one+ lời tuyên bố mới của hắn ta hầu như không khác gì lời tuyên bố trước<br />*  tính từ (+ on)<br />- kiên quyết; đeo đuổi, miệt mài, mải mê, chăm chú<br />=an intent gaze+ cái nhìn chăm chú<br />=to be intent on one''s job+ chăm chú làm công việc của mình<br />- sôi nôi, hăm hở, đầy nhiệt tình<br />=an intent person+ một người sôi nổi<br /><br />@intent<br />- ý định, dự định</Q></N></I></F></C>'),
(65475, 'intentiness', '<C><F><I><N><Q>@intentiness /in''tentis/<br />*  danh từ<br />- tính kiên quyết; sự đeo đuổi, sự mải mê, sự hăm hở</Q></N></I></F></C>'),
