(65543, 'intercessory', '<C><F><I><N><Q>@intercessory /,intə''sesəri/<br />*  tính từ<br />- có tác dụng can thiệp giúp (ai), giùm<br />- có nhiệm vụ cầu nguyện hộ</Q></N></I></F></C>'),
(65544, 'interchange', '<C><F><I><N><Q>@interchange /''intə''tʃeindʤ/<br />*  danh từ<br />- sự trao đổi lẫn nhau, sự thay thế lẫn nhau<br />- sự đổi chỗ cho nhau<br />- sự xen kẽ nhau<br />- (từ Mỹ,nghĩa Mỹ) ngã ba có đường hầm và cầu chui<br />*  ngoại động từ<br />- trao đổi lẫn nhau, thay thế lẫn nhau<br />- đổi chỗ cho nhau<br />- xen kẽ nhau<br />=to interchange work with amusement+ xen kẽ làm việc với giải trí<br />*  nội động từ<br />- xảy ra lần lượt, xảy ra theo lượt; xen kẽ<br />- thay thế nhau<br />- đổi chỗ cho nhau<br /><br />@interchange<br />- đổi chỗ, hoán vị</Q></N></I></F></C>'),
(65545, 'interchangeability', '<C><F><I><N><Q>@interchangeability /''intə,tʃeindʤə''biliti/ (interchangeableness) /,intə''tʃeindʤəblnis/<br />*  danh từ<br />- tính có thể thay cho nhau<br />- tính có thể thay thế, tính có thể đổi chỗ với vật khác</Q></N></I></F></C>'),
