(65600, 'intercrossing', '<C><F><I><N><Q>@intercross /''intəkrɔs/<br />*  động từ<br />- trồng xen<br />*  danh từ số nhiều<br />- sự giao phối, sự lai giống<br />- vật lai<br />*  ngoại động từ<br />- đặt chéo nhau; cắt chéo nhau (phố...)<br />- (sinh vật học) cho giao phối (giữa các giống khác nhau)<br />*  nội động từ<br />- chéo nhau<br />- (sinh vật học) giao phối (giữa các giống khác nhau)<br /><br />@intercross<br />- giao nhau, chéo nhau</Q></N></I></F></C>'),
(65601, 'intercrystalline', '<C><F><I><N><Q>@intercrystalline<br />* tính từ<br />- xảy ra giữa những tinh thể</Q></N></I></F></C>'),
(65602, 'intercurrence', '<C><F><I><N><Q>@intercurrence /,intə''kʌrəns/<br />*  danh từ<br />- sự xen vào (sự việc)<br />- (y học) sự mắc bệnh gian phát<br />- sự xảy đi xảy lại</Q></N></I></F></C>'),
(65603, 'intercurrent', '<C><F><I><N><Q>@intercurrent /,intə''kʌrənt/<br />*  tính từ<br />- xen<br />- (y học) gian phát<br />- xảy đi xảy lại</Q></N></I></F></C>'),
(65604, 'intercut', '<C><F><I><N><Q>@intercut /''intəkʌt /<br />*  danh từ<br />- (điện ảnh) đoạn phim có cảnh xen[,intə''kʌt]<br />*  động từ<br />- (điện ảnh) xen cảnh</Q></N></I></F></C>'),
(65605, 'interdeducible', '<C><F><I><N><Q>@interdeducible<br />- (logic học) suy lẫn nhau</Q></N></I></F></C>'),
