(65613, 'interdependent', '<C><F><I><N><Q>@interdependent /,intədi''pendənt/<br />*  tính từ<br />- phụ thuộc lẫn nhau<br /><br />@interdependent<br />- liên quan với nhau, phụ thuộc nhau</Q></N></I></F></C>'),
(65614, 'Interdependent utility', '<C><F><I><N><Q>@Interdependent utility<br />- (Econ) Độ thoả dụng phụ thuộc lẫn nhau.<br />+ Nếu độ thoả dụng của một nhười bị tác động bởi số lượng hàng hoá và dịch vụ mà những người khác tiêu dùng thì nảy sinh trường hợp độ thoả dụng phụ thuộc lẫn nhau.</Q></N></I></F></C>'),
(65615, 'interdependently', '<C><F><I><N><Q>@interdependently<br />* phó từ<br />- phụ thuộc lẫn nhau, tương thức</Q></N></I></F></C>'),
