(65625, 'interdictory', '<C><F><I><N><Q>@interdictory /,intə''diktəri/<br />*  tính từ<br />- (thuộc) sự cấm chỉ<br />- (thuộc) sự khai trừ, (thuộc) sự huyền chức<br />- (thuộc) sự ngăn chặn (tiếp tế...) bằng cách bắn phá đường giao thông</Q></N></I></F></C>'),
(65626, 'interdicts', '<C><F><I><N><Q>@interdict /''intədikt/<br />*  danh từ<br />- sự cấm, sự cấm chỉ<br />- (tôn giáo) sự khai trừ, sự huyền chức<br />*  động từ<br />- cấm, cấm chỉ<br />- (tôn giáo) khai trừ, huyền chức<br />- (từ Mỹ,nghĩa Mỹ),  (quân sự) ngăn chặn (tiếp tế...) bằng cách bắn phá đường giao thông</Q></N></I></F></C>'),
