(65628, 'interdiffused', '<C><F><I><N><Q>@interdiffuse<br />* nội động từ<br />- toả rộng và hoà lẫn</Q></N></I></F></C>'),
(65629, 'interdiffuses', '<C><F><I><N><Q>@interdiffuse<br />* nội động từ<br />- toả rộng và hoà lẫn</Q></N></I></F></C>'),
