(65631, 'interdiffusion', '<C><F><I><N><Q>@interdiffusion<br />* danh từ<br />- sự toả rộng và hoà lẫn</Q></N></I></F></C>'),
(65632, 'interdigitate', '<C><F><I><N><Q>@interdigitate<br />* nội động từ<br />- đan vào nhau như những ngón tay</Q></N></I></F></C>'),
(65633, 'interdigitation', '<C><F><I><N><Q>@interdigitation<br />* danh từ<br />- sự đan vào nhau như những ngón tay</Q></N></I></F></C>'),
(65634, 'interdisciplinary', '<C><F><I><N><Q>@interdisciplinary /,intə''disiplinəri/<br />*  tính từ<br />- gồm nhiều ngành học thuật<br />=an interdisciplinary seminar+ một cuộc hội nghị chuyên đề gồm nhiều ngành học thuật</Q></N></I></F></C>'),
(65635, 'Interdistrict Settlement Account (or Fund)', '<C><F><I><N><Q>@Interdistrict Settlement Account (or Fund)<br />- (Econ) Tài khoản (hay quỹ) Thanh toán liên vùng.<br />+ Một tài khoản đặc biệt của sở thanh toán bù trừ được sử dụng để điều tiết sự chuyển tiền giữa 12 Ngân hàng vùng thuộc HỆ THỐNG DỰ TRỮ LIÊN BANG.</Q></N></I></F></C>'),
(65636, 'Interest', '<C><F><I><N><Q>@Interest<br />- (Econ) Tiền lãi, lãi suất.<br />+ Xem RATE OF INTEREST.</Q></N></I></F></C>'),
(65637, 'interest', '<C><F><I><N><Q>@interest /''intrist/<br />*  danh từ<br />- sự quan tâm, sự chú ý; điều quan tâm, điều chú ý<br />=a question of great interest+ một vấn đề đáng chú ý<br />- sự thích thú; điều thích thú<br />- tầm quan trọng<br />=a matter of great interest+ một việc quan trọng<br />- quyền lợi; lợi ích, ích kỷ<br />=to do something in (to) somebody''s interest (s)+ làm gì vì lợi ích của ai<br />- lợi tức, tiền lãi<br />- tập thể cùng chung một quyền lợi<br />=the steel interest+ nhóm tư bản thép<br />!to make interest with somebody<br />- dùng lợi ích cá nhân làm áp lực với ai<br />*  ngoại động từ<br />- làm cho quan tâm, làm cho chú ý, làm cho thích thú<br />- liên quan đến, dính dáng đến<br />=the fight against aggression interests all peoples+ sự đấu tranh chống xâm lược liên quan đến mọi dân tộc<br />- làm tham gia<br />=to interest a finacier in an undertaking+ làm cho một nhà tư bản tài chính tham gia một cuộc kinh doanh<br /><br />@interest<br />- (toán kinh tế) lãi<br />- compound i. lãi kép<br />- simple i. lãi đơn</Q></N></I></F></C>'),
(65638, 'Interest equalization tax', '<C><F><I><N><Q>@Interest equalization tax<br />- (Econ) Thuếu san bằng lãi suất.<br />+ Vào đầu những năm 1960, nước Mỹ trải qua một thời kỳ cán cân thanh toán liên tục thâm hụt với số lượng lớn do vốn chay khỏi đất nước. Thuế san bàng lãi suất là một ý định nhằm ngăn luồng vốn đi ra này bằng cách đánh thuế vào việc công dân Mỹ mua trái phiếu và tài sản nước ngoài.</Q></N></I></F></C>'),
(65639, 'Interest sensitivity', '<C><F><I><N><Q>@Interest sensitivity<br />- (Econ) Độ nhạy theo lãi suất.</Q></N></I></F></C>'),
(65640, 'interested', '<C><F><I><N><Q>@interested /''intristid/<br />*  tính từ<br />- có quan tâm, thích thú, có chú ý<br />=an interested spectator+ một khán giả chăm chú<br />- có lợi ích riêng; có liên quan, có dính dáng; có cổ phần, có vốn đầu tư<br />- không vô tư, cầu lợi<br />=an interested aid+ sự viện trợ không vô tư</Q></N></I></F></C><C><F><I><N><Q>@Interest<br />- (Econ) Tiền lãi, lãi suất.<br />+ Xem RATE OF INTEREST.</Q></N></I></F></C><C><F><I><N><Q>@interest /''intrist/<br />*  danh từ<br />- sự quan tâm, sự chú ý; điều quan tâm, điều chú ý<br />=a question of great interest+ một vấn đề đáng chú ý<br />- sự thích thú; điều thích thú<br />- tầm quan trọng<br />=a matter of great interest+ một việc quan trọng<br />- quyền lợi; lợi ích, ích kỷ<br />=to do something in (to) somebody''s interest (s)+ làm gì vì lợi ích của ai<br />- lợi tức, tiền lãi<br />- tập thể cùng chung một quyền lợi<br />=the steel interest+ nhóm tư bản thép<br />!to make interest with somebody<br />- dùng lợi ích cá nhân làm áp lực với ai<br />*  ngoại động từ<br />- làm cho quan tâm, làm cho chú ý, làm cho thích thú<br />- liên quan đến, dính dáng đến<br />=the fight against aggression interests all peoples+ sự đấu tranh chống xâm lược liên quan đến mọi dân tộc<br />- làm tham gia<br />=to interest a finacier in an undertaking+ làm cho một nhà tư bản tài chính tham gia một cuộc kinh doanh<br /><br />@interest<br />- (toán kinh tế) lãi<br />- compound i. lãi kép<br />- simple i. lãi đơn</Q></N></I></F></C>');
INSERT INTO `tbl_edict` (`id`, `word`, `detail`) VALUES
(65641, 'interestedly', '<C><F><I><N><Q>@interestedly<br />- xem interested</Q></N></I></F></C>'),
(65642, 'interestedness', '<C><F><I><N><Q>@interestedness /''intristidnis/<br />*  danh từ<br />- sự có lợi ích riêng; sự có liên quan, sự có dính dáng; sự có cổ phần, sự có vốn đầu tư<br />- sự không vô tư, sự cầu lợi</Q></N></I></F></C>'),
(65643, 'interesting', '<C><F><I><N><Q>@interesting /''intristiɳ/<br />*  tính từ<br />- làm quan tâm, làm chú ý<br />=an interesting film+ một bộ phim thú vị<br />!to be in an interresting condition<br />- có thai, có mang</Q></N></I></F></C><C><F><I><N><Q>@Interest<br />- (Econ) Tiền lãi, lãi suất.<br />+ Xem RATE OF INTEREST.</Q></N></I></F></C><C><F><I><N><Q>@interest /''intrist/<br />*  danh từ<br />- sự quan tâm, sự chú ý; điều quan tâm, điều chú ý<br />=a question of great interest+ một vấn đề đáng chú ý<br />- sự thích thú; điều thích thú<br />- tầm quan trọng<br />=a matter of great interest+ một việc quan trọng<br />- quyền lợi; lợi ích, ích kỷ<br />=to do something in (to) somebody''s interest (s)+ làm gì vì lợi ích của ai<br />- lợi tức, tiền lãi<br />- tập thể cùng chung một quyền lợi<br />=the steel interest+ nhóm tư bản thép<br />!to make interest with somebody<br />- dùng lợi ích cá nhân làm áp lực với ai<br />*  ngoại động từ<br />- làm cho quan tâm, làm cho chú ý, làm cho thích thú<br />- liên quan đến, dính dáng đến<br />=the fight against aggression interests all peoples+ sự đấu tranh chống xâm lược liên quan đến mọi dân tộc<br />- làm tham gia<br />=to interest a finacier in an undertaking+ làm cho một nhà tư bản tài chính tham gia một cuộc kinh doanh<br /><br />@interest<br />- (toán kinh tế) lãi<br />- compound i. lãi kép<br />- simple i. lãi đơn</Q></N></I></F></C>'),
(65644, 'interestingly', '<C><F><I><N><Q>@interestingly<br />* phó từ<br />- thú vị, hấp dẫn</Q></N></I></F></C>'),
(65645, 'interestingness', '<C><F><I><N><Q>@interestingness /''intristiɳnis/<br />*  danh từ<br />- sự làm quan tâm, sự làm chú ý; tính chất chú ý</Q></N></I></F></C>'),
(65646, 'interests', '<C><F><I><N><Q>@Interest<br />- (Econ) Tiền lãi, lãi suất.<br />+ Xem RATE OF INTEREST.</Q></N></I></F></C><C><F><I><N><Q>@interest /''intrist/<br />*  danh từ<br />- sự quan tâm, sự chú ý; điều quan tâm, điều chú ý<br />=a question of great interest+ một vấn đề đáng chú ý<br />- sự thích thú; điều thích thú<br />- tầm quan trọng<br />=a matter of great interest+ một việc quan trọng<br />- quyền lợi; lợi ích, ích kỷ<br />=to do something in (to) somebody''s interest (s)+ làm gì vì lợi ích của ai<br />- lợi tức, tiền lãi<br />- tập thể cùng chung một quyền lợi<br />=the steel interest+ nhóm tư bản thép<br />!to make interest with somebody<br />- dùng lợi ích cá nhân làm áp lực với ai<br />*  ngoại động từ<br />- làm cho quan tâm, làm cho chú ý, làm cho thích thú<br />- liên quan đến, dính dáng đến<br />=the fight against aggression interests all peoples+ sự đấu tranh chống xâm lược liên quan đến mọi dân tộc<br />- làm tham gia<br />=to interest a finacier in an undertaking+ làm cho một nhà tư bản tài chính tham gia một cuộc kinh doanh<br /><br />@interest<br />- (toán kinh tế) lãi<br />- compound i. lãi kép<br />- simple i. lãi đơn</Q></N></I></F></C>'),
(65647, 'interface', '<C><F><I><N><Q>@interface /''intəfeis/<br />*  danh từ<br />- bề mặt chung (cho hai vật...); mặt phân giới<br />- những cái chung (của hai ngành học thuật...)<br />=the interface of chemistry and physics+ những cái chung của hoá học và vật lý<br /><br />@interface<br />- (vật lí) mặt phân cách, mặt phân giới</Q></N></I></F></C>'),
(65648, 'interfaces', '<C><F><I><N><Q>@interface /''intəfeis/<br />*  danh từ<br />- bề mặt chung (cho hai vật...); mặt phân giới<br />- những cái chung (của hai ngành học thuật...)<br />=the interface of chemistry and physics+ những cái chung của hoá học và vật lý<br /><br />@interface<br />- (vật lí) mặt phân cách, mặt phân giới</Q></N></I></F></C>'),
(65649, 'interfacial', '<C><F><I><N><Q>@interfacial /,intə''feiʃəl/<br />*  tính từ<br />- xen giữa hai bề mặt<br />- (thuộc) bề mặt chung (của hai vật...); (thuộc) mặt phân giới<br />- chung (cho hai ngành học thuật...)</Q></N></I></F></C>'),
(65650, 'interfacing', '<C><F><I><N><Q>@interfacing<br />* danh từ<br />- mảnh cứng khâu giữa hai lớp vải (trong ve áo, cổ áo)</Q></N></I></F></C>'),
(65651, 'interfaith', '<C><F><I><N><Q>@interfaith<br />* tính từ<br />- gồm những người có tín ngưỡng khác nhau</Q></N></I></F></C>'),
(65652, 'interfere', '<C><F><I><N><Q>@interfere /,intə''fiə/<br />*  nội động từ ((thường) + with)<br />- gây trở ngại, quấy rầy<br />=these goings and coming interfere with the work+ sự đi đi lại lại đó gây trở ngại cho công việc<br />=don''t interfere with me!+ đừng có quấy rầy tôi!<br />- can thiệp, xen vào, dính vào<br />=to interfere in somebody''s affairs+ can thiệp vào việc của ai<br />- (vật lý) giao thoa<br />- (raddiô) nhiễu<br />- đá chân nọ vào chân kia (ngựa)<br />- (thể dục,thể thao) chặn trái phép; cản đối phương cho đồng đội dắt bóng lên<br />- chạm vào nhau, đụng vào nhau; đối lập với nhau<br />- (từ Mỹ,nghĩa Mỹ) xin được quyền ưu tiên đăng ký một phát minh (khi có nhiều người cùng xin)<br /><br />@interfere<br />- (vật lí) giao thoa làm nhiễu loạn<br />- optical i. giao thoa ánh sáng <br />- wave i. giao thoa sóng</Q></N></I></F></C>'),
(65653, 'interfered', '<C><F><I><N><Q>@interfere /,intə''fiə/<br />*  nội động từ ((thường) + with)<br />- gây trở ngại, quấy rầy<br />=these goings and coming interfere with the work+ sự đi đi lại lại đó gây trở ngại cho công việc<br />=don''t interfere with me!+ đừng có quấy rầy tôi!<br />- can thiệp, xen vào, dính vào<br />=to interfere in somebody''s affairs+ can thiệp vào việc của ai<br />- (vật lý) giao thoa<br />- (raddiô) nhiễu<br />- đá chân nọ vào chân kia (ngựa)<br />- (thể dục,thể thao) chặn trái phép; cản đối phương cho đồng đội dắt bóng lên<br />- chạm vào nhau, đụng vào nhau; đối lập với nhau<br />- (từ Mỹ,nghĩa Mỹ) xin được quyền ưu tiên đăng ký một phát minh (khi có nhiều người cùng xin)<br /><br />@interfere<br />- (vật lí) giao thoa làm nhiễu loạn<br />- optical i. giao thoa ánh sáng <br />- wave i. giao thoa sóng</Q></N></I></F></C>'),
(65654, 'interference', '<C><F><I><N><Q>@interference /,intə''fiərəns/<br />*  danh từ<br />- sự gây trở ngại, sự quấy rầy; điều gây trở ngại<br />- sự can thiệp, sự xen vào, sự dính vào<br />- (vật lý) sự giao thoa<br />- (raddiô) sự nhiễu<br />- sự đá chân nọ vào chân kia (ngựa)<br />- (thể dục,thể thao) sự chặn trái phép; sự cản đối phương cho đồng đội dắt bóng lên; sự phạt việc chặn trái phép<br />- sự chạm vào nhau, sự đụng vào nhau; sự đối lập với nhau</Q></N></I></F></C>'),
(65655, 'interferences', '<C><F><I><N><Q>@interference /,intə''fiərəns/<br />*  danh từ<br />- sự gây trở ngại, sự quấy rầy; điều gây trở ngại<br />- sự can thiệp, sự xen vào, sự dính vào<br />- (vật lý) sự giao thoa<br />- (raddiô) sự nhiễu<br />- sự đá chân nọ vào chân kia (ngựa)<br />- (thể dục,thể thao) sự chặn trái phép; sự cản đối phương cho đồng đội dắt bóng lên; sự phạt việc chặn trái phép<br />- sự chạm vào nhau, sự đụng vào nhau; sự đối lập với nhau</Q></N></I></F></C>'),
