(65681, 'intergalactic', '<C><F><I><N><Q>@intergalactic<br />* tính từ<br />- ở giữa những thiên hà</Q></N></I></F></C>'),
(65682, 'intergenerational', '<C><F><I><N><Q>@intergenerational<br />* tính từ<br />- xảy ra hoặc tồn tại giữa hai hoặc nhiều thế hệ</Q></N></I></F></C>'),
(65683, 'Intergenerational equity', '<C><F><I><N><Q>@Intergenerational equity<br />- (Econ) Công bằng giữa các thế hệ.<br />+ Tính công bằng trong việc sử dụng các nguồn tài nguyên thiên nhiên giữa các thế hệ khác nhau.</Q></N></I></F></C>'),
