(65695, 'interim', '<C><F><I><N><Q>@interim /''intərim/<br />*  tính từ<br />- quá độ<br />- tạm quyền, lâm thời<br />=an interim government+ chính phủ tạm quyền<br />*  phó từ<br />- (từ cổ,nghĩa cổ) trong lúc đó<br />*  danh từ<br />- thời gian quá độ<br />- sự giàn xếp tạm thời</Q></N></I></F></C>'),
