(65697, 'interionic', '<C><F><I><N><Q>@interionic<br />* tính từ<br />- gian ion</Q></N></I></F></C>'),
(65698, 'interior', '<C><F><I><N><Q>@interior /in''tiəriə/<br />*  tính từ<br />- ở trong, ở phía trong<br />- nằm xa trong đất liền, ở nội địa<br />- nội, nội bộ, trong nước<br />- nội tâm, riêng tư<br />=the interior life+ cuộc sống nội tâm<br />*  danh từ<br />- phần trong, phía trong (phòng, nhà...)<br />- đất liền nằm sâu vào trong (một nước...), nội địa<br />- công việc trong nước, nội vụ<br />=Ministry of the Interior+ Bộ nội vụ<br />- tâm hồn, nội tâm<br /><br />@interior<br />- trong, phần trong, tính trong<br />- i. of set (tô pô) phần tổng của một tập hợp</Q></N></I></F></C>'),
