(65760, 'interlinking', '<C><F><I><N><Q>@interlink /''intəliɳk/<br />*  danh từ<br />- khâu nối, mấu nối, dây nối<br />*  ngoại động từ<br />- nối với nhau</Q></N></I></F></C>'),
(65761, 'interlinks', '<C><F><I><N><Q>@interlink /''intəliɳk/<br />*  danh từ<br />- khâu nối, mấu nối, dây nối<br />*  ngoại động từ<br />- nối với nhau</Q></N></I></F></C>'),
(65762, 'interlock', '<C><F><I><N><Q>@interlock /''intəlɔk/<br />*  danh từ<br />- sự cài vào nhau<br />- (kỹ thuật) khoa liên động (tránh cho hai bộ phận máy cùng chạy)<br />- (điện ảnh) khoá chuyển (phối hợp máy quay và máy thu tiếng)<br />*  động từ<br />- cài vào nhau<br />- khớp vào nhau (các bộ phận một cái máy)<br />- (ngành đường sắt) phối hợp chặt chẽ với nhau (ghi, hệ thống tín hiệu...)<br /><br />@interlock<br />- (máy tính) cấm // vùng cấm</Q></N></I></F></C>'),
(65763, 'interlocked', '<C><F><I><N><Q>@interlock /''intəlɔk/<br />*  danh từ<br />- sự cài vào nhau<br />- (kỹ thuật) khoa liên động (tránh cho hai bộ phận máy cùng chạy)<br />- (điện ảnh) khoá chuyển (phối hợp máy quay và máy thu tiếng)<br />*  động từ<br />- cài vào nhau<br />- khớp vào nhau (các bộ phận một cái máy)<br />- (ngành đường sắt) phối hợp chặt chẽ với nhau (ghi, hệ thống tín hiệu...)<br /><br />@interlock<br />- (máy tính) cấm // vùng cấm</Q></N></I></F></C>'),
(65764, 'interlocking', '<C><F><I><N><Q>@interlock /''intəlɔk/<br />*  danh từ<br />- sự cài vào nhau<br />- (kỹ thuật) khoa liên động (tránh cho hai bộ phận máy cùng chạy)<br />- (điện ảnh) khoá chuyển (phối hợp máy quay và máy thu tiếng)<br />*  động từ<br />- cài vào nhau<br />- khớp vào nhau (các bộ phận một cái máy)<br />- (ngành đường sắt) phối hợp chặt chẽ với nhau (ghi, hệ thống tín hiệu...)<br /><br />@interlock<br />- (máy tính) cấm // vùng cấm</Q></N></I></F></C>'),
(65765, 'interlocking directorate', '<C><F><I><N><Q>@interlocking directorate /,intə''lɔkiɳdi''rektərit/<br />*  danh từ<br />- ban quản trị phối hợp (có một hay nhiều thành viên cùng ở trong ban quản trị một công ty khác)</Q></N></I></F></C>'),
(65766, 'Interlocking directorates', '<C><F><I><N><Q>@Interlocking directorates<br />- (Econ) Các ban giám đốc chung, các ban giám đốc kết hợp.<br />+ Chỉ tình huống trong đó một hay nhiều người tham gia vào ban giám đốc của hai hay nhiều công ty.</Q></N></I></F></C>'),
(65767, 'interlocks', '<C><F><I><N><Q>@interlock /''intəlɔk/<br />*  danh từ<br />- sự cài vào nhau<br />- (kỹ thuật) khoa liên động (tránh cho hai bộ phận máy cùng chạy)<br />- (điện ảnh) khoá chuyển (phối hợp máy quay và máy thu tiếng)<br />*  động từ<br />- cài vào nhau<br />- khớp vào nhau (các bộ phận một cái máy)<br />- (ngành đường sắt) phối hợp chặt chẽ với nhau (ghi, hệ thống tín hiệu...)<br /><br />@interlock<br />- (máy tính) cấm // vùng cấm</Q></N></I></F></C>'),
(65768, 'interlocution', '<C><F><I><N><Q>@interlocution /''intəlou''kju:ʃn/<br />*  danh từ<br />- cuộc nói chuyện, cuộc đàm thoại</Q></N></I></F></C>'),
(65769, 'interlocutor', '<C><F><I><N><Q>@interlocutor /,intə''lɔkjutə/<br />*  danh từ<br />- người nói chuyện, người đàm thoại<br />- (từ Mỹ,nghĩa Mỹ) người hỏi (trong ban đồng ca da đen)<br />- người giới thiệu (giới thiệu chương trình và thuyết minh của một đội văn công,  (thường) da đen)</Q></N></I></F></C>'),
(65770, 'interlocutors', '<C><F><I><N><Q>@interlocutor /,intə''lɔkjutə/<br />*  danh từ<br />- người nói chuyện, người đàm thoại<br />- (từ Mỹ,nghĩa Mỹ) người hỏi (trong ban đồng ca da đen)<br />- người giới thiệu (giới thiệu chương trình và thuyết minh của một đội văn công,  (thường) da đen)</Q></N></I></F></C>'),
(65771, 'interlocutory', '<C><F><I><N><Q>@interlocutory /,intə''lɔkjutəri/<br />*  tính từ<br />- (thuộc) cuộc nói chuyện; xảy ra trong cuộc nói chuyện<br />- xen vào trong cuộc nói chuyện<br />- (pháp lý) tạm thời (quyết định)</Q></N></I></F></C>'),
(65772, 'interlocutress', '<C><F><I><N><Q>@interlocutress /,intə''lɔkjutris/ (interlocutrice) /,intə''lɔkjutris/ (interlocutrix) /,intə''lɔkjutriks/<br />*  danh từ<br />- người đàn bà nói chuyện, người đàn bà đàm thoại<br />- (từ Mỹ,nghĩa Mỹ) người hỏi (đàn bà)</Q></N></I></F></C>'),
(65773, 'interlocutrice', '<C><F><I><N><Q>@interlocutrice /,intə''lɔkjutris/ (interlocutrice) /,intə''lɔkjutris/ (interlocutrix) /,intə''lɔkjutriks/<br />*  danh từ<br />- người đàn bà nói chuyện, người đàn bà đàm thoại<br />- (từ Mỹ,nghĩa Mỹ) người hỏi (đàn bà)</Q></N></I></F></C>'),
(65774, 'interlocutrix', '<C><F><I><N><Q>@interlocutrix /,intə''lɔkjutris/ (interlocutrice) /,intə''lɔkjutris/ (interlocutrix) /,intə''lɔkjutriks/<br />*  danh từ<br />- người đàn bà nói chuyện, người đàn bà đàm thoại<br />- (từ Mỹ,nghĩa Mỹ) người hỏi (đàn bà)</Q></N></I></F></C>'),
(65775, 'interlope', '<C><F><I><N><Q>@interlope /,intə''loup/<br />*  nội động từ<br />- xâm phạm vào quyền lợi của người khác (để kiếm chác)<br />- dính mũi vào chuyện người khác<br />- (sử học) buôn không có môn bài</Q></N></I></F></C>'),
(65776, 'interloped', '<C><F><I><N><Q>@interlope /,intə''loup/<br />*  nội động từ<br />- xâm phạm vào quyền lợi của người khác (để kiếm chác)<br />- dính mũi vào chuyện người khác<br />- (sử học) buôn không có môn bài</Q></N></I></F></C>'),
(65777, 'interloper', '<C><F><I><N><Q>@interloper /,intə''loupə/<br />*  danh từ<br />- người xâm phạm quyền lợi người khác<br />- người dính mũi vào chuyện người khác<br />- (sử học) con buôn không có môn bài</Q></N></I></F></C>'),
(65778, 'interlopers', '<C><F><I><N><Q>@interloper /,intə''loupə/<br />*  danh từ<br />- người xâm phạm quyền lợi người khác<br />- người dính mũi vào chuyện người khác<br />- (sử học) con buôn không có môn bài</Q></N></I></F></C>'),
(65779, 'interlopes', '<C><F><I><N><Q>@interlope /,intə''loup/<br />*  nội động từ<br />- xâm phạm vào quyền lợi của người khác (để kiếm chác)<br />- dính mũi vào chuyện người khác<br />- (sử học) buôn không có môn bài</Q></N></I></F></C>'),
(65780, 'interloping', '<C><F><I><N><Q>@interlope /,intə''loup/<br />*  nội động từ<br />- xâm phạm vào quyền lợi của người khác (để kiếm chác)<br />- dính mũi vào chuyện người khác<br />- (sử học) buôn không có môn bài</Q></N></I></F></C>'),
(65781, 'interludal', '<C><F><I><N><Q>@interludal /''intətu:dəl/<br />*  tính từ<br />- (thuộc) lúc nghỉ biểu diễn, (thuộc) tiết mục nhẹ diễn trong lúc nghỉ<br />- (thuộc) thời gian ở giữa (hai sự việc khác nhau)<br />- (thuộc) dạo giữa<br />- (sử học) (thuộc) màn chen</Q></N></I></F></C>'),
(65782, 'interlude', '<C><F><I><N><Q>@interlude /''intətu:d/<br />*  danh từ<br />- (sân khấu) tiết mục chuyển tiếp<br />- thời gian ở giữa (hai sự việc khác nhau, quãng giữa; sự việc xảy ra trong thời gian ở giữa)<br />- (âm nhạc) dạo giữa<br />- (sử học) màn chen (màn kịch ngắn, xen vào giữa hai màn, trong vở kịch tôn giáo...)</Q></N></I></F></C>'),
(65783, 'interludes', '<C><F><I><N><Q>@interlude /''intətu:d/<br />*  danh từ<br />- (sân khấu) tiết mục chuyển tiếp<br />- thời gian ở giữa (hai sự việc khác nhau, quãng giữa; sự việc xảy ra trong thời gian ở giữa)<br />- (âm nhạc) dạo giữa<br />- (sử học) màn chen (màn kịch ngắn, xen vào giữa hai màn, trong vở kịch tôn giáo...)</Q></N></I></F></C>'),
(65784, 'interlunar', '<C><F><I><N><Q>@interlunar /,intə''lu:nə/<br />*  tính từ<br />- (thuộc) thời kỳ không có trăng (trong tháng)</Q></N></I></F></C>'),
(65785, 'interlunation', '<C><F><I><N><Q>@interlunation /,intəlu:''neiʃn/<br />*  danh từ<br />- thời kỳ không có trăng (trong tháng)</Q></N></I></F></C>'),
(65786, 'intermarriage', '<C><F><I><N><Q>@intermarriage /,intə''mæridʤ/<br />*  danh từ<br />- hôn nhân khác chủng tộc<br />- hôn nhân họ gần<br />- hôn nhân cùng nhóm</Q></N></I></F></C>'),
(65787, 'intermarriages', '<C><F><I><N><Q>@intermarriage /,intə''mæridʤ/<br />*  danh từ<br />- hôn nhân khác chủng tộc<br />- hôn nhân họ gần<br />- hôn nhân cùng nhóm</Q></N></I></F></C>'),
(65788, 'intermarried', '<C><F><I><N><Q>@intermarry /,intə''mæri/<br />*  nội động từ<br />- có người lấy nhau, thông gia với nhau (hai dân tộc, hai bộ lạc, hai gia đình...)<br />- lấy nhau trong họ gần<br />- lấy người cùng nhóm</Q></N></I></F></C>'),
(65789, 'intermarries', '<C><F><I><N><Q>@intermarry /,intə''mæri/<br />*  nội động từ<br />- có người lấy nhau, thông gia với nhau (hai dân tộc, hai bộ lạc, hai gia đình...)<br />- lấy nhau trong họ gần<br />- lấy người cùng nhóm</Q></N></I></F></C>'),
(65790, 'intermarry', '<C><F><I><N><Q>@intermarry /,intə''mæri/<br />*  nội động từ<br />- có người lấy nhau, thông gia với nhau (hai dân tộc, hai bộ lạc, hai gia đình...)<br />- lấy nhau trong họ gần<br />- lấy người cùng nhóm</Q></N></I></F></C>'),
(65791, 'intermarrying', '<C><F><I><N><Q>@intermarry /,intə''mæri/<br />*  nội động từ<br />- có người lấy nhau, thông gia với nhau (hai dân tộc, hai bộ lạc, hai gia đình...)<br />- lấy nhau trong họ gần<br />- lấy người cùng nhóm</Q></N></I></F></C>'),
(65792, 'intermaxillary', '<C><F><I><N><Q>@intermaxillary /,intəmæk''riləri/<br />*  tính từ<br />- (giải phẫu) giữa hai xương hàm, gian hàm</Q></N></I></F></C>'),
(65793, 'intermeddle', '<C><F><I><N><Q>@intermeddle /,intə''medl/<br />*  nội động từ<br />- (+ in,  with) can thiệp vào, dính vào (người khác)</Q></N></I></F></C>'),
(65794, 'intermeddler', '<C><F><I><N><Q>@intermeddler /,intə''medlə/<br />*  danh từ<br />- người can thiệp vào, người dính vào (chuyện người khác)</Q></N></I></F></C>'),
(65795, 'intermedia', '<C><F><I><N><Q>@intermedia /,intə''mi:djəm/<br />*  danh từ,  số nhiều intermedia,  intermediums<br />- vật ở giữa, vật trung gian<br />- phương tiện chuyển (năng lượng qua không gian)</Q></N></I></F></C>'),
(65796, 'intermediacy', '<C><F><I><N><Q>@intermediacy /,intə''mi:djəsi/<br />*  danh từ<br />- tình trạng ở giữa, tình trạng trung gian<br />- sự làm trung gian</Q></N></I></F></C>'),
(65797, 'intermediaries', '<C><F><I><N><Q>@intermediary /,intə''mi:djəri/<br />*  tính từ<br />- ở giữa<br />- trung gian, đóng vai trò hoà giải<br />*  danh từ<br />- người làm trung gian, người hoà giải<br />- vật ở giữa, vật trung gian<br />- hình thức trung gian, giai đoạn trung gian<br />- phương tiện</Q></N></I></F></C>'),
(65798, 'intermediary', '<C><F><I><N><Q>@intermediary /,intə''mi:djəri/<br />*  tính từ<br />- ở giữa<br />- trung gian, đóng vai trò hoà giải<br />*  danh từ<br />- người làm trung gian, người hoà giải<br />- vật ở giữa, vật trung gian<br />- hình thức trung gian, giai đoạn trung gian<br />- phương tiện</Q></N></I></F></C>'),
(65799, 'intermediate', '<C><F><I><N><Q>@intermediate /,intə''mi:djət/<br />*  tính từ<br />- ở giữa<br />*  danh từ ((cũng) intermediary)<br />- người làm trung gian, người hoà giải<br />- vật ở giữa, vật trung gian<br />*  danh từ<br />- (hoá học) sản phẩm trung gian[,intə''mi:dieit]<br />*  ngoại động từ<br />- làm môi giới, làm trung gian hoà giải<br /><br />@intermediate<br />- trung gian phụ '),
(65800, 'Intermediate areas', '<C><F><I><N><Q>@Intermediate areas<br />- (Econ) Các vùng trung gian.<br />+ Xem HUNT REPORT, ASSISTED AREAS.</Q></N></I></F></C>'),
(65801, 'Intermediate goods', '<C><F><I><N><Q>@Intermediate goods<br />- (Econ) Hàng hoá trung gian.<br />+ Hàng hoá được sử dụng vào một thời điểm nào đó trong quá trình sản xuất các hàng hoá khác chứ không phải để cho tiêu dùng cuối cùng.<br /><br />@Intermediate goods<br />- (Econ) Hàng hoá trung gian.</Q></N></I></F></C>'),
(65802, 'Intermediate lag', '<C><F><I><N><Q>@Intermediate lag<br />- (Econ) Độ trễ trung gian.<br />+ Đây là một phần trễ của độ trễ hoạt động có liên quan với CHÍNH SÁCH TIỀN TỆ.</Q></N></I></F></C>'),
(65803, 'intermediate-range', '<C><F><I><N><Q>@intermediate-range /intə''mi:djət''reindʤ/<br />*  tính từ<br />- intermediate-range ballistic ((viết tắt) I.R.B.M.) tên lửa tầm trong</Q></N></I></F></C>'),
(65804, 'Intermediate technology', '<C><F><I><N><Q>@Intermediate technology<br />- (Econ) Công nghệ trung gian.<br />+ Tập hợp các kỹ thuật và quá trình công nghệ nằm ở giữa công nghệ DÙNG NHIỀU VỐN của thế giới phương Tây và các kỹ thuật nội sinh, thô sơ của các nước đang phát triển.</Q></N></I></F></C>'),
(65805, 'Intermediate Technology Development Group', '<C><F><I><N><Q>@Intermediate Technology Development Group<br />- (Econ) Nhóm Phát triển Công nghệ trung gian.<br />+ Nhóm do E.F.Schumacher thành lập vào năm 1965 ở London. Có 3 hoạt động chính. 1)Kế hoạch thu thập và thư mục hoá số liệu về các kỹ thuật DÙNG NHIỀU LAO ĐỘNG có hiệu quả phù hợp với việc áp dụng quy mô nhỏ. 2)Xuất bản các ý tưởng về CÔNG NGHỆ TRUNG GIAN thông qua các bài báo, sách, bài giảng, tạp chí riêng và thông qua cả nỗ lực gây ảnh hưởng đối với chính sách viện trợ của các chính phủ và các tổ chức quốc tế. 3)Có một chương trình cung cấp viện trợ cho các dự án đặc biệt ở các nước chậm phát triển, các dự án này nhấn mạnh đến quá trình tự giúp đỡ thông qua việc sử dụng công nghệ thích hợp cho các cộng đông dân cư nhỏ.</Q></N></I></F></C>'),
(65806, 'Intermediate variables', '<C><F><I><N><Q>@Intermediate variables<br />- (Econ) Biến trung gian<br />+ Xem Intermediate lag.</Q></N></I></F></C>'),
(65807, 'intermediated', '<C><F><I><N><Q>@intermediate /,intə''mi:djət/<br />*  tính từ<br />- ở giữa<br />*  danh từ ((cũng) intermediary)<br />- người làm trung gian, người hoà giải<br />- vật ở giữa, vật trung gian<br />*  danh từ<br />- (hoá học) sản phẩm trung gian[,intə''mi:dieit]<br />*  ngoại động từ<br />- làm môi giới, làm trung gian hoà giải<br /><br />@intermediate<br />- trung gian phụ '),
(65808, 'intermediately', '<C><F><I><N><Q>@intermediately<br />* phó từ<br />- với tính cách trung gian</Q></N></I></F></C>'),
(65809, 'intermediateness', '<C><F><I><N><Q>@intermediateness /,intə''mi:djətnis/<br />*  danh từ<br />- tính chất ở giữa, tính chất trung gian</Q></N></I></F></C>');
