(65810, 'intermediates', '<C><F><I><N><Q>@intermediate /,intə''mi:djət/<br />*  tính từ<br />- ở giữa<br />*  danh từ ((cũng) intermediary)<br />- người làm trung gian, người hoà giải<br />- vật ở giữa, vật trung gian<br />*  danh từ<br />- (hoá học) sản phẩm trung gian[,intə''mi:dieit]<br />*  ngoại động từ<br />- làm môi giới, làm trung gian hoà giải<br /><br />@intermediate<br />- trung gian phụ '),
(65811, 'intermediating', '<C><F><I><N><Q>@intermediate /,intə''mi:djət/<br />*  tính từ<br />- ở giữa<br />*  danh từ ((cũng) intermediary)<br />- người làm trung gian, người hoà giải<br />- vật ở giữa, vật trung gian<br />*  danh từ<br />- (hoá học) sản phẩm trung gian[,intə''mi:dieit]<br />*  ngoại động từ<br />- làm môi giới, làm trung gian hoà giải<br /><br />@intermediate<br />- trung gian phụ '),
(65812, 'intermediation', '<C><F><I><N><Q>@intermediation /''intə,mi:di''eiʃn/<br />*  danh từ<br />- sự làm môi giới, sự làm trung gian, sự hoà giải</Q></N></I></F></C>'),
(65813, 'intermediations', '<C><F><I><N><Q>@intermediation /''intə,mi:di''eiʃn/<br />*  danh từ<br />- sự làm môi giới, sự làm trung gian, sự hoà giải</Q></N></I></F></C>'),
(65814, 'intermediator', '<C><F><I><N><Q>@intermediator /,intə''mi:dieitə/<br />*  danh từ<br />- người làm môi giới, người làm trung gian, người hoà giải</Q></N></I></F></C>'),
(65815, 'intermediators', '<C><F><I><N><Q>@intermediator /,intə''mi:dieitə/<br />*  danh từ<br />- người làm môi giới, người làm trung gian, người hoà giải</Q></N></I></F></C>'),
