(65817, 'intermedium', '<C><F><I><N><Q>@intermedium /,intə''mi:djəm/<br />*  danh từ,  số nhiều intermedia,  intermediums<br />- vật ở giữa, vật trung gian<br />- phương tiện chuyển (năng lượng qua không gian)</Q></N></I></F></C>'),
(65818, 'interment', '<C><F><I><N><Q>@interment /in''tə:mənt/<br />*  danh từ<br />- sự chôn, sự chôn cất, sự mai táng</Q></N></I></F></C>'),
(65819, 'interments', '<C><F><I><N><Q>@interment /in''tə:mənt/<br />*  danh từ<br />- sự chôn, sự chôn cất, sự mai táng</Q></N></I></F></C>'),
(65820, 'intermezzi', '<C><F><I><N><Q>@intermezzi /,intə''metsi/ (intermezzo) /,intə''metsou/ (intermezzos) /,intə''metsouz/<br />*  danh từ<br />- (âm nhạc) khúc trung gian<br />- màn chen (màn ngắn giữa hai màn kịch)</Q></N></I></F></C><C><F><I><N><Q>@intermezzo /,intə''metsi/ (intermezzo) /,intə''metsou/ (intermezzos) /,intə''metsouz/<br />*  danh từ<br />- (âm nhạc) khúc trung gian<br />- màn chen (màn ngắn giữa hai màn kịch)</Q></N></I></F></C>'),
(65821, 'intermezzo', '<C><F><I><N><Q>@intermezzo /,intə''metsi/ (intermezzo) /,intə''metsou/ (intermezzos) /,intə''metsouz/<br />*  danh từ<br />- (âm nhạc) khúc trung gian<br />- màn chen (màn ngắn giữa hai màn kịch)</Q></N></I></F></C>'),
(65822, 'intermezzos', '<C><F><I><N><Q>@intermezzo /,intə''metsi/ (intermezzo) /,intə''metsou/ (intermezzos) /,intə''metsouz/<br />*  danh từ<br />- (âm nhạc) khúc trung gian<br />- màn chen (màn ngắn giữa hai màn kịch)</Q></N></I></F></C>'),
(65823, 'intermigration', '<C><F><I><N><Q>@intermigration /,intəmai''greiʃn/<br />*  danh từ<br />- sự nhập cư trao đổi</Q></N></I></F></C>'),
(65824, 'intermigrations', '<C><F><I><N><Q>@intermigration /,intəmai''greiʃn/<br />*  danh từ<br />- sự nhập cư trao đổi</Q></N></I></F></C>'),
(65825, 'interminability', '<C><F><I><N><Q>@interminability /in,tə:minə''biliti/ (interminableness) /in''tə:minəblnis/<br />*  danh từ<br />- tính không cùng, tính vô tận, tính không bao giờ kết thúc<br />- tính dài dòng, tính tràng giang đại hải</Q></N></I></F></C>'),
(65826, 'interminable', '<C><F><I><N><Q>@interminable /,intə''miɳgl/<br />*  tính từ<br />- không cùng, vô tận, không bao giờ kết thúc<br />- dài dòng, tràng giang đại hải</Q></N></I></F></C>'),
(65827, 'interminableness', '<C><F><I><N><Q>@interminableness /in,tə:minə''biliti/ (interminableness) /in''tə:minəblnis/<br />*  danh từ<br />- tính không cùng, tính vô tận, tính không bao giờ kết thúc<br />- tính dài dòng, tính tràng giang đại hải</Q></N></I></F></C>'),
(65828, 'interminably', '<C><F><I><N><Q>@interminably<br />- xem interminable</Q></N></I></F></C>'),
(65829, 'intermingle', '<C><F><I><N><Q>@intermingle /,intə''miɳgl/<br />*  ngoại động từ<br />- trộn lẫn<br />*  nội động từ<br />- trà trộn</Q></N></I></F></C>'),
(65830, 'intermingled', '<C><F><I><N><Q>@intermingle /,intə''miɳgl/<br />*  ngoại động từ<br />- trộn lẫn<br />*  nội động từ<br />- trà trộn</Q></N></I></F></C>'),
(65831, 'interminglement', '<C><F><I><N><Q>@interminglement /,intə''miɳglmənt/<br />*  danh từ<br />- sự trộn lẫn, sự trà trộn</Q></N></I></F></C>'),
(65832, 'intermingles', '<C><F><I><N><Q>@intermingle /,intə''miɳgl/<br />*  ngoại động từ<br />- trộn lẫn<br />*  nội động từ<br />- trà trộn</Q></N></I></F></C>'),
(65833, 'intermingling', '<C><F><I><N><Q>@intermingle /,intə''miɳgl/<br />*  ngoại động từ<br />- trộn lẫn<br />*  nội động từ<br />- trà trộn</Q></N></I></F></C>'),
(65834, 'interministerial', '<C><F><I><N><Q>@interministerial<br />* tính từ<br />- liên bộ<br />* tính từ<br />- liên bộ</Q></N></I></F></C>'),
(65835, 'intermission', '<C><F><I><N><Q>@intermission /,intə''miʃn/<br />*  danh từ<br />- sự ngừng; thời gian ngừng<br />=without intermission+ không ngừng<br />- (từ Mỹ,nghĩa Mỹ) lúc tạm nghỉ (biểu diễn); bài nhạc chơi trong lúc tạm nghỉ biểu diễn</Q></N></I></F></C>'),
(65836, 'intermissions', '<C><F><I><N><Q>@intermission /,intə''miʃn/<br />*  danh từ<br />- sự ngừng; thời gian ngừng<br />=without intermission+ không ngừng<br />- (từ Mỹ,nghĩa Mỹ) lúc tạm nghỉ (biểu diễn); bài nhạc chơi trong lúc tạm nghỉ biểu diễn</Q></N></I></F></C>'),
(65837, 'intermissive', '<C><F><I><N><Q>@intermissive /,intə''misiv/<br />*  tính từ<br />- (thuộc) sự ngừng<br />- thỉnh thoảng lại ngừng</Q></N></I></F></C>'),
(65838, 'intermit', '<C><F><I><N><Q>@intermit /,intə''mit/<br />*  động từ<br />- thỉnh thoảng lại ngừng, lúc có lúc không, gián đoạn<br /><br />@intermit<br />- làm đứt đoạn làm gián đoạn '),
(65839, 'intermits', '<C><F><I><N><Q>@intermit /,intə''mit/<br />*  động từ<br />- thỉnh thoảng lại ngừng, lúc có lúc không, gián đoạn<br /><br />@intermit<br />- làm đứt đoạn làm gián đoạn '),
(65840, 'intermitted', '<C><F><I><N><Q>@intermit /,intə''mit/<br />*  động từ<br />- thỉnh thoảng lại ngừng, lúc có lúc không, gián đoạn<br /><br />@intermit<br />- làm đứt đoạn làm gián đoạn '),
(65841, 'intermittence', '<C><F><I><N><Q>@intermittence /,intə''mitəns/ (intermittency) /,intə''mitənsi/<br />*  danh từ<br />- tình trạng thỉnh thoảng lại ngừng, tình trạng lúc có lúc không, tình trạng gián đoạn<br />- (y học) tình trạng từng cơn, tình trạng từng hồi<br />- sự chạy trục trặc (máy)<br />- tình trạng lúc chảy, lúc không, tình trạng có nước theo vụ (suối, hồ...)</Q></N></I></F></C>'),
(65842, 'intermittent', '<C><F><I><N><Q>@intermittent /,intə''mitənt/<br />*  tính từ<br />- thỉnh thoảng lại ngừng, lúc có lúc không, gián đoạn<br />- (y học) từng cơn, từng hồi<br />- chạy trục trặc (máy)<br />- lúc chảy lúc không, có nước theo vụ<br /><br />@intermittent<br />- đứt đoạn, gián đoạn rời rạc</Q></N></I></F></C>'),
(65843, 'intermittent fever', '<C><F><I><N><Q>@intermittent fever /,intə''mitənt''fi:və/<br />*  danh từ<br />- (y học) sốt từng cơn</Q></N></I></F></C>'),
(65844, 'intermittently', '<C><F><I><N><Q>@intermittently<br />* phó từ<br />- từng cơn từng hồi, không liên tục</Q></N></I></F></C>'),
(65845, 'intermitter', '<C><F><I><N><Q>@intermitter<br />- xem intermit</Q></N></I></F></C>'),
(65846, 'intermitting', '<C><F><I><N><Q>@intermit /,intə''mit/<br />*  động từ<br />- thỉnh thoảng lại ngừng, lúc có lúc không, gián đoạn<br /><br />@intermit<br />- làm đứt đoạn làm gián đoạn '),
(65847, 'intermittingly', '<C><F><I><N><Q>@intermittingly /,intə''mitiɳli/<br />*  phó từ<br />- thỉnh thoảng lại ngừng, lúc có lúc không, gián đoạn, chập chờn</Q></N></I></F></C>'),
(65848, 'intermix', '<C><F><I><N><Q>@intermix /,intə''miks/<br />*  động từ<br />- trộn lẫn</Q></N></I></F></C>'),
(65849, 'intermixable', '<C><F><I><N><Q>@intermixable /,intə''miksəbl/<br />*  tính từ<br />- có thể trộn lẫn</Q></N></I></F></C>'),
(65850, 'intermixed', '<C><F><I><N><Q>@intermix /,intə''miks/<br />*  động từ<br />- trộn lẫn</Q></N></I></F></C>'),
(65851, 'intermixes', '<C><F><I><N><Q>@intermix /,intə''miks/<br />*  động từ<br />- trộn lẫn</Q></N></I></F></C>'),
(65852, 'intermixing', '<C><F><I><N><Q>@intermix /,intə''miks/<br />*  động từ<br />- trộn lẫn</Q></N></I></F></C>'),
(65853, 'intermixture', '<C><F><I><N><Q>@intermixture /,intə''mikstʃə/<br />*  danh từ<br />- sự trộn lẫn<br />- món trộn lẫn</Q></N></I></F></C>'),
(65854, 'intermixtures', '<C><F><I><N><Q>@intermixture /,intə''mikstʃə/<br />*  danh từ<br />- sự trộn lẫn<br />- món trộn lẫn</Q></N></I></F></C>'),
(65855, 'intermodulation', '<C><F><I><N><Q>@intermodulation /''intə,mɔdju''leiʃn/<br />*  danh từ<br />- (raddiô) sự điều biến qua lại<br /><br />@intermodulation<br />- (vật lí) biến điệu tương hỗ</Q></N></I></F></C>'),
(65856, 'intermolecular', '<C><F><I><N><Q>@intermolecular /,intəmou''lekjulə/<br />*  tính từ<br />- giữa các phân tử, gian phân tử</Q></N></I></F></C>'),
(65857, 'intermontane', '<C><F><I><N><Q>@intermontane /,intə''mɔntein / (intermountain) /,intə''mauntin/<br />*  tính từ<br />- giữa các núi, gian sơn</Q></N></I></F></C>'),
(65858, 'intermountain', '<C><F><I><N><Q>@intermountain<br />intermountain</Q></N></I></F></C>'),
(65859, 'intermundane', '<C><F><I><N><Q>@intermundane /,intə''mʌndein /<br />*  tính từ<br />- giữa các thiên thể</Q></N></I></F></C>'),
(65860, 'intermural', '<C><F><I><N><Q>@intermural /,intə''mjuərəl/<br />*  tính từ,  (từ Mỹ,nghĩa Mỹ)<br />- giữa những bức tường (của một ngôi nhà...)<br />- giữa hai tổ chức; giữa hai thành phố<br />=an intermural match+ cuộc đấu giữa hai hội thể thao</Q></N></I></F></C>'),
(65861, 'intern', '<C><F><I><N><Q>@intern /in''tə:n/<br />*  danh từ (từ Mỹ,nghĩa Mỹ)<br />- (như) interne<br />- người bị giam giữ (trong một khu vực nhất định...)<br />*  ngoại động từ<br />- giam giữ (trong một khu vực nhất định...)<br />*  nội động từ (từ Mỹ,nghĩa Mỹ)<br />- là học sinh y nội trú; là bác sĩ thực tập nội trú<br />- là giáo sinh</Q></N></I></F></C>'),
(65862, 'Interna Rate of return', '<C><F><I><N><Q>@Interna Rate of return<br />- (Econ) Nội suất thu hồi vốn/ tỷ lệ hoàn vốn nội bộ.</Q></N></I></F></C>'),
(65863, 'internal', '<C><F><I><N><Q>@internal /in''tə:nl/<br />*  tính từ<br />- ở trong, nội bộ<br />- trong nước<br />- (thuộc) nội tâm, (thuộc) tâm hồn, từ trong thâm tâm; chủ quan<br />- (thuộc) bản chất; nội tại<br />=internal evidence+ chứng cớ nội tại<br />- (y học) dùng trong (thuốc)<br /><br />@internal<br />- trong, nội bộ</Q></N></I></F></C>'),
(65864, 'Internal balance', '<C><F><I><N><Q>@Internal balance<br />- (Econ) Cân bằng bên trong</Q></N></I></F></C>'),
(65865, 'internal combustion', '<C><F><I><N><Q>@internal combustion<br />* danh từ<br />- &lt;kỹ&gt; sự đốt trong</Q></N></I></F></C>'),
(65866, 'internal-combustion', '<C><F><I><N><Q>@internal-combustion /in''tə:nlkəm''bʌstʃn/<br />*  tính từ<br />- (kỹ thuật) internal-combustion engine động cơ đốt trong, máy nổ</Q></N></I></F></C>'),
(65867, 'Internal convertibility of soft currencies', '<C><F><I><N><Q>@Internal convertibility of soft currencies<br />- (Econ) Khả năng chuyển đổi trong nước của tiền yếu.<br />+ Điều kiện dễ dàng cho công dân một nước muốn đổi nội tệ với khối lượng tiền không hạn chế lấy ngoại tệ theo một tỷ giá do ngân hàng trung ương quy định ở những nơi về việc sử dụng ngoại tệ được hạn chế trong các giao dịch thuộc TÀI KHOẢN VÃNG LAI.</Q></N></I></F></C>'),
(65868, 'Internal drain', '<C><F><I><N><Q>@Internal drain<br />- (Econ) Sự xả tiền trong nước.<br />+ Sự vận động của tiền mặt, tức là một phương tiện lưu thông, từ các ngân hàng vào lưu thông trong nước.</Q></N></I></F></C>'),
(65869, 'Internal finance', '<C><F><I><N><Q>@Internal finance<br />- (Econ) Tài chính bên trong.<br />+ Khoản tiền giữ lại từ LỢI NHUẬN RÒNG để sử dụng cho việc tài trợ các hoạt động của một doanh nghiệp. Xem External finance.</Q></N></I></F></C>'),
(65870, 'Internal growth', '<C><F><I><N><Q>@Internal growth<br />- (Econ) Tăng trưởng nhờ nội ứng.<br />+ Phần mở rộng của một doanh nghiệp được tạo ra bởi đầu tư trong nội bộ doanh nghiệp chứ không phải đầu tư có được thông qua thu mua của các doanh nghiệp khác và hoạt động hợp nhất, nghĩa là TĂNG TRƯỞNG TỪ BÊN NGOÀI.</Q></N></I></F></C>'),
(65871, 'internal labuor market', '<C><F><I><N><Q>@internal labuor market<br />- (Econ) Thị trường lao động nội vi.<br />+ Một dàn xếp qua đó lao động được cung và cầu trong phạm vi một doanh nghiệp mà không có sự tham gia trực tiếp vào THỊ TRƯỜNG LAO ĐỘNG BÊN NGOÀI.</Q></N></I></F></C>'),
(65872, 'internal medicine', '<C><F><I><N><Q>@internal medicine /in''tə:nl''medsin/<br />*  danh từ<br />- (y học) khoa nội</Q></N></I></F></C>'),
(65873, 'Internal rate of return', '<C><F><I><N><Q>@Internal rate of return<br />- (Econ) Nội suất sinh lợi<br />+ Xem RATE OF RETURN.</Q></N></I></F></C>'),
(65874, 'internal revenue', '<C><F><I><N><Q>@internal revenue /in''tə:nl''revinju:/<br />*  danh từ<br />- thu hoạch thuế trong nước (trừ thuế quan...)</Q></N></I></F></C>'),
(65875, 'Internal wage differentials', '<C><F><I><N><Q>@Internal wage differentials<br />- (Econ) Các mức chênh lệch tiền công nội tại.<br />+ Xem RELATIVITIES.</Q></N></I></F></C>'),
(65876, 'internality', '<C><F><I><N><Q>@internality /,intə:''næliti/ (internalness) /in''tə:nlnis/<br />*  danh từ<br />- tính chất ở trong, tính chất nội bộ<br />- tính chất trong nước<br />- tính chất nội tâm, tính chất từ thâm tâm; tính chất chủ quan</Q></N></I></F></C>'),
(65877, 'Internalization', '<C><F><I><N><Q>@Internalization<br />- (Econ) Nội hoá.<br />+ Một tình huống trong đó một ngoại ứng, thường là ngoại ứng phi kinh tế, được tính toán đến và SẢN LƯỢNG của hàng hoá gây ra tác động không tốt được giảm xuống mức tối ưu, đồng thời vẫn tồn tại một lượng ngoại ứng tối ưu, nghĩa là chi phí của việc giảm ngoại ứng đi thêm một đơn vị nữa lớn hơn lợi ích thu được từ việc làm như vậy.</Q></N></I></F></C>'),
(65878, 'internalization', '<C><F><I><N><Q>@internalization /in,tə:nəlai''zeiʃn/<br />*  danh từ<br />- sự tiếp thu (phong tục, văn hoá...)<br />- sự chủ quan hoá, sự làm cho có tính chất chủ quan</Q></N></I></F></C>'),
(65879, 'internalizations', '<C><F><I><N><Q>@Internalization<br />- (Econ) Nội hoá.<br />+ Một tình huống trong đó một ngoại ứng, thường là ngoại ứng phi kinh tế, được tính toán đến và SẢN LƯỢNG của hàng hoá gây ra tác động không tốt được giảm xuống mức tối ưu, đồng thời vẫn tồn tại một lượng ngoại ứng tối ưu, nghĩa là chi phí của việc giảm ngoại ứng đi thêm một đơn vị nữa lớn hơn lợi ích thu được từ việc làm như vậy.</Q></N></I></F></C><C><F><I><N><Q>@internalization /in,tə:nəlai''zeiʃn/<br />*  danh từ<br />- sự tiếp thu (phong tục, văn hoá...)<br />- sự chủ quan hoá, sự làm cho có tính chất chủ quan</Q></N></I></F></C>'),
(65880, 'internalize', '<C><F><I><N><Q>@internalize /in''tə:nəlaiz/<br />*  ngoại động từ<br />- tiếp thu (phong tục, văn hoá...)<br />- chủ quan hoá, làm cho có tính chất chủ quan</Q></N></I></F></C>'),
(65881, 'internalized', '<C><F><I><N><Q>@internalize /in''tə:nəlaiz/<br />*  ngoại động từ<br />- tiếp thu (phong tục, văn hoá...)<br />- chủ quan hoá, làm cho có tính chất chủ quan</Q></N></I></F></C>'),
(65882, 'internalizes', '<C><F><I><N><Q>@internalize /in''tə:nəlaiz/<br />*  ngoại động từ<br />- tiếp thu (phong tục, văn hoá...)<br />- chủ quan hoá, làm cho có tính chất chủ quan</Q></N></I></F></C>'),
(65883, 'internalizing', '<C><F><I><N><Q>@internalize /in''tə:nəlaiz/<br />*  ngoại động từ<br />- tiếp thu (phong tục, văn hoá...)<br />- chủ quan hoá, làm cho có tính chất chủ quan</Q></N></I></F></C>'),
(65884, 'internally', '<C><F><I><N><Q>@internally<br />* phó từ<br />- bên trong, nội tại</Q></N></I></F></C>'),
(65885, 'internalness', '<C><F><I><N><Q>@internalness /,intə:''næliti/ (internalness) /in''tə:nlnis/<br />*  danh từ<br />- tính chất ở trong, tính chất nội bộ<br />- tính chất trong nước<br />- tính chất nội tâm, tính chất từ thâm tâm; tính chất chủ quan</Q></N></I></F></C>'),
(65886, 'internals', '<C><F><I><N><Q>@internals /in''tə:nlz/<br />*  danh từ số nhiều<br />- (giải phẫu) cơ quan bên trong; ruột, lòng<br />- đặc tính, bản chất</Q></N></I></F></C><C><F><I><N><Q>@internal /in''tə:nl/<br />*  tính từ<br />- ở trong, nội bộ<br />- trong nước<br />- (thuộc) nội tâm, (thuộc) tâm hồn, từ trong thâm tâm; chủ quan<br />- (thuộc) bản chất; nội tại<br />=internal evidence+ chứng cớ nội tại<br />- (y học) dùng trong (thuốc)<br /><br />@internal<br />- trong, nội bộ</Q></N></I></F></C>'),
(65887, 'international', '<C><F><I><N><Q>@international /,intə''næʃənl/<br />*  tính từ<br />- quốc tế<br />- (thuộc) tổ chức quốc tế cộng sản<br />*  danh từ<br />- vận động viên trình độ quốc tế<br />- đại biểu quốc tế cộng sản<br />- cuộc thi đấu quốc tế<br />- (International) Quốc tế cộng sản<br />=the First International+ Quốc tế cộng sản I<br />=the Second International+ Quốc tế cộng sản II<br />=the Third International+ Quốc tế cộng sản III</Q></N></I></F></C>'),
(65888, 'International Bank for Reconstruction and Development', '<C><F><I><N><Q>@International Bank for Reconstruction and Development<br />- (Econ) Ngâb hàng Tái thiết và Phát triển Quốc tế.<br />+ Một ngân hàng phát triển quốc tế được thành lập vào năm 1945 cùng với Quỹ tiền tệ quốc tế IMF theo các điều khoản của hiệp định được ký trong Hội nghị về Tài chính và Tiền tệ của Liên hợp quốc tổ chức tại BRETTON WOODS, New Hampshire tháng 7 năm 1944.</Q></N></I></F></C>'),
(65889, 'International cartel', '<C><F><I><N><Q>@International cartel<br />- (Econ) Cartel quốc tế.<br />+ Một hiệp định giữa các nhà sản xuất, khi số lượng sản xuất của họ còn nhỏ, để phân chia với nhau thị trường thế giới về một loại hàng hoá nhằm thu được lợi nhuận trên mức cạnh tranh và khi suy thoái thì lại tránh được cạnh tranh khốc liệt.</Q></N></I></F></C>'),
(65890, 'International clearing unions', '<C><F><I><N><Q>@International clearing unions<br />- (Econ) Các liên minh thanh toán quốc tế.<br />+ Xem KEYNES PLAN</Q></N></I></F></C>'),
(65891, 'International commodity agreements', '<C><F><I><N><Q>@International commodity agreements<br />- (Econ) Các hiệp định hàng hoá quốc tế.<br />+ Các hiệp định giữa các nước sản xuất và tiêu dùng, nhưng đôi khi chỉ là hiệp định của các bên sản xuất, nhằm bảo đảm ổn định giá cả các hàng hóa sơ chế.</Q></N></I></F></C>'),
(65892, 'International debt crisis', '<C><F><I><N><Q>@International debt crisis<br />- (Econ) Khủng hoảng nợ quốc tế.</Q></N></I></F></C>'),
(65893, 'International Development Association', '<C><F><I><N><Q>@International Development Association<br />- (Econ) Hiệp hội phát triển quốc tế<br />+ Một cơ quan chuyên môn của Liên hợp quốc được thành lập vào năm 1960 với tư cách là một phân hiệu của NGÂN HÀNG TÁI THIẾT VÀ PHÁT TRIỂN QUỐC TẾ hay Ngân hàng thế giới.</Q></N></I></F></C>'),
(65894, 'International Development Co-operation Agency (ID)', '<C><F><I><N><Q>@International Development Co-operation Agency (ID)<br />- (Econ) Tổ chức hợp tác phát triển quốc tế.<br />+ Một tổ chức hành chính được thành lập năm 1970 nhằm giám sát tất cả các hình thức trợ giúp của Mỹ đối với các nước chậm phát triển, bao gồm tiền viện trợ nước ngoài, các khoản cho vay ưu đãi, viện trợ lương thực, thực phẩm theo Luật công chúng 480, trợ giúp kỹ thuật và chuyển giao nhân lực (ví dụ như các Đội quân gìn giữ hoà bình).</Q></N></I></F></C>'),
(65895, 'International division of labour', '<C><F><I><N><Q>@International division of labour<br />- (Econ) Sự phân chia lao động quốc tế.<br />+ Chuyên môn hoá trong sản xuất trên cơ sở quốc gia.</Q></N></I></F></C>'),
(65896, 'International economics', '<C><F><I><N><Q>@International economics<br />- (Econ) Kinh tế học quốc tế<br />+ Bộ phận của kinh tế học nghiên cứu các giao dịch giữa các nước trong lĩnh vực hàng hoá và dịch vụ, lưu thông tài chính và di chuyển các yếu tố sản xuất.</Q></N></I></F></C>'),
(65897, 'International Finance Corporation', '<C><F><I><N><Q>@International Finance Corporation<br />- (Econ) Công ty Tài chính Quốc tế.<br />+ Một tổ chức phát triển quốc tế được thành lập vào năm 1956 và sau đó trở thành một cơ quan chuyên môn của Liên hợp quốc vào năm 1957.</Q></N></I></F></C>'),
(65898, 'International Labuor Office', '<C><F><I><N><Q>@International Labuor Office<br />- (Econ) Văn phòng Lao động quốc tế.<br />+ Một tổ chức liên chính phủ được thành lập năm 1919 theo hiệp ước Versaille, sau đó trở thanh một cơ quan chuyên môn của Liên Hợp Quốcvào năm 1946. Tổ chức này mong muốn xúc tiến sự hợp tác quốc tế theo các chính sách được đề ra mhàm mục đích đạt được mục tiêu đủ việc làm, cải thiện điều kiện làm việc, mở rộng bảo hiểm xã hội và nâng cao mức sống nói chung.</Q></N></I></F></C>'),
(65899, 'International liquidity', '<C><F><I><N><Q>@International liquidity<br />- (Econ) Thanh khoản quốc tế.<br />+ Phân tích đến cùng, các khoản nợ giữa các nước khác nhau được giải quyết bằng cách chuyển giao các phương tiện thanh toán được quốc tế chấp nhận như: vàng, một hoặc nhiều ĐỒNG TIỀN DỰ TRỮ chủ yếu, hoặc trong phạm vi hẹp hơn là các QUYỀN RÚT TIỀN ĐẶC BIỆT (SDRs).</Q></N></I></F></C>'),
(65900, 'International monetarism', '<C><F><I><N><Q>@International monetarism<br />- (Econ) Chủ nghĩa trọng tiền quốc tế.<br />+ Một trường phái tư tưởng cho rằng những thay đổi của MỨC CUNG TIỀN thế giới là nguồn gốc cơ bản tạo ra sức ép lạm phát và giảm phát trong nền kinh tế thế giới.</Q></N></I></F></C>'),
(65901, 'International monetary Fund', '<C><F><I><N><Q>@International monetary Fund<br />- (Econ) (IMF) - Quỹ tiền tệ quốc tế.<br />+ (IMF) - Quỹ tiền tệ quốc tế được thành lập vào 12/1945 theo sự phê chuẩn các Điều khoản của Hiệp định về quỹ, được lập ra tại Hội nghị Tài chính và Tiền tệ của Liên hợp quốc tổ chưc tại BRETTON WOODS, New Hampshire, 1944. Mục đích của quỹ là khuyến khích sự hợp tác về tiền tệ quốc tế, tạo điều kiện cho việc mở rộng tăng trưởng cân đối trong THƯƠNG MẠI QUỐC TẾ, giúp đỡ các nước thành viên trong việc khắc phục CÁN CÂN THANH TOÁN và xúc tiến việc ổn định NGOẠI TỆ.</Q></N></I></F></C>'),
(65902, 'International payments system', '<C><F><I><N><Q>@International payments system<br />- (Econ) Hệ thống thanh toán quốc tế.<br />+ Một cụm thuật ngữ chung chỉ cách thức tiến hành các giao dịch tài chính quốc tế, nghĩa là các thanh toán giữa công dân của các nước đang giữ các đồng nội tệ khác nhau.</Q></N></I></F></C>'),
(65903, 'International Standard Industrial Classification', '<C><F><I><N><Q>@International Standard Industrial Classification<br />- (Econ) (ISIC)-Phân loại Ngành Công nghiệp theo C1683Tiêu chuẩn Quốc tế.<br />+ Sự phân loại công nghiệp về các hoạt động kinh tế được đề ra nhằm tăng cường khả năng so sánh quốc tế của các số liệu thống kê do Liên hợp quốc tập hợp và xuất bản.</Q></N></I></F></C>'),
(65904, 'International trade', '<C><F><I><N><Q>@International trade<br />- (Econ) Thương mại quốc tế.<br />+ Trao đổi buôn bán hàng hoá và dịch vụ giữa các quốc gia.</Q></N></I></F></C>'),
(65905, 'International Trade Organization', '<C><F><I><N><Q>@International Trade Organization<br />- (Econ) (ITO) - Tổ chức thương mại quốc tế.<br />+ Năm 1947, Hội đồng Kinh tế và Xã hội của Liên hợp quốc nhóm họp ở Havana, Cuba, một hội nghị quốc tế về Thương mại và Phát triển nhằm mục đích thúc đẩy sản xuất, trao đổi và tiêu dùng hàng hoá.</Q></N></I></F></C>'),
(65906, 'International Wheat Council', '<C><F><I><N><Q>@International Wheat Council<br />- (Econ) Hội đồng lúa mỳ Quốc tế.<br />+ Một tổ chức hành hoá quốc tế được thành lập năm 1979 theo Hiệp định về lúa mỳ Quốc tế lần thứ nhất nhằm điều hành Công ước Buôn bán lúa mỳ theo Hiệp định về lúa mì quốc tế năm 1971.</Q></N></I></F></C>'),
(65907, 'internationale', '<C><F><I><N><Q>@internationale /,intə''næʃə''nɑ:l/<br />*  danh từ<br />- bài ca quốc tế, quốc tế ca</Q></N></I></F></C>'),
(65908, 'internationalisation', '<C><F><I><N><Q>@internationalisation<br />* danh từ<br />- sự quốc tế hoá</Q></N></I></F></C>'),
(65909, 'internationalise', '<C><F><I><N><Q>@internationalise /,intə''næʃnəlaiz/ (internationalise) /,intə''næʃnəlaiz/<br />*  ngoại động từ<br />- quốc tế hoá</Q></N></I></F></C>'),
(65910, 'internationalism', '<C><F><I><N><Q>@internationalism /,intə''næʃnəlizm/<br />*  danh từ<br />- chủ nghĩa quốc tế<br />=proletarian internationalism+ chủ nghĩa quốc tế vô sản</Q></N></I></F></C>'),
(65911, 'internationalist', '<C><F><I><N><Q>@internationalist /,intə''næʃnəlist/<br />*  danh từ<br />- người theo chủ nghĩa quốc tế<br />- người giỏi luật quốc tế</Q></N></I></F></C>'),
(65912, 'internationalists', '<C><F><I><N><Q>@internationalist /,intə''næʃnəlist/<br />*  danh từ<br />- người theo chủ nghĩa quốc tế<br />- người giỏi luật quốc tế</Q></N></I></F></C>'),
(65913, 'internationality', '<C><F><I><N><Q>@internationality<br />- xem international</Q></N></I></F></C>'),
(65914, 'internationalization', '<C><F><I><N><Q>@internationalization /''intə,næʃnəlai''zeiʃn/<br />*  danh từ<br />- sự quốc tế hoá</Q></N></I></F></C>'),
(65915, 'internationalizations', '<C><F><I><N><Q>@internationalization /''intə,næʃnəlai''zeiʃn/<br />*  danh từ<br />- sự quốc tế hoá</Q></N></I></F></C>'),
(65916, 'internationalize', '<C><F><I><N><Q>@internationalize /,intə''næʃnəlaiz/ (internationalise) /,intə''næʃnəlaiz/<br />*  ngoại động từ<br />- quốc tế hoá</Q></N></I></F></C>'),
(65917, 'internationalized', '<C><F><I><N><Q>@internationalize /,intə''næʃnəlaiz/ (internationalise) /,intə''næʃnəlaiz/<br />*  ngoại động từ<br />- quốc tế hoá</Q></N></I></F></C>'),
(65918, 'internationalizes', '<C><F><I><N><Q>@internationalize /,intə''næʃnəlaiz/ (internationalise) /,intə''næʃnəlaiz/<br />*  ngoại động từ<br />- quốc tế hoá</Q></N></I></F></C>'),
(65919, 'internationalizing', '<C><F><I><N><Q>@internationalize /,intə''næʃnəlaiz/ (internationalise) /,intə''næʃnəlaiz/<br />*  ngoại động từ<br />- quốc tế hoá</Q></N></I></F></C>'),
(65920, 'internationally', '<C><F><I><N><Q>@internationally<br />* phó từ<br />- trên bình diện quốc tế</Q></N></I></F></C>'),
(65921, 'Internationals', '<C><F><I><N><Q>@international /,intə''næʃənl/<br />*  tính từ<br />- quốc tế<br />- (thuộc) tổ chức quốc tế cộng sản<br />*  danh từ<br />- vận động viên trình độ quốc tế<br />- đại biểu quốc tế cộng sản<br />- cuộc thi đấu quốc tế<br />- (International) Quốc tế cộng sản<br />=the First International+ Quốc tế cộng sản I<br />=the Second International+ Quốc tế cộng sản II<br />=the Third International+ Quốc tế cộng sản III</Q></N></I></F></C>'),
(65922, 'interne', '<C><F><I><N><Q>@interne /in''tə:n/<br />*  danh từ ((cũng) intern)<br />- học sinh y nội trú; bác sĩ thực tập nội trú<br />- giáo sinh</Q></N></I></F></C>'),
(65923, 'internecine', '<C><F><I><N><Q>@internecine /,intə''ni:sain/ (internecive) /,intə''ni:siv/<br />*  tính từ<br />- giết hại lẫn nhau; nồi da nấu thịt; cốt nhục tương tàn<br />- có tính chất tàn sát quy mô, có tính chất sát hại</Q></N></I></F></C>'),
(65924, 'internecive', '<C><F><I><N><Q>@internecive /,intə''ni:sain/ (internecive) /,intə''ni:siv/<br />*  tính từ<br />- giết hại lẫn nhau; nồi da nấu thịt; cốt nhục tương tàn<br />- có tính chất tàn sát quy mô, có tính chất sát hại</Q></N></I></F></C>'),
(65925, 'interned', '<C><F><I><N><Q>@intern /in''tə:n/<br />*  danh từ (từ Mỹ,nghĩa Mỹ)<br />- (như) interne<br />- người bị giam giữ (trong một khu vực nhất định...)<br />*  ngoại động từ<br />- giam giữ (trong một khu vực nhất định...)<br />*  nội động từ (từ Mỹ,nghĩa Mỹ)<br />- là học sinh y nội trú; là bác sĩ thực tập nội trú<br />- là giáo sinh</Q></N></I></F></C>'),
(65926, 'internee', '<C><F><I><N><Q>@internee /,intə:''ni:/<br />*  danh từ<br />- người bị giam giữ (trong một khu vực nhất định); tù binh</Q></N></I></F></C>'),
(65927, 'internees', '<C><F><I><N><Q>@internee /,intə:''ni:/<br />*  danh từ<br />- người bị giam giữ (trong một khu vực nhất định); tù binh</Q></N></I></F></C>'),
(65928, 'internes', '<C><F><I><N><Q>@interne /in''tə:n/<br />*  danh từ ((cũng) intern)<br />- học sinh y nội trú; bác sĩ thực tập nội trú<br />- giáo sinh</Q></N></I></F></C>'),
(65929, 'internet', '<C><F><I><N><Q>@internet<br />- Một hệ thống các mạng máy tính được liên kết với nhau trên phạm vi toàn thế giới</Q></N></I></F></C>'),
