(65997, 'interpolates', '<C><F><I><N><Q>@interpolate /in''tə:pouleit/<br />*  ngoại động từ<br />- tự ý thêm từ vào (một văn kiện...); tự ý thêm (từ) vào một văn kiện...<br />- (toán học) nội suy<br />*  nội động từ<br />- tự ý thêm từ vào một văn kiện<br /><br />@interpolate<br />- nội suy</Q></N></I></F></C>'),
(65998, 'interpolating', '<C><F><I><N><Q>@interpolate /in''tə:pouleit/<br />*  ngoại động từ<br />- tự ý thêm từ vào (một văn kiện...); tự ý thêm (từ) vào một văn kiện...<br />- (toán học) nội suy<br />*  nội động từ<br />- tự ý thêm từ vào một văn kiện<br /><br />@interpolate<br />- nội suy</Q></N></I></F></C>'),
(65999, 'interpolation', '<C><F><I><N><Q>@interpolation /in,tə:pou''leiʃn/<br />*  danh từ<br />- sự tự ý thêm từ (vào một văn kiện...); từ tự ý thêm từ (vào một văn kiện...); từ tự ý thêm từ (vào một văn kiện...); đoạn tự ý thêm từ (vào một văn kiện...)<br />- (toán học) phép nội suy<br /><br />@interpolation<br />- phép nội suy; quá trình nội suy i. by central difference<br />- phép nội suy bằng sai phân giữa; i. by prportional parts phép nội suy<br />- bằng phần tỷ lệ <br />- cubic i. gt phép nội suy bậc ba <br />- direct i. phép nội suy trực tiếp <br />- inverse i. phép nội suy ngược<br />- linear i. phép nội suy tuyến tính <br />- numerical i. phép nội suy bằng số <br />- osculatory i. phép nội suy mật tiếp <br />- polynomial i. phép nội suy bằng đa thức <br />- quadratic i. phép nội suy bậc hai<br />- regressive i. phép nội suy hồi quy<br />- trigonometric i. phép nội suy lượng giác</Q></N></I></F></C>'),
(66000, 'interpolations', '<C><F><I><N><Q>@interpolation /in,tə:pou''leiʃn/<br />*  danh từ<br />- sự tự ý thêm từ (vào một văn kiện...); từ tự ý thêm từ (vào một văn kiện...); từ tự ý thêm từ (vào một văn kiện...); đoạn tự ý thêm từ (vào một văn kiện...)<br />- (toán học) phép nội suy<br /><br />@interpolation<br />- phép nội suy; quá trình nội suy i. by central difference<br />- phép nội suy bằng sai phân giữa; i. by prportional parts phép nội suy<br />- bằng phần tỷ lệ <br />- cubic i. gt phép nội suy bậc ba <br />- direct i. phép nội suy trực tiếp <br />- inverse i. phép nội suy ngược<br />- linear i. phép nội suy tuyến tính <br />- numerical i. phép nội suy bằng số <br />- osculatory i. phép nội suy mật tiếp <br />- polynomial i. phép nội suy bằng đa thức <br />- quadratic i. phép nội suy bậc hai<br />- regressive i. phép nội suy hồi quy<br />- trigonometric i. phép nội suy lượng giác</Q></N></I></F></C>'),
(66001, 'interpolative', '<C><F><I><N><Q>@interpolative /in''tə:poulətiv/<br />*  tính từ<br />- để thêm vào một văn kiện</Q></N></I></F></C>');
INSERT INTO `tbl_edict` (`id`, `word`, `detail`) VALUES
(66002, 'interpolator', '<C><F><I><N><Q>@interpolator /in''tə:pouleitə/ (interpolator) /in''təpouleitə/<br />*  danh từ<br />- người tự ý thêm từ (vào một văn kiện...)<br /><br />@interpolator<br />- (máy tính) máy nội suy</Q></N></I></F></C>'),
(66003, 'interpolators', '<C><F><I><N><Q>@interpolator /in''tə:pouleitə/ (interpolator) /in''təpouleitə/<br />*  danh từ<br />- người tự ý thêm từ (vào một văn kiện...)<br /><br />@interpolator<br />- (máy tính) máy nội suy</Q></N></I></F></C>'),
(66004, 'interposable', '<C><F><I><N><Q>@interposable /,intə''pouzəbl/<br />*  tính từ<br />- có thể đặt vào giữa<br />- có thể can thiệp vào<br />- có thể ngắt; có thể xen vào một lời nhận xét</Q></N></I></F></C>'),
(66005, 'interposal', '<C><F><I><N><Q>@interposal /,intə''pouzl/<br />*  danh từ<br />- sự đặt (cái gì) vào giữa (hai cái gì); sự đặt (vật chướng ngại...)<br />- sự can thiệp (bằng quyền lực..., hoặc để can hai người cãi nhau...)<br />- sự ngắt lời; sự xen (một lời nhận xét...) vào câu chuyện</Q></N></I></F></C>'),
(66006, 'interpose', '<C><F><I><N><Q>@interpose /,intə''pouz/<br />*  ngoại động từ<br />- đặt (cái gì) vào giữa (những cái khác); đặt (vật chướng ngại...)<br />- can thiệp (bằng quyền lực...)<br />=to interpose a veto+ can thiệp (bằng quyền phủ quyết<br />- xen (một nhận xét vào câu chuyện người khác)<br />*  nội động từ<br />- xen vào giữa những vật khác<br />- can thiệp vào giữa hai phía tranh chấp, làm trung gian hoà giải<br />- ngắt lời, xen vào một câu chuyện<br /><br />@interpose<br />- đưa vào, đặt, để</Q></N></I></F></C>'),
(66007, 'interposed', '<C><F><I><N><Q>@interpose /,intə''pouz/<br />*  ngoại động từ<br />- đặt (cái gì) vào giữa (những cái khác); đặt (vật chướng ngại...)<br />- can thiệp (bằng quyền lực...)<br />=to interpose a veto+ can thiệp (bằng quyền phủ quyết<br />- xen (một nhận xét vào câu chuyện người khác)<br />*  nội động từ<br />- xen vào giữa những vật khác<br />- can thiệp vào giữa hai phía tranh chấp, làm trung gian hoà giải<br />- ngắt lời, xen vào một câu chuyện<br /><br />@interpose<br />- đưa vào, đặt, để</Q></N></I></F></C>'),
(66008, 'interposer', '<C><F><I><N><Q>@interposer /,intə''pouzə/<br />*  danh từ<br />- người đặt vào giữa<br />- người can, người can thiệp<br />- người ngắt lời; người xen vào một câu chuyện</Q></N></I></F></C>'),
(66009, 'interposes', '<C><F><I><N><Q>@interpose /,intə''pouz/<br />*  ngoại động từ<br />- đặt (cái gì) vào giữa (những cái khác); đặt (vật chướng ngại...)<br />- can thiệp (bằng quyền lực...)<br />=to interpose a veto+ can thiệp (bằng quyền phủ quyết<br />- xen (một nhận xét vào câu chuyện người khác)<br />*  nội động từ<br />- xen vào giữa những vật khác<br />- can thiệp vào giữa hai phía tranh chấp, làm trung gian hoà giải<br />- ngắt lời, xen vào một câu chuyện<br /><br />@interpose<br />- đưa vào, đặt, để</Q></N></I></F></C>'),
(66010, 'interposing', '<C><F><I><N><Q>@interpose /,intə''pouz/<br />*  ngoại động từ<br />- đặt (cái gì) vào giữa (những cái khác); đặt (vật chướng ngại...)<br />- can thiệp (bằng quyền lực...)<br />=to interpose a veto+ can thiệp (bằng quyền phủ quyết<br />- xen (một nhận xét vào câu chuyện người khác)<br />*  nội động từ<br />- xen vào giữa những vật khác<br />- can thiệp vào giữa hai phía tranh chấp, làm trung gian hoà giải<br />- ngắt lời, xen vào một câu chuyện<br /><br />@interpose<br />- đưa vào, đặt, để</Q></N></I></F></C>'),
(66011, 'interposingly', '<C><F><I><N><Q>@interposingly /,intə''pouziɳli/<br />*  phó từ<br />- đặt vào giữa<br />- can, can thiệp vào<br />- ngắt lời, xen vào</Q></N></I></F></C>'),
(66012, 'interposition', '<C><F><I><N><Q>@interposition /in,tə:pə''ziʃn/<br />*  danh từ<br />- sự đặt vào giữa, sự đặt (vật chướng ngại...); vật đặt vào, vật chướng ngại...); vật đặt vào, vật chướng ngại<br />- sự can, sự can thiệp, sự làm trung gian hoà giải<br />- sự ngắt lời, sự xen lời; lời xen vào<br />- (từ Mỹ,nghĩa Mỹ) thuyết phản đối (cho rằng mỗi bang có quyền chống lại hành động của liên bang có hại đến chủ quyền của mình)</Q></N></I></F></C>'),
(66013, 'interpositions', '<C><F><I><N><Q>@interposition /in,tə:pə''ziʃn/<br />*  danh từ<br />- sự đặt vào giữa, sự đặt (vật chướng ngại...); vật đặt vào, vật chướng ngại...); vật đặt vào, vật chướng ngại<br />- sự can, sự can thiệp, sự làm trung gian hoà giải<br />- sự ngắt lời, sự xen lời; lời xen vào<br />- (từ Mỹ,nghĩa Mỹ) thuyết phản đối (cho rằng mỗi bang có quyền chống lại hành động của liên bang có hại đến chủ quyền của mình)</Q></N></I></F></C>'),
(66014, 'interpret', '<C><F><I><N><Q>@interpret /in''tə:prit/<br />*  ngoại động từ<br />- giải thích, làm sáng tỏ<br />=to interpret the hidden meaning of a prophecy+ giải thích nghĩa bí ẩn của một lời tiên tri<br />- hiểu (theo một cách nào đó)<br />=to interpret an answer as an agreement+ hiểu một câu trả lời là đồng ý<br />- trình diễn ra được, diễn xuất ra được; thể hiện<br />- dịch<br />*  nội động từ<br />- làm phiên dịch<br />- giải thích, đưa ra lời giải thích<br /><br />@interpret<br />- (logic học) giải thích, thể hiện</Q></N></I></F></C>'),
(66015, 'interpretability', '<C><F><I><N><Q>@interpretability /in,tə:pritə''biliti/ (interpretableness) /in''tə:pritəblnis/<br />*  danh từ<br />- tính có thể giải thích được, tính có thể làm sáng tỏ được<br />- tính có thể hiểu được (một cách nào đó)<br />- tính có thể trình diện, tính có thể diễn xuất được; tính thể hiện<br />- tính có thể dịch được</Q></N></I></F></C>'),
(66016, 'interpretable', '<C><F><I><N><Q>@interpretable /in''tə:pritəbl/<br />*  tính từ<br />- có thể giải thích được, có thể làm sáng tỏ được<br />- có thể hiểu được (một cách nào đó)<br />- có thể trình diện, có thể diễn xuất được; thể hiện<br />- có thể dịch được</Q></N></I></F></C>'),
(66017, 'interpretableness', '<C><F><I><N><Q>@interpretableness /in,tə:pritə''biliti/ (interpretableness) /in''tə:pritəblnis/<br />*  danh từ<br />- tính có thể giải thích được, tính có thể làm sáng tỏ được<br />- tính có thể hiểu được (một cách nào đó)<br />- tính có thể trình diện, tính có thể diễn xuất được; tính thể hiện<br />- tính có thể dịch được</Q></N></I></F></C>'),
(66018, 'interpretation', '<C><F><I><N><Q>@interpretation /in,tə:pri''teiʃn/<br />*  danh từ<br />- sự giải thích, sự làm sáng tỏ<br />- sự hiểu (theo một cách nào đó); cách hiểu<br />- sự trình diễn ra được, sự diễn xuất ra được; sự thể hiện<br />- sự phiên dịch<br /><br />@interpretation<br />- [cái, sự] giải thích, sự thể hiện</Q></N></I></F></C>'),
(66019, 'interpretational', '<C><F><I><N><Q>@interpretational<br />- xem interpretation</Q></N></I></F></C>'),
(66020, 'interpretations', '<C><F><I><N><Q>@interpretation /in,tə:pri''teiʃn/<br />*  danh từ<br />- sự giải thích, sự làm sáng tỏ<br />- sự hiểu (theo một cách nào đó); cách hiểu<br />- sự trình diễn ra được, sự diễn xuất ra được; sự thể hiện<br />- sự phiên dịch<br /><br />@interpretation<br />- [cái, sự] giải thích, sự thể hiện</Q></N></I></F></C>'),
(66021, 'interpretative', '<C><F><I><N><Q>@interpretative /in''tə:pritətiv/ (interpretive) /in''tə:pritiv/<br />*  tính từ<br />- để giải thích<br />- được dẫn giải ra<br />- (thuộc) nghệ thuật trình diễn, (thuộc) nghệ thuật đóng kịch<br /><br />@interpretative<br />- giải thích</Q></N></I></F></C>'),
(66022, 'interpretative dance', '<C><F><I><N><Q>@interpretative dance /in''tə:pritətiv''dɑ:ns/<br />*  danh từ<br />- (nghệ thuật) điệu múa diễn xuất</Q></N></I></F></C>'),
(66023, 'interpretatively', '<C><F><I><N><Q>@interpretatively<br />- xem interpretative</Q></N></I></F></C>'),
(66024, 'interpreted', '<C><F><I><N><Q>@interpret /in''tə:prit/<br />*  ngoại động từ<br />- giải thích, làm sáng tỏ<br />=to interpret the hidden meaning of a prophecy+ giải thích nghĩa bí ẩn của một lời tiên tri<br />- hiểu (theo một cách nào đó)<br />=to interpret an answer as an agreement+ hiểu một câu trả lời là đồng ý<br />- trình diễn ra được, diễn xuất ra được; thể hiện<br />- dịch<br />*  nội động từ<br />- làm phiên dịch<br />- giải thích, đưa ra lời giải thích<br /><br />@interpret<br />- (logic học) giải thích, thể hiện</Q></N></I></F></C>'),
(66025, 'interpreter', '<C><F><I><N><Q>@interpreter /in''tə:pritə/<br />*  danh từ<br />- người giải thích, người làm sáng tỏ<br />- người hiểu (theo một cách nhất định)<br />- người trình diễn, người diễn xuất; người thể hiện<br />- người phiên dịch<br /><br />@interpreter<br />- người phiên dịch, bộ dịch<br />- card i. (máy tính) máy ghi lên bìa<br />- electronic i. (máy tính) bộ dịch điện tử</Q></N></I></F></C>'),
(66026, 'interpreters', '<C><F><I><N><Q>@interpreter /in''tə:pritə/<br />*  danh từ<br />- người giải thích, người làm sáng tỏ<br />- người hiểu (theo một cách nhất định)<br />- người trình diễn, người diễn xuất; người thể hiện<br />- người phiên dịch<br /><br />@interpreter<br />- người phiên dịch, bộ dịch<br />- card i. (máy tính) máy ghi lên bìa<br />- electronic i. (máy tính) bộ dịch điện tử</Q></N></I></F></C>'),
(66027, 'interpretership', '<C><F><I><N><Q>@interpretership /in''tə:pritəʃip/<br />*  danh từ<br />- chức vị người phiên dịch</Q></N></I></F></C>'),
(66028, 'interpreting', '<C><F><I><N><Q>@interpreting<br />* danh từ<br />- công việc phiên dịch</Q></N></I></F></C><C><F><I><N><Q>@interpret /in''tə:prit/<br />*  ngoại động từ<br />- giải thích, làm sáng tỏ<br />=to interpret the hidden meaning of a prophecy+ giải thích nghĩa bí ẩn của một lời tiên tri<br />- hiểu (theo một cách nào đó)<br />=to interpret an answer as an agreement+ hiểu một câu trả lời là đồng ý<br />- trình diễn ra được, diễn xuất ra được; thể hiện<br />- dịch<br />*  nội động từ<br />- làm phiên dịch<br />- giải thích, đưa ra lời giải thích<br /><br />@interpret<br />- (logic học) giải thích, thể hiện</Q></N></I></F></C>'),
(66029, 'interpretive', '<C><F><I><N><Q>@interpretive /in''tə:pritətiv/ (interpretive) /in''tə:pritiv/<br />*  tính từ<br />- để giải thích<br />- được dẫn giải ra<br />- (thuộc) nghệ thuật trình diễn, (thuộc) nghệ thuật đóng kịch</Q></N></I></F></C>'),
(66030, 'interpretively', '<C><F><I><N><Q>@interpretively<br />- xem interpretive</Q></N></I></F></C>'),
(66031, 'interpretress', '<C><F><I><N><Q>@interpretress /in''tə:pritris/<br />*  danh từ<br />- cô phiên dịch; bà phiên dịch</Q></N></I></F></C>'),
(66032, 'interprets', '<C><F><I><N><Q>@interpret /in''tə:prit/<br />*  ngoại động từ<br />- giải thích, làm sáng tỏ<br />=to interpret the hidden meaning of a prophecy+ giải thích nghĩa bí ẩn của một lời tiên tri<br />- hiểu (theo một cách nào đó)<br />=to interpret an answer as an agreement+ hiểu một câu trả lời là đồng ý<br />- trình diễn ra được, diễn xuất ra được; thể hiện<br />- dịch<br />*  nội động từ<br />- làm phiên dịch<br />- giải thích, đưa ra lời giải thích<br /><br />@interpret<br />- (logic học) giải thích, thể hiện</Q></N></I></F></C>'),
(66033, 'interprocess', '<C><F><I><N><Q>@interprocess<br />- liên quá trình, liên tiến trình</Q></N></I></F></C>'),
(66034, 'interprovincial', '<C><F><I><N><Q>@interprovincial /,intəprə''vinʃəl/<br />*  tính từ<br />- giữa các tỉnh, liên tỉnh</Q></N></I></F></C>'),
(66035, 'interpunctuate', '<C><F><I><N><Q>@interpunctuate /,intə''pʌɳktjueit/<br />*  ngoại động từ<br />- chấm câu</Q></N></I></F></C>'),
(66036, 'Interquartile range', '<C><F><I><N><Q>@Interquartile range<br />- (Econ) Khoảng cách giữa các tứ vị phân vị.<br />+ Một thước đo sự phân tán của số liệu mẫu hoặc phân phối, thuật ngữ này được định nghĩa như sự chênh lệch giữa giá trị cao nhất và thấp nhất của các tứ phân vị, và vì vậy nó chứa 50% giá trị trung tâm các quan sát của các biến số liên quan.</Q></N></I></F></C>'),
(66037, 'interracial', '<C><F><I><N><Q>@interracial /,intə''reiʃəl/<br />*  tính từ<br />- giữa các chủng tộc</Q></N></I></F></C>'),
