(66427, 'introverting', '<C><F><I><N><Q>@introvert /,introu''və:t/<br />*  danh từ<br />- cái lồng tụt vào trong (như ruột)<br />- (tâm lý học) người hay thu mình vào trong, người hay hướng vào nội tâm<br />- (thông tục) người nhút nhát<br />*  động từ<br />- lồng tụt vào trong<br />- (tâm lý học) thu mình vào trong, hướng vào nội tâm</Q></N></I></F></C>'),
(66428, 'introvertive', '<C><F><I><N><Q>@introvertive /,introu''və:siv/ (introvertive) /,introu''və:tiv/<br />*  tính từ<br />- (thuộc) sự lồng tụt vào trong; (thuộc) sự bị lồng tụt vào trong<br />- (tâm lý học) (thuộc) sự thu mình vào trong, (thuộc) sự hướng vào nội tâm</Q></N></I></F></C>'),
(66429, 'introverts', '<C><F><I><N><Q>@introvert /,introu''və:t/<br />*  danh từ<br />- cái lồng tụt vào trong (như ruột)<br />- (tâm lý học) người hay thu mình vào trong, người hay hướng vào nội tâm<br />- (thông tục) người nhút nhát<br />*  động từ<br />- lồng tụt vào trong<br />- (tâm lý học) thu mình vào trong, hướng vào nội tâm</Q></N></I></F></C>'),
(66430, 'intrude', '<C><F><I><N><Q>@intrude /in''tru:d/<br />*  ngoại động từ<br />- ấn bừa, tống ấn, đưa bừa<br />- bắt phải chịu<br />=to intrude one''s opinion on somebody+ bắt ai phải theo ý kiến của mình<br />=to intrude oneself upon someone''s company+ bắt ai phải chịu đựng mình<br />- (địa lý,ddịa chất) làm xâm nhập<br />*  nội động từ (+ into)<br />- vào bừa; không mời mà đến<br />=to intrude into a place+ đi bừa vào một nơi<br />- xâm phạm, xâm nhập<br />=to intrude upon someone''s privacy+ xâm phạm đến đời sống riêng tư của ai<br />- (địa lý,ddịa chất) xâm nhập</Q></N></I></F></C>'),
(66431, 'intruded', '<C><F><I><N><Q>@intrude /in''tru:d/<br />*  ngoại động từ<br />- ấn bừa, tống ấn, đưa bừa<br />- bắt phải chịu<br />=to intrude one''s opinion on somebody+ bắt ai phải theo ý kiến của mình<br />=to intrude oneself upon someone''s company+ bắt ai phải chịu đựng mình<br />- (địa lý,ddịa chất) làm xâm nhập<br />*  nội động từ (+ into)<br />- vào bừa; không mời mà đến<br />=to intrude into a place+ đi bừa vào một nơi<br />- xâm phạm, xâm nhập<br />=to intrude upon someone''s privacy+ xâm phạm đến đời sống riêng tư của ai<br />- (địa lý,ddịa chất) xâm nhập</Q></N></I></F></C>'),
(66432, 'intruder', '<C><F><I><N><Q>@intruder /in''tru:də/<br />*  danh từ<br />- người vào bừa; người không mời mà đến (một nơi nào)<br />- người xâm phạm, người xâm nhập (đời sống riêng tư của ai...)<br />- (quân sự) máy bay xâm phạm (vùng trời, đối phương)<br />- người bắt người khác phải chịu đựng mình</Q></N></I></F></C>'),
(66433, 'intruders', '<C><F><I><N><Q>@intruder /in''tru:də/<br />*  danh từ<br />- người vào bừa; người không mời mà đến (một nơi nào)<br />- người xâm phạm, người xâm nhập (đời sống riêng tư của ai...)<br />- (quân sự) máy bay xâm phạm (vùng trời, đối phương)<br />- người bắt người khác phải chịu đựng mình</Q></N></I></F></C>'),
(66434, 'intrudes', '<C><F><I><N><Q>@intrude /in''tru:d/<br />*  ngoại động từ<br />- ấn bừa, tống ấn, đưa bừa<br />- bắt phải chịu<br />=to intrude one''s opinion on somebody+ bắt ai phải theo ý kiến của mình<br />=to intrude oneself upon someone''s company+ bắt ai phải chịu đựng mình<br />- (địa lý,ddịa chất) làm xâm nhập<br />*  nội động từ (+ into)<br />- vào bừa; không mời mà đến<br />=to intrude into a place+ đi bừa vào một nơi<br />- xâm phạm, xâm nhập<br />=to intrude upon someone''s privacy+ xâm phạm đến đời sống riêng tư của ai<br />- (địa lý,ddịa chất) xâm nhập</Q></N></I></F></C>'),
(66435, 'intruding', '<C><F><I><N><Q>@intrude /in''tru:d/<br />*  ngoại động từ<br />- ấn bừa, tống ấn, đưa bừa<br />- bắt phải chịu<br />=to intrude one''s opinion on somebody+ bắt ai phải theo ý kiến của mình<br />=to intrude oneself upon someone''s company+ bắt ai phải chịu đựng mình<br />- (địa lý,ddịa chất) làm xâm nhập<br />*  nội động từ (+ into)<br />- vào bừa; không mời mà đến<br />=to intrude into a place+ đi bừa vào một nơi<br />- xâm phạm, xâm nhập<br />=to intrude upon someone''s privacy+ xâm phạm đến đời sống riêng tư của ai<br />- (địa lý,ddịa chất) xâm nhập</Q></N></I></F></C>'),
