(66539, 'invariance', '<C><F><I><N><Q>@invariance<br />- xem invariant<br /><br />@invariance<br />- tính bất biến<br />- binary i. bất biến nhị nguyên<br />- orientational i. tính bất biến định hướng</Q></N></I></F></C>'),
(66540, 'invariant', '<C><F><I><N><Q>@invariant /in''veəriənt/<br />*  tính từ<br />- không thay đổi, bất biến<br />*  danh từ<br />- (toán học) lượng không đổi, lượng bất biến<br /><br />@invariant<br />- bất biến<br />- adiabatic i. bất biến đoạn nhiệt <br />- algebraic i. bất biến đại số<br />- analytic i. (giải tích) bất biến giải tích <br />- arithmetical i. bất biến số học <br />- bending i. bất biến khi uốn <br />- conformal i. (giải tích) bất biến bảo giác <br />- differential i. bất biến vi phân<br />- geometric i. bất biến hình học<br />- homogeneous i. bất biến thuần nhất <br />- integral i. bất biến tích phân<br />- irrational i bất biến vô tỷ <br />- isotopy i bất biến hợp luân<br />- iterative i. (giải tích) bất biến lặp<br />- left i (hình học) bất biến trái<br />- modular i. bất biến môđula<br />- numerical i. bất biến bằng số<br />- primary i.s các bất biến nguyên sơ<br />- projective i. bất biến xạ ảnh<br />- rational i. bất biến hữu tỷ<br />- relative i. bất biến tương đối<br />- right i. bất biến phải<br />- typical basic i. bất biến cơ bản điển hình<br />- unrestricted i bất biến không bị ràng buộc</Q></N></I></F></C>'),
(66541, 'invariants', '<C><F><I><N><Q>@invariant /in''veəriənt/<br />*  tính từ<br />- không thay đổi, bất biến<br />*  danh từ<br />- (toán học) lượng không đổi, lượng bất biến<br /><br />@invariant<br />- bất biến<br />- adiabatic i. bất biến đoạn nhiệt <br />- algebraic i. bất biến đại số<br />- analytic i. (giải tích) bất biến giải tích <br />- arithmetical i. bất biến số học <br />- bending i. bất biến khi uốn <br />- conformal i. (giải tích) bất biến bảo giác <br />- differential i. bất biến vi phân<br />- geometric i. bất biến hình học<br />- homogeneous i. bất biến thuần nhất <br />- integral i. bất biến tích phân<br />- irrational i bất biến vô tỷ <br />- isotopy i bất biến hợp luân<br />- iterative i. (giải tích) bất biến lặp<br />- left i (hình học) bất biến trái<br />- modular i. bất biến môđula<br />- numerical i. bất biến bằng số<br />- primary i.s các bất biến nguyên sơ<br />- projective i. bất biến xạ ảnh<br />- rational i. bất biến hữu tỷ<br />- relative i. bất biến tương đối<br />- right i. bất biến phải<br />- typical basic i. bất biến cơ bản điển hình<br />- unrestricted i bất biến không bị ràng buộc</Q></N></I></F></C>'),
