(66556, 'inveigle', '<C><F><I><N><Q>@inveigle /in''vi:gl/<br />*  ngoại động từ<br />- dụ dỗ<br />=to inveigle someone into doing something+ dụ dỗ ai làm gì<br />- tán lấy được<br />=to inveigle something from somebody+ tán ai lấy được cái gì</Q></N></I></F></C>'),
(66557, 'inveigled', '<C><F><I><N><Q>@inveigle /in''vi:gl/<br />*  ngoại động từ<br />- dụ dỗ<br />=to inveigle someone into doing something+ dụ dỗ ai làm gì<br />- tán lấy được<br />=to inveigle something from somebody+ tán ai lấy được cái gì</Q></N></I></F></C>'),
(66558, 'inveiglement', '<C><F><I><N><Q>@inveiglement /in''vi:glmənt/<br />*  danh từ<br />- sự dụ dỗ; khoé dụ dỗ<br />- sự tán lấy được; cách tán</Q></N></I></F></C>'),
(66559, 'inveigler', '<C><F><I><N><Q>@inveigler /in''vi:glə/<br />*  danh từ<br />- người dụ dỗ<br />- người tán lấy được (cái gì)</Q></N></I></F></C>'),
(66560, 'inveigles', '<C><F><I><N><Q>@inveigle /in''vi:gl/<br />*  ngoại động từ<br />- dụ dỗ<br />=to inveigle someone into doing something+ dụ dỗ ai làm gì<br />- tán lấy được<br />=to inveigle something from somebody+ tán ai lấy được cái gì</Q></N></I></F></C>'),
(66561, 'inveigling', '<C><F><I><N><Q>@inveigle /in''vi:gl/<br />*  ngoại động từ<br />- dụ dỗ<br />=to inveigle someone into doing something+ dụ dỗ ai làm gì<br />- tán lấy được<br />=to inveigle something from somebody+ tán ai lấy được cái gì</Q></N></I></F></C>'),
(66562, 'invent', '<C><F><I><N><Q>@invent /in''vent/<br />*  ngoại động từ<br />- phát minh, sáng chế<br />- (từ Mỹ,nghĩa Mỹ) hư cấu; sáng tác (truyện)<br />- bịa đặt (chuyện...)<br /><br />@invent<br />- phát minh</Q></N></I></F></C>'),
(66563, 'inventable', '<C><F><I><N><Q>@inventable /in''ventəbl/ (inventible) /in''ventəbl/<br />*  tính từ<br />- có thể phát minh, có thể sáng chế<br />- (từ Mỹ,nghĩa Mỹ) có thể hư cấu; có thể sáng tác ra<br />- có thể bịa đặt</Q></N></I></F></C>'),
(66564, 'invented', '<C><F><I><N><Q>@invent /in''vent/<br />*  ngoại động từ<br />- phát minh, sáng chế<br />- (từ Mỹ,nghĩa Mỹ) hư cấu; sáng tác (truyện)<br />- bịa đặt (chuyện...)<br /><br />@invent<br />- phát minh</Q></N></I></F></C>'),
(66565, 'inventible', '<C><F><I><N><Q>@inventible /in''ventəbl/ (inventible) /in''ventəbl/<br />*  tính từ<br />- có thể phát minh, có thể sáng chế<br />- (từ Mỹ,nghĩa Mỹ) có thể hư cấu; có thể sáng tác ra<br />- có thể bịa đặt</Q></N></I></F></C>'),
(66566, 'inventing', '<C><F><I><N><Q>@invent /in''vent/<br />*  ngoại động từ<br />- phát minh, sáng chế<br />- (từ Mỹ,nghĩa Mỹ) hư cấu; sáng tác (truyện)<br />- bịa đặt (chuyện...)<br /><br />@invent<br />- phát minh</Q></N></I></F></C>'),
(66567, 'invention', '<C><F><I><N><Q>@invention /in''venʃn/<br />*  danh từ<br />- sự phát minh, sự sáng chế; vật phát minh, vật sáng chế; sáng kiến<br />- tài phát minh, tài sáng chế; óc sáng tạo<br />- sự sáng tác; vật sáng tác<br />- chuyện đặt<br /><br />@invention<br />- sự phát minh</Q></N></I></F></C>'),
(66568, 'Invention and innovation', '<C><F><I><N><Q>@Invention and innovation<br />- (Econ) Phát minh và phát kiến.</Q></N></I></F></C>'),
(66569, 'Invention and official financing', '<C><F><I><N><Q>@Invention and official financing<br />- (Econ) Can thiệp và tài trợ chính thức.</Q></N></I></F></C>'),
(66570, 'inventional', '<C><F><I><N><Q>@inventional /in''venʃənl/<br />*  tính từ<br />- (thuộc) sự phát minh, (thuộc) sự sáng chế; (thuộc) óc sáng chế<br />- (thuộc) sự hư cấu; (thuộc) sự sáng tác</Q></N></I></F></C>'),
(66571, 'inventions', '<C><F><I><N><Q>@invention /in''venʃn/<br />*  danh từ<br />- sự phát minh, sự sáng chế; vật phát minh, vật sáng chế; sáng kiến<br />- tài phát minh, tài sáng chế; óc sáng tạo<br />- sự sáng tác; vật sáng tác<br />- chuyện đặt<br /><br />@invention<br />- sự phát minh</Q></N></I></F></C>'),
(66572, 'inventive', '<C><F><I><N><Q>@inventive /in''ventiv/<br />*  tính từ<br />- có tài phát minh, có tài sáng chế; có óc sáng tạo; đầy sáng tạo<br />- để phát minh, để sáng chế; để sáng tạo<br />- (thuộc) sự phát minh, (thuộc) sự sáng chế, (thuộc) sự sáng tạo</Q></N></I></F></C>'),
(66573, 'inventively', '<C><F><I><N><Q>@inventively<br />- xem inventive</Q></N></I></F></C>'),
(66574, 'inventiveness', '<C><F><I><N><Q>@inventiveness /in''ventivnis/<br />*  danh từ<br />- tài phát minh, tài sáng chế, óc sáng tạo</Q></N></I></F></C>'),
(66575, 'inventor', '<C><F><I><N><Q>@inventor /in''ventə/<br />*  danh từ<br />- người phát minh, người sáng chế, người sáng tạo</Q></N></I></F></C>'),
(66576, 'inventorial', '<C><F><I><N><Q>@inventorial<br />- xem inventory</Q></N></I></F></C>'),
(66577, 'inventorially', '<C><F><I><N><Q>@inventorially<br />- xem inventory</Q></N></I></F></C>'),
(66578, 'inventoried', '<C><F><I><N><Q>@inventory /in''ventri/<br />*  danh từ<br />- sự kiểm kê; nằng kiểm kê; (từ Mỹ,nghĩa Mỹ) hàng hoá tồn kho (của một nhà buôn)<br />- (từ Mỹ,nghĩa Mỹ) sự tóm tắt; bản tóm tắt<br />- bản kê tài nguyên; bản kê thú rừng... (ở một vùng...)<br />*  ngoại động từ<br />- kiểm kê<br />- (từ Mỹ,nghĩa Mỹ) tóm tắt<br />*  nội động từ<br />- đáng giá (theo kiểm kê)<br />=stocks inventorying at 2,000,000+ kho hàng đáng giá 2 triệu đồng theo kiểm kê<br /><br />@inventory<br />- (thống kê) kiểm kê; danh sách kiểm kê; quỹ luân chuyển</Q></N></I></F></C>'),
(66579, 'Inventories', '<C><F><I><N><Q>@Inventories<br />- (Econ) Hang tồn kho, dữ trữ.<br />+ Dự trữ hay mức duy trì hành hoá của các doanh nghiệp để đáp ứng những dao động thất thường tạm thời trong sản xuất hay kinh doanh.</Q></N></I></F></C>'),
(66580, 'inventories', '<C><F><I><N><Q>@inventory /in''ventri/<br />*  danh từ<br />- sự kiểm kê; nằng kiểm kê; (từ Mỹ,nghĩa Mỹ) hàng hoá tồn kho (của một nhà buôn)<br />- (từ Mỹ,nghĩa Mỹ) sự tóm tắt; bản tóm tắt<br />- bản kê tài nguyên; bản kê thú rừng... (ở một vùng...)<br />*  ngoại động từ<br />- kiểm kê<br />- (từ Mỹ,nghĩa Mỹ) tóm tắt<br />*  nội động từ<br />- đáng giá (theo kiểm kê)<br />=stocks inventorying at 2,000,000+ kho hàng đáng giá 2 triệu đồng theo kiểm kê<br /><br />@inventory<br />- (thống kê) kiểm kê; danh sách kiểm kê; quỹ luân chuyển</Q></N></I></F></C>'),
(66581, 'inventors', '<C><F><I><N><Q>@inventor /in''ventə/<br />*  danh từ<br />- người phát minh, người sáng chế, người sáng tạo</Q></N></I></F></C>'),
(66582, 'inventory', '<C><F><I><N><Q>@inventory /in''ventri/<br />*  danh từ<br />- sự kiểm kê; nằng kiểm kê; (từ Mỹ,nghĩa Mỹ) hàng hoá tồn kho (của một nhà buôn)<br />- (từ Mỹ,nghĩa Mỹ) sự tóm tắt; bản tóm tắt<br />- bản kê tài nguyên; bản kê thú rừng... (ở một vùng...)<br />*  ngoại động từ<br />- kiểm kê<br />- (từ Mỹ,nghĩa Mỹ) tóm tắt<br />*  nội động từ<br />- đáng giá (theo kiểm kê)<br />=stocks inventorying at 2,000,000+ kho hàng đáng giá 2 triệu đồng theo kiểm kê<br /><br />@inventory<br />- (thống kê) kiểm kê; danh sách kiểm kê; quỹ luân chuyển</Q></N></I></F></C>'),
(66583, 'Inventory cycle', '<C><F><I><N><Q>@Inventory cycle<br />- (Econ) Chu kỳ hàng tồn kho.<br />+ Những dao động của mức sản lượng do những thay đổi của LƯỢNG TỒN KHO.</Q></N></I></F></C>'),
(66584, 'Inventory investment', '<C><F><I><N><Q>@Inventory investment<br />- (Econ) Đầu tư tồn kho<br />+ Sự tích luỹ hàng tồn kho khi sản xuất vượt quá sản lượng bán thực tế.</Q></N></I></F></C>'),
(66585, 'inventorying', '<C><F><I><N><Q>@inventory /in''ventri/<br />*  danh từ<br />- sự kiểm kê; nằng kiểm kê; (từ Mỹ,nghĩa Mỹ) hàng hoá tồn kho (của một nhà buôn)<br />- (từ Mỹ,nghĩa Mỹ) sự tóm tắt; bản tóm tắt<br />- bản kê tài nguyên; bản kê thú rừng... (ở một vùng...)<br />*  ngoại động từ<br />- kiểm kê<br />- (từ Mỹ,nghĩa Mỹ) tóm tắt<br />*  nội động từ<br />- đáng giá (theo kiểm kê)<br />=stocks inventorying at 2,000,000+ kho hàng đáng giá 2 triệu đồng theo kiểm kê<br /><br />@inventory<br />- (thống kê) kiểm kê; danh sách kiểm kê; quỹ luân chuyển</Q></N></I></F></C>'),
(66586, 'invents', '<C><F><I><N><Q>@invent /in''vent/<br />*  ngoại động từ<br />- phát minh, sáng chế<br />- (từ Mỹ,nghĩa Mỹ) hư cấu; sáng tác (truyện)<br />- bịa đặt (chuyện...)<br /><br />@invent<br />- phát minh</Q></N></I></F></C>'),
(66587, 'inveracity', '<C><F><I><N><Q>@inveracity /,invə''ræsiti/<br />*  danh từ<br />- tính sai với sự thật<br />- điều sai sót với sự thật, điều dối trá</Q></N></I></F></C>'),
(66588, 'inverness', '<C><F><I><N><Q>@inverness /,invə''nes/ (invernesscape) /,invə''nes''keip/<br />*  danh từ<br />- áo choàng (của đàn ông Ê-cốt)</Q></N></I></F></C>'),
(66589, 'invernesscape', '<C><F><I><N><Q>@invernesscape /,invə''nes/ (invernesscape) /,invə''nes''keip/<br />*  danh từ<br />- áo choàng (của đàn ông Ê-cốt)</Q></N></I></F></C>'),
(66590, 'Invernesses', '<C><F><I><N><Q>@inverness /,invə''nes/ (invernesscape) /,invə''nes''keip/<br />*  danh từ<br />- áo choàng (của đàn ông Ê-cốt)</Q></N></I></F></C>'),
(66591, 'inverse', '<C><F><I><N><Q>@inverse /''in''və:s/<br />*  tính từ<br />- ngược lại<br />- (toán học) ngược, nghịch đảo<br />=inverse ratio+ tỷ số ngược<br />*  danh từ<br />- cái ngược lại; điều ngược lại<br />- (toán học) số nghịch đảo<br /><br />@inverse<br />- ngược, nghịch đảo<br />- i. of a number nghịch đảo của một số<br />- right i. nghịch đảo phải</Q></N></I></F></C>'),
(66592, 'Inverse function rule', '<C><F><I><N><Q>@Inverse function rule<br />- (Econ) Quy tắc hàm ngược.<br />+ Một quy tắc xác định đạo hàm của một hàm số, trong đó biến số mà chúng ta muốn lấy đạo hàm được biểu diễn dưới dạng biến phụ thuộc.</Q></N></I></F></C>'),
(66593, 'Inverse relation', '<C><F><I><N><Q>@Inverse relation<br />- (Econ) Tương quan nghịch biến.</Q></N></I></F></C>'),
(66594, 'inversely', '<C><F><I><N><Q>@inversely<br />* phó từ<br />- ngược lại, nghịch đảo<br /><br />@inversely<br />- ngược lại, nghịch đảo</Q></N></I></F></C>'),
(66595, 'inverses', '<C><F><I><N><Q>@inverse /''in''və:s/<br />*  tính từ<br />- ngược lại<br />- (toán học) ngược, nghịch đảo<br />=inverse ratio+ tỷ số ngược<br />*  danh từ<br />- cái ngược lại; điều ngược lại<br />- (toán học) số nghịch đảo<br /><br />@inverse<br />- ngược, nghịch đảo<br />- i. of a number nghịch đảo của một số<br />- right i. nghịch đảo phải</Q></N></I></F></C>');
INSERT INTO `tbl_edict` (`id`, `word`, `detail`) VALUES
(66596, 'inversion', '<C><F><I><N><Q>@inversion /''in''və:ʃn/<br />*  danh từ<br />- sự lộn ngược, sự đảo ngược; sự bị lộn ngược, sự bị đảo ngược<br />- (ngôn ngữ học) phép đảo (trật tự của từ)<br />- (hoá học) sự nghịch chuyển<br />- (tâm lý học) sự yêu người cùng tính; sự đồng dâm<br />- (toán học) phép nghịch đảo<br /><br />@inversion<br />- phép nghịch đảo, phép biến đổi ngược; nghịch thế (trong phép<br />- thế); (vật lí) phép đổi điện</Q></N></I></F></C>'),
(66597, 'inversions', '<C><F><I><N><Q>@inversion /''in''və:ʃn/<br />*  danh từ<br />- sự lộn ngược, sự đảo ngược; sự bị lộn ngược, sự bị đảo ngược<br />- (ngôn ngữ học) phép đảo (trật tự của từ)<br />- (hoá học) sự nghịch chuyển<br />- (tâm lý học) sự yêu người cùng tính; sự đồng dâm<br />- (toán học) phép nghịch đảo<br /><br />@inversion<br />- phép nghịch đảo, phép biến đổi ngược; nghịch thế (trong phép<br />- thế); (vật lí) phép đổi điện</Q></N></I></F></C>'),
(66598, 'inversive', '<C><F><I><N><Q>@inversive /in''və:siv/<br />*  tính từ<br />- lộn ngược, đảo ngược, xoay ngược</Q></N></I></F></C>'),
(66599, 'invert', '<C><F><I><N><Q>@invert /in''və:t/<br />*  danh từ<br />- (kiến trúc) vòm võng xuống<br />- (tâm lý học) người yêu người cùng tính; người đồng dâm<br />*  ngoại động từ<br />- lộn ngược, đảo ngược, xoay ngược; lộn trong ra ngoài<br />- đảo (trật tự của từ...)<br />- (hoá học) nghịch chuyển<br />*  nội động từ<br />- (hoá học) đã nghịch chuyển</Q></N></I></F></C>'),
(66600, 'invertase', '<C><F><I><N><Q>@invertase<br />* danh từ<br />- &lt;hóa&gt;&lt;sinh&gt; invectaza</Q></N></I></F></C>'),
(66601, 'invertasre', '<C><F><I><N><Q>@invertasre /in''və:teis/<br />*  danh từ<br />- (hoá học); (sinh vật học) invectaza</Q></N></I></F></C>'),
(66602, 'invertebrate', '<C><F><I><N><Q>@invertebrate /in''və:tibrit/<br />*  tính từ<br />- (động vật học) không xương sống<br />- (nghĩa bóng) nhu nhược<br />*  danh từ<br />- (động vật học) loài không xương sống<br />- (nghĩa bóng) người nhu nhược</Q></N></I></F></C>'),
(66603, 'invertebrates', '<C><F><I><N><Q>@invertebrate /in''və:tibrit/<br />*  tính từ<br />- (động vật học) không xương sống<br />- (nghĩa bóng) nhu nhược<br />*  danh từ<br />- (động vật học) loài không xương sống<br />- (nghĩa bóng) người nhu nhược</Q></N></I></F></C>'),
(66604, 'inverted', '<C><F><I><N><Q>@inverted<br />- bị nghịch đảo</Q></N></I></F></C><C><F><I><N><Q>@invert /in''və:t/<br />*  danh từ<br />- (kiến trúc) vòm võng xuống<br />- (tâm lý học) người yêu người cùng tính; người đồng dâm<br />*  ngoại động từ<br />- lộn ngược, đảo ngược, xoay ngược; lộn trong ra ngoài<br />- đảo (trật tự của từ...)<br />- (hoá học) nghịch chuyển<br />*  nội động từ<br />- (hoá học) đã nghịch chuyển</Q></N></I></F></C>'),
(66605, 'inverted commas', '<C><F><I><N><Q>@inverted commas<br />* danh từ<br />- dấu ngoặc kép</Q></N></I></F></C>'),
(66606, 'inverted snob', '<C><F><I><N><Q>@inverted snob<br />* danh từ<br />- người muốn chứng minh rằng mình không phải thuộc loại trưởng giả học làm sang</Q></N></I></F></C>'),
