(66637, 'Investment', '<C><F><I><N><Q>@Investment<br />- (Econ) Đầu tư.<br />+ Thuật ngữ này được sử dụng phổ biến nhất để mô tả lưu lượng chi tiêu được dùng để tăng hay duy trì DUNG LƯỢNG VỐN thực tế.</Q></N></I></F></C>'),
(66638, 'investment', '<C><F><I><N><Q>@investment /in''vestmənt/<br />*  danh từ<br />- sự đầu tư; vốn đầu tư; cái được đầu tư<br />- (như) investiture<br />- (quân sự) sự bao vây, sự phong toả<br /><br />@investment<br />- (toán kinh tế) vốn đầu tư; sự hùn (vốn)</Q></N></I></F></C>'),
(66639, 'Investment criteria', '<C><F><I><N><Q>@Investment criteria<br />- (Econ) Các tiêu chuẩn đầu tư.<br />+ (Đối với các nước ĐANG PHÁT TRIỂN). Các tiêu chuẩn được đề ra nhằm làm cơ sở cho việc phân bố các nguồn lực đầu tư.</Q></N></I></F></C>'),
(66640, 'Investment demand schedule', '<C><F><I><N><Q>@Investment demand schedule<br />- (Econ) Biểu đồ nhu cầu đầu tư.</Q></N></I></F></C>'),
(66641, 'Investment grants', '<C><F><I><N><Q>@Investment grants<br />- (Econ) Trợ cấp đầu tư.<br />+ Các khoản tiền do chính phủ hay các tổ chức khác cung cấp nhằm mục đích khuyến khích các doanh nghiệp chi tiêu mua VÔND vật chất.</Q></N></I></F></C>'),
(66642, 'Investment trust', '<C><F><I><N><Q>@Investment trust<br />- (Econ) Tờ-rớt đầu tư.<br />+ Một công ty với chức năng đầu tư vào các tổ chức khác.</Q></N></I></F></C>'),
