(66646, 'Investors in Industry', '<C><F><I><N><Q>@Investors in Industry<br />- (Econ) Các nhà đầu tư trong Công nghiệp.<br />+ Một công ty tài chính phát triển được ngân hàng Anh và Ngân hàng thanh toán London và Scotland thành lập năm 1946 gọi là HIỆP HỘI TÀI CHÍNH CÔNG NGHIỆP VÀ THƯƠNG MẠI (ICFC) với sự trợ giúp của chính phủ Anh  nhằm lấp một trong những lỗ hổng của thị trường vốn Anh do uỷ ban MACMILLAN xác định.</Q></N></I></F></C>'),
