(66685, 'Invisible hand, the', '<C><F><I><N><Q>@Invisible hand, the<br />- (Econ) Bàn tay vô hình.<br />+ Một cụm thuật ngữ chỉ một quá trình phối hợp không trông thấy được nhằm đảm bảo cho sự nhất quán của các kế hoạch cá nhân trong nền kinh tế thị trường phi tập trung.</Q></N></I></F></C>'),
