(66730, 'involution', '<C><F><I><N><Q>@involution /,invə''lu:ʃn/<br />*  danh từ<br />- sự dính dáng, sự mắc míu<br />- điều rắc rối, điều phức tạp<br />- sự cuộn, sự xoắn ốc; phần cuộn, phần xoắn ốc<br />- (toán học) sự nâng lên luỹ thừa<br />- (thực vật học) sự cuốn trong<br />- (y học) sự thu teo, sự co hồi (tử cung sau khi đẻ)<br /><br />@involution<br />- phép nâng lên luỹ thừa; phép đối hợp; ánh xạ đối i. on a line<br />- phép đối hợp tuyến <br />- i. of high order phép đối hợp cấp cao<br />- biaxial i. phép đối hợp song trục<br />- central i. phép đối hợp tâm <br />- cyclic i. phép đối hợp tuần hoàn <br />- elliptic i. phép đối hợp ellipic<br />- extremal i. (đại số) phép đối hợp cực trị<br />- focal i. phép đối hợp tiêu<br />- hyperbolic i. phép đối hợp hypebolic<br />- line i. phép đối hợp tuyến<br />- n-array i. phép đối hợp bộ n<br />- orthogonal i. phép đối hợp trực giao<br />- point i. phép đối hợp điểm<br />- rational i. phép đối hợp hữu tỷ <br />- quadratic i. phép đối hợp bậc hai<br />- skew i. phép đối hợp lệch<br />- symmetric i. phép đối hợp đối xứng <br />- ternary i. phép đối hợp bộ ba</Q></N></I></F></C>'),
