(66734, 'involve', '<C><F><I><N><Q>@involve /in''vɔlv/<br />*  ngoại động từ<br />- gồm, bao hàm<br />- làm cho mắc míu (vào chuyện gì); làm liên luỵ, làm dính líu, làm dính dáng<br />- ((thường) dạng bị động) thu hút tâm trí của; để hết tâm trí vào (cái gì)<br />=he was involved in working out a solution to the problem+ anh ấy để hết tâm trí tìm cách giải quyết vấn đề<br />- đòi hỏi phải, cần phải, kéo theo<br />=expansion is business involves expenditure+ sự mở rộng việc kinh doanh đòi hỏi phải chi tiêu<br />- cuộn vào, quấn lại<br /><br />@involve<br />- nâng lên luỹ thừa; suy ra, kéo theo; xoáy, xoắn</Q></N></I></F></C>'),
