(67058, 'Irreversibility', '<C><F><I><N><Q>@Irreversibility<br />- (Econ) Tính bất khả đảo; Tính không thể đảo ngược được.<br />+ Xét về phương diện TÀI NGUYÊN THIÊN NHIÊN và môi trường, thuật ngữ này chỉ một hành động nào đó có những tác động không thể đảo ngược được một cách tuyệt đối hoặc do chi phí để làm như vậy là quá lớn.</Q></N></I></F></C>'),
(67059, 'irreversibility', '<C><F><I><N><Q>@irreversibility /''iri,və:sə''biliti/ (irreversibleness) /,iri''və:səblnis/<br />*  danh từ<br />- sự không thể đảo ngược lại; sự không thể thay đổi được<br />- (hoá học) tính không thuận nghịch<br /><br />@irreversibility<br />- tính không khả nghịch, tính không đoa rngược được</Q></N></I></F></C>'),
