(67105, 'is', '<C><F><I><N><Q>@is /iz/<br />*  ngôi 3 số ít thời hiện tại của be</Q></N></I></F></C><C><F><I><N><Q>@be /bi:/<br />*  (bất qui tắc) nội động từ &amp; trợ động từ (số ít was,  số nhiều were,  been)<br />- thì, là<br />=the earth is round+ quả đất (thì) tròn<br />=he is a teacher+ anh ta là giáo viên<br />- có, tồn tại, ở, sống<br />=there is a concert today+ hôm nay có một buổi hoà nhạc<br />=are you often in town?+ anh thường có ở tỉnh không<br />=to be or not to be, that is the question+ sống hay là chết đây, đó là vấn đề<br />- trở nên, trở thành<br />=they''ll be linguists in some years time+ vài năm nữa họ sẽ trở thành những nhà ngôn ngữ học<br />- xảy ra, diễn ra<br />=when is the wedding to be+ bao giờ đám cưới sẽ cử hành<br />- giá<br />=this book is five pence+ cuốn sách này giá năm xu<br />- be to phải, định, sẽ<br />=what time am I to come?+ mấy giờ tôi phải đến<br />=he is to leave for Hanoi tomorrow+ ngày mai nó sẽ đi Hà nội<br />- (+ động tính từ hiện tại) đang<br />=they are doing their work+ họ đang làm việc của họ<br />- (+ động tính từ quá khứ) bị, được<br />=the boy is scolded by his mother+ đứa bé bị mẹ mắng<br />=the house is being built+ ngôi nhà đang được xây<br />!to have been<br />- đã đi, đã đến<br />=I''ve been to Peking once+ tôi đã đi Bắc kinh một lần<br />=has anyone been during my absence?+ trong khi tôi đi vắng có ai đến không?<br />=he''s been and took my books+ (thông tục) cái thằng ấy đã đến lấy mất sách của mình<br />!to be against<br />- chống lại<br />!to be for<br />- tán thành, đứng về phía</Q></N></I></F></C>'),
(67106, 'IS and LM schedule', '<C><F><I><N><Q>@IS and LM schedule<br />- (Econ) Biểu đồ IS và LM.</Q></N></I></F></C>'),
(67107, 'IS curve', '<C><F><I><N><Q>@IS curve<br />- (Econ) Đường IS<br />+ Xem IS - LM DIAGRAM</Q></N></I></F></C>'),
(67108, 'IS- LM diagram', '<C><F><I><N><Q>@IS- LM diagram<br />- (Econ) Lược đồ IS - LM.<br />+ Lược đồ mô tả việc xác định đông thờicác giá trị cân bằng của lãi suất và mức thu nhập quốc dân do kết quả thực hiện các điều kiện trong thị trường hàng hoá và tiền tệ.</Q></N></I></F></C>'),
