(67151, 'Iso-cost curve', '<C><F><I><N><Q>@Iso-cost curve<br />- (Econ) Đường đẳng phí.<br />+ Đương cong hay đường thẳng mô tả tổ hợp của hai đầu vào bất kỳ có thể mua được với một số tiền cố định.</Q></N></I></F></C>'),
(67152, 'Iso-outlay line', '<C><F><I><N><Q>@Iso-outlay line<br />- (Econ) Đường đẳng chi.<br />+ (Còn được gọi là đường cong đẳng chi). Xem ISO-COST CURVE.</Q></N></I></F></C>'),
(67153, 'Iso-product curve', '<C><F><I><N><Q>@Iso-product curve<br />- (Econ) Đường đẳng sản phẩm.<br />+ (Còn được gọi là đường bàng quan của người sản xuất hay đường đẳng lượng). Một đường đẳng sản phẩm là tập hợp các tổ hợp của hai hay nhiều ĐẦU VÀO tạo ra cùng một mức SẢN LƯỢNG.</Q></N></I></F></C>'),
(67154, 'Iso-profit curve', '<C><F><I><N><Q>@Iso-profit curve<br />- (Econ) Các đường đẳng nhuận.<br />+ Quỹ tích các tổ hợp của hai hay nhiều biến phụ thuộc của HÀM LỢI NHUẬN tạo nên một mức lợi nhuận như nhau.</Q></N></I></F></C>'),
(67155, 'Iso-revenue line (curve)', '<C><F><I><N><Q>@Iso-revenue line (curve)<br />- (Econ) Đường đẳng thu.<br />+ Quỹ tích các tổ hợp SẢN LƯỢNG và phí tổn tiếp thị tạo nên một mức TỔNG DOANH THU nhất định.</Q></N></I></F></C>'),
