(67275, 'issuable', '<C><F><I><N><Q>@issuable /''isju:əbl/<br />*  tính từ<br />- có thể phát (đồ đạc...); có thể phát hành (giấy bạc...); có thể cho ra (báo...)<br />- (pháp lý) có thể tranh câi, có thể phản đối<br />=issuable terms+ điều kiện có thể tranh cãi</Q></N></I></F></C>'),
(67276, 'issuance', '<C><F><I><N><Q>@issuance /''isju:əns/<br />*  danh từ<br />- sự phát; sự phát hành; sự cho ra<br />- sự phát ra, sự đi ra, sự chảy ra, sự thoát ra</Q></N></I></F></C>'),
