(67278, 'issuant', '<C><F><I><N><Q>@issuant<br />* tính từ<br />- (những con vật trong huy hiệu) chỉ có phần trên được miêu tả<br />- (từ cổ, nghĩa cổ) nảy sinh; đâm ra</Q></N></I></F></C>'),
(67279, 'issue', '<C><F><I><N><Q>@issue /''isju:/<br />*  danh từ<br />- sự phát ra; sự phát hành; sự đưa ra<br />- số báo (in ra); số lượng cho ra (tem...)<br />=the latest issue of a weekly+ số mới nhất của một tờ báo hàng tuần<br />- vấn đề (đang tranh câi, đang kiện cáo...); vấn đề chín muồi (có thể quyết định)<br />=at issue+ đang tranh câi (vấn đề); không đồng ý với nhau (người)<br />- kết quả, hậu quả, sản phẩm<br />- (quân sự) số lượng (thức ăn, quần áo, súng đạn...) phát một lần (cho một người lính, cho một đơn vị...)<br />- lần in (sách...)<br />- dòng dõi, con cái<br />=to die without issue+ chết tuyệt giống<br />- sự đi ra, sự chảy ra, sự bốc ra, sự thoát ra; lòi ra, lối thoát; cửa sông; cái chảy ra, cái thoát ra<br />- (y học) sự chảy máu, sự chảy mủ; vết rạch cho chảy mủ<br />- (pháp lý) lợi tức, thu hoạch (đất đai...)<br />!to join issue with somebody on some point<br />- tiến hành tranh luận với ai về một điểm gì; không đồng ý với ai về một điểm gì<br />!to take issue with somebody<br />- không đồng ý với ai; tranh cãi với ai<br />*  ngoại động từ<br />- đưa ra; phát hành, lưu hành, in ra<br />- (quân sự) phát (quần áo, đạn dược...)<br />- phát ra, để chảy ra<br />*  nội động từ<br />- đi ra, chảy ra, bóc ra, thoát ra<br />- được đưa ra; được phát hành, được lưu hành, được in ra<br />- xuất phát, bắt nguồn; là kết quả, là hậu quả<br />- là dòng dõi; là lợi tức, là thu hoạch (của đất đai...)</Q></N></I></F></C>'),
(67280, 'Issue department', '<C><F><I><N><Q>@Issue department<br />- (Econ) Cục phát hành.<br />+ Một cục thuộc Ngân hàng Anh có trách nhiệm trong việc phát hành giấy bạc ngân hàng.</Q></N></I></F></C>'),
