(67282, 'Issued capital', '<C><F><I><N><Q>@Issued capital<br />- (Econ) Vốn phát hành.<br />+ Khi một công ty có hạn chế về cổ phần được thành lập, công ty này được phép tăng vốn bằng cách phát hành cổ phiếu với một số lượng nhất định.</Q></N></I></F></C>'),
(67283, 'issueless', '<C><F><I><N><Q>@issueless /''isju:lis/<br />*  tính từ<br />- tuyệt giống<br />- không đem lại kết quả gì<br />- không nêu vấn đề gì để tranh cãi<br />=an issueless talk+ một bài nói chuyện không nêu vấn đề gì để tranh cãi</Q></N></I></F></C>'),
(67284, 'issuer', '<C><F><I><N><Q>@issuer /''isju:ə/<br />*  danh từ<br />- người đưa ra, người phát hành, người in ra (sách báo, tiền...)</Q></N></I></F></C>'),
(67285, 'issuers', '<C><F><I><N><Q>@issuer /''isju:ə/<br />*  danh từ<br />- người đưa ra, người phát hành, người in ra (sách báo, tiền...)</Q></N></I></F></C>'),
