(67288, 'Issuing broker', '<C><F><I><N><Q>@Issuing broker<br />- (Econ) Người môi giới phát hành.<br />+ Một số loại chứng khoán phát hành mới của các công ty và các tổ chức khác được những người môi giới chứng khoán điều khiển và trên phương diện này thì họ hoạt động giống như nhà phát hành.</Q></N></I></F></C>'),
(67289, 'Issuing house', '<C><F><I><N><Q>@Issuing house<br />- (Econ) Nhà phát hành.<br />+ Một tổ chức, thường là một ngân hàng thương mại, bên cạnh các hoạt động khác còn chuyên môn hoá trong quản lý việc phát hành cổ phần mới, trái phiếu công ty hoặc trái phiếu nhân danh các công ty hoặc các tổ chức khác có nhu cầu về tài chính, ví dụ như chính phủ và các cấp chính quyền địa phương.</Q></N></I></F></C>'),
(67290, 'Issuing House Association', '<C><F><I><N><Q>@Issuing House Association<br />- (Econ) Hiệp hội các Nhà phát hành.<br />+ Một hiệp hội được thành lập vào năm 1945 để tổ chức một diễn đàn nhằm tăng cường những lợi ích của các ngân hàng thương mại và các tổ chức khác hoạt động với tư cách là các nhà phát hành.</Q></N></I></F></C>'),
(67291, 'isthemian', '<C><F><I><N><Q>@isthemian<br />* danh từ<br />- dân cư sống ở eo đất<br />* tính từ, cũng isthmic<br />- thuộc (gần) eo đất</Q></N></I></F></C>'),
(67292, 'isthmi', '<C><F><I><N><Q>@isthmus /''isməs/<br />*  danh từ<br />- eo đất<br />- (giải phẫu) eo<br /><br />@isthmus<br />- (tô pô) eo<br />- italic (kỹ thuật) nghiêng; chữ nghiêng</Q></N></I></F></C>'),
