(67294, 'isthmians', '<C><F><I><N><Q>@isthmian /''isθmiən/<br />*  tính từ<br />- (thuộc) eo</Q></N></I></F></C>'),
(67295, 'isthmus', '<C><F><I><N><Q>@isthmus /''isməs/<br />*  danh từ<br />- eo đất<br />- (giải phẫu) eo<br /><br />@isthmus<br />- (tô pô) eo<br />- italic (kỹ thuật) nghiêng; chữ nghiêng</Q></N></I></F></C>'),
