(67297, 'istle', '<C><F><I><N><Q>@istle /''istli/<br />*  danh từ<br />- sợi thùa (làm dây, lưới...)</Q></N></I></F></C>'),
(67298, 'it', '<C><F><I><N><Q>@it /it/<br />*  đại từ<br />- cái đó, điều đó, con vật đó<br />- trời, thời tiết; ngày; đường...<br />=it is raining+ trời đang mưa<br />=it is cold+ thời tiết lạnh<br />=it is holiday today+ hôm nay là ngày nghỉ<br />- (không dịch)<br />=it is very pleasant here+ ở đây rất thú<br />=it is easy to talk like that+ nói như vậy rất dễ<br />*  danh từ<br />- em bé, được chỉ định (làm gì trong trò chơi trẻ con)<br />- tình hình chung, hoàn cảnh, cuộc sống nói chung<br />=how is it with you+ anh làm ăn thế nào?, anh sinh sống thế nào?<br />*  danh từ<br />- (thông tục),  (viết tắt) của Italian vermouth<br />=gin and it+ rượu gin và vecmut Y</Q></N></I></F></C>'),
(67299, 'it''d', '<C><F><I><N><Q>@it''d<br />- viết tắt của it  had; it  would</Q></N></I></F></C>'),
(67300, 'it''ll', '<C><F><I><N><Q>@it''ll<br />- viết tắt của it  will; it  shall</Q></N></I></F></C>'),
