(67402, 'jabbers', '<C><F><I><N><Q>@jabber /''dʤæbə/<br />*  danh từ<br />- lời nói lúng búng<br />- lời nói liến thoắng không mạch lạc; lời nói huyên thiên<br />*  động từ<br />- nói lúng búng<br />- nói liến thoắng không mạch lạc; nói huyên thiên</Q></N></I></F></C>'),
(67403, 'jabbing', '<C><F><I><N><Q>@jab /dʤæb/<br />*  danh từ<br />- nhát đâm mạnh, cái thọc mạnh<br />- nhát đâm bất thình lình; cú đánh bất thình lình<br />- (quân sự) trận đánh thọc sâu</Q></N></I></F></C>'),
(67404, 'jabiru', '<C><F><I><N><Q>@jabiru<br />* danh từ<br />- con cò (nhiệt đới)</Q></N></I></F></C>'),
(67405, 'jaborandi', '<C><F><I><N><Q>@jaborandi /,dʤæbə''rændi/<br />*  danh từ<br />- (dược học) lá mao quả</Q></N></I></F></C>'),
(67406, 'jabot', '<C><F><I><N><Q>@jabot /''ʤæbou/<br />*  danh từ<br />- ren, đăng ten (viền áo cánh đàn bà, ngực áo sơ mi đàn ông)</Q></N></I></F></C>'),
(67407, 'jabots', '<C><F><I><N><Q>@jabot /''ʤæbou/<br />*  danh từ<br />- ren, đăng ten (viền áo cánh đàn bà, ngực áo sơ mi đàn ông)</Q></N></I></F></C>'),
(67408, 'jabs', '<C><F><I><N><Q>@jab /dʤæb/<br />*  danh từ<br />- nhát đâm mạnh, cái thọc mạnh<br />- nhát đâm bất thình lình; cú đánh bất thình lình<br />- (quân sự) trận đánh thọc sâu</Q></N></I></F></C>'),
(67409, 'jacaranda', '<C><F><I><N><Q>@jacaranda<br />* danh từ<br />- (khoáng chất) ngọc da cam,  hiaxin<br />- cây lan dạ hương</Q></N></I></F></C>'),
(67410, 'jacarandas', '<C><F><I><N><Q>@jacaranda<br />* danh từ<br />- (khoáng chất) ngọc da cam,  hiaxin<br />- cây lan dạ hương</Q></N></I></F></C>'),
(67411, 'jacinth', '<C><F><I><N><Q>@jacinth /''dʤæsinθ/<br />*  danh từ<br />- (khoáng chất) ngọc da cam,  hiaxin<br />- màu da cam</Q></N></I></F></C>'),
(67412, 'jack', '<C><F><I><N><Q>@jack /dʤæk/<br />*  danh từ<br />- quả mít<br />- (thực vật học) cây mít<br />- gỗ mít<br />*  danh từ<br />- (hàng hải) lá cờ ((thường) chỉ quốc tịch)<br />!Union Jack<br />- quốc kỳ Anh<br />*  danh từ (từ cổ,nghĩa cổ)<br />- áo chẽn không tay (của lính)<br />- bình bằng da (để đựng nước, rượu...) ((cũng) black jack)<br />*  danh từ<br />- Giắc (tên riêng, cách gọi thân mật của tên Giôn)<br />- người con trai, gã ((cũng) Jack)<br />=every man jack+ mọi người<br />=Jack and Gill (Jill)+ chàng và nàng<br />- (như) jack_tar<br />- nhân viên, thợ, người đi làm thuê làm mướn, người làm những công việc linh tinh ((cũng) Jack)<br />=Jack in office+ viên chức nhỏ nhưng hay làm ra vẻ ta đây quan trọng<br />- (đánh bài) quân J<br />- (từ Mỹ,nghĩa Mỹ),  (từ lóng) tiến<br />- (quân sự),  (từ lóng) lính quân cảnh<br />- (động vật học) cá chó nhỏ<br />- (kỹ thuật) cái kích ((cũng) cattiage jack); cái palăng; tay đòn, đòn bẩy<br />- giá, bệ đỡ<br />- cái đế rút giày ống ((cũng) boot jack)<br />- máy để quay xiên nướng thịt<br />- (từ Mỹ,nghĩa Mỹ) đuốc, đèn (để đi săn hoặc câu đêm) ((cũng) jack light)<br />!to be Jack of all trades and master of none<br />- nghề gì cũng biết nhưng chẳng tinh nghề nào<br />!before you could say Jack Robinson<br />- đột ngột, rất nhanh, không kịp kêu lên một tiếng, không kịp ngáp<br />*  ngoại động từ<br />- ((thường) + up) kích lên (xe ô tô...)<br />- săn bằng đuốc, săn bằng đèn; câu bằng đuốc, câu bằng đèn<br />!to jack up<br />- bỏ, từ bỏ<br />=to jack up one''s job+ bỏ công việc<br />- (từ Mỹ,nghĩa Mỹ),  (thông tục) nâng, tăng (giá lương...)<br />- (từ Mỹ,nghĩa Mỹ),  (thông tục) quở trách, khiển, chỉnh (vì sao lãng...)</Q></N></I></F></C>'),
(67413, 'jack-a-dandy', '<C><F><I><N><Q>@jack-a-dandy /,dʤækə''dændi/<br />*  danh từ<br />- anh chàng ăn diện, anh chàng diện đúng mốt; công tử bột</Q></N></I></F></C>'),
(67414, 'jack frost', '<C><F><I><N><Q>@jack frost /''dʤæk''frɔst/<br />*  danh từ<br />- chàng Sương muối (sương muối nhân cách hoá)</Q></N></I></F></C>'),
(67415, 'jack-horse', '<C><F><I><N><Q>@jack-horse /''dʤækhɔ:s/<br />*  danh từ<br />- cái giá, bệ đỡ</Q></N></I></F></C>'),
(67416, 'jack-in-office', '<C><F><I><N><Q>@jack-in-office<br />* danh từ<br />- viên chức nhỏ ra dáng ta đây quan trọng</Q></N></I></F></C>'),
(67417, 'jack-in-the-box', '<C><F><I><N><Q>@jack-in-the-box /''dʤækinðəbɔks/<br />*  danh từ<br />- hộp hình nộm (có lò xo, khi mở nắp hộp thì hình nộm bật lên) (đồ chơi trẻ con)<br />- pháo hoa hộp<br />- (kỹ thuật) kích vít</Q></N></I></F></C>'),
(67418, 'jack ketch', '<C><F><I><N><Q>@jack ketch /''dʤæk''ketʃ/<br />*  danh từ (như) hangman</Q></N></I></F></C>'),
(67419, 'jack-knife', '<C><F><I><N><Q>@jack-knife /''dʤæknaif/<br />*  danh từ<br />- dao xếp (bỏ túi)</Q></N></I></F></C>'),
(67420, 'jack light', '<C><F><I><N><Q>@jack light /''dʤæklait/<br />*  danh từ<br />- (từ Mỹ,nghĩa Mỹ) đuốc, đèn (để đi săn hay để câu đêm)</Q></N></I></F></C>'),
(67421, 'jack-o''-lantern', '<C><F><I><N><Q>@jack-o''-lantern /''dʤækə,læntən/<br />*  danh từ<br />- ma trơi<br />- đèn ma (quả bí moi ruột và khắc hình người có mắt, mũi, mồm làm đèn nghịch chơi)</Q></N></I></F></C>'),
(67422, 'jack-plane', '<C><F><I><N><Q>@jack-plane /''dʤækplein/<br />*  danh từ<br />- (kỹ thuật) cái bào thô</Q></N></I></F></C>'),
(67423, 'jack-priest', '<C><F><I><N><Q>@jack-priest /''dʤæk,pri:st/<br />*  danh từ<br />- uồm <br />=<br />ắ<br />=...f</Q></N></I></F></C>'),
(67424, 'jack pudding', '<C><F><I><N><Q>@jack pudding /''dʤæk''pudiɳ/<br />*  danh từ<br />- anh hề</Q></N></I></F></C>'),
(67425, 'jack rabbit', '<C><F><I><N><Q>@jack rabbit /''dʤæk''pudiɳ/<br />*  danh từ<br />- (động vật học) thỏ rừng tai to (ở Bắc Mỹ)</Q></N></I></F></C>'),
(67426, 'jack-rafter', '<C><F><I><N><Q>@jack-rafter /''dʤæk,rɑ:ftə/<br />*  danh từ<br />- đòn tay ngắn (ở mái nhà)</Q></N></I></F></C>'),
(67427, 'jack-screw', '<C><F><I><N><Q>@jack-screw /''dʤækskru:/<br />*  danh từ<br />- (kỹ thuật) kích vít<br /><br />@jack-screw<br />- (kỹ thuật) vít nâng, kích vít</Q></N></I></F></C>'),
(67428, 'jack-snipe', '<C><F><I><N><Q>@jack-snipe /''dʤæksnaip/<br />*  danh từ<br />- (động vật học) chim dẽ ri</Q></N></I></F></C>'),
(67429, 'jack sprat', '<C><F><I><N><Q>@jack sprat /''dʤæk''spræt/<br />*  danh từ<br />- người tầm thường, người nhỏ nhen</Q></N></I></F></C>'),
(67430, 'jack-staff', '<C><F><I><N><Q>@jack-staff /''dʤækstɑ:f/<br />*  danh từ (hàng hải)<br />- cột buồm treo cờ<br />- cán cờ trên cột buồm</Q></N></I></F></C>'),
(67431, 'jack-straw', '<C><F><I><N><Q>@jack-straw /''dʤækstrɔ:/<br />*  danh từ<br />- bù nhìn rơm<br />- người tầm thường, người nhỏ nhen<br />- (số nhiều) trò chơi nhặt cọng rơm (vứt cọng rơm thành đồng khẽ nhặt ra từng cái một làm sao không động đến cái khác)<br />!not to care a jack-straw<br />- cóc cần; không mảy may bận tâm gì đến</Q></N></I></F></C>'),
(67432, 'jack tar', '<C><F><I><N><Q>@jack tar /''dʤæk''tɑ:/<br />*  danh từ<br />- thuỷ thủ</Q></N></I></F></C>'),
(67433, 'jack-towel', '<C><F><I><N><Q>@jack-towel /''dʤæk,tauəl/<br />*  danh từ<br />- khăn mặt cuốn (khăn mặt khâu tròn, cuốn vào rulô)</Q></N></I></F></C>'),
(67434, 'jackal', '<C><F><I><N><Q>@jackal /''dʤækɔ:l/<br />*  danh từ<br />- (động vật học) chó rừng<br />- (nghĩa bóng) người làm những công việc cực nhọc vất vả (cho người khác hưởng)</Q></N></I></F></C>'),
(67435, 'jackals', '<C><F><I><N><Q>@jackal /''dʤækɔ:l/<br />*  danh từ<br />- (động vật học) chó rừng<br />- (nghĩa bóng) người làm những công việc cực nhọc vất vả (cho người khác hưởng)</Q></N></I></F></C>'),
(67436, 'jackanapes', '<C><F><I><N><Q>@jackanapes /''dʤækəneips/<br />*  danh từ<br />- kẻ càn rỡ, kẻ hỗn xược; thằng ranh con hỗn láo<br />- người kiêu căng tự mãn, người hợm hĩnh<br />- (từ cổ,nghĩa cổ) con khỉ</Q></N></I></F></C>'),
(67437, 'jackanapeses', '<C><F><I><N><Q>@jackanapes /''dʤækəneips/<br />*  danh từ<br />- kẻ càn rỡ, kẻ hỗn xược; thằng ranh con hỗn láo<br />- người kiêu căng tự mãn, người hợm hĩnh<br />- (từ cổ,nghĩa cổ) con khỉ</Q></N></I></F></C>'),
(67438, 'jackaroo', '<C><F><I><N><Q>@jackaroo /''dʤækəru:/<br />*  danh từ<br />- Uc,  (từ lóng) người mới vào nghề</Q></N></I></F></C>'),
(67439, 'jackass', '<C><F><I><N><Q>@jackass /''dʤækæs/<br />*  danh từ<br />- con lừa đực<br />- (thường) người ngu đần, chàng ngốc</Q></N></I></F></C>'),
(67440, 'jackassery', '<C><F><I><N><Q>@jackassery<br />* danh từ<br />- sự ngu đần; sự ngu ngốc; sự ngớ ngẩn</Q></N></I></F></C>'),
(67441, 'jackasses', '<C><F><I><N><Q>@jackass /''dʤækæs/<br />*  danh từ<br />- con lừa đực<br />- (thường) người ngu đần, chàng ngốc</Q></N></I></F></C>'),
(67442, 'jackboot', '<C><F><I><N><Q>@jackboot /''dʤækbu:t/<br />*  danh từ<br />- giầy ống, ủng (cao đến trên đầu gối)</Q></N></I></F></C>'),
(67443, 'jackboots', '<C><F><I><N><Q>@jackboot /''dʤækbu:t/<br />*  danh từ<br />- giầy ống, ủng (cao đến trên đầu gối)</Q></N></I></F></C>'),
(67444, 'jackdaw', '<C><F><I><N><Q>@jackdaw /''dʤækdɔ:/<br />*  danh từ<br />- (động vật học) quạ gáy xám</Q></N></I></F></C>'),
(67445, 'jackdaws', '<C><F><I><N><Q>@jackdaw /''dʤækdɔ:/<br />*  danh từ<br />- (động vật học) quạ gáy xám</Q></N></I></F></C>');
INSERT INTO `tbl_edict` (`id`, `word`, `detail`) VALUES
(67446, 'jacked', '<C><F><I><N><Q>@jack /dʤæk/<br />*  danh từ<br />- quả mít<br />- (thực vật học) cây mít<br />- gỗ mít<br />*  danh từ<br />- (hàng hải) lá cờ ((thường) chỉ quốc tịch)<br />!Union Jack<br />- quốc kỳ Anh<br />*  danh từ (từ cổ,nghĩa cổ)<br />- áo chẽn không tay (của lính)<br />- bình bằng da (để đựng nước, rượu...) ((cũng) black jack)<br />*  danh từ<br />- Giắc (tên riêng, cách gọi thân mật của tên Giôn)<br />- người con trai, gã ((cũng) Jack)<br />=every man jack+ mọi người<br />=Jack and Gill (Jill)+ chàng và nàng<br />- (như) jack_tar<br />- nhân viên, thợ, người đi làm thuê làm mướn, người làm những công việc linh tinh ((cũng) Jack)<br />=Jack in office+ viên chức nhỏ nhưng hay làm ra vẻ ta đây quan trọng<br />- (đánh bài) quân J<br />- (từ Mỹ,nghĩa Mỹ),  (từ lóng) tiến<br />- (quân sự),  (từ lóng) lính quân cảnh<br />- (động vật học) cá chó nhỏ<br />- (kỹ thuật) cái kích ((cũng) cattiage jack); cái palăng; tay đòn, đòn bẩy<br />- giá, bệ đỡ<br />- cái đế rút giày ống ((cũng) boot jack)<br />- máy để quay xiên nướng thịt<br />- (từ Mỹ,nghĩa Mỹ) đuốc, đèn (để đi săn hoặc câu đêm) ((cũng) jack light)<br />!to be Jack of all trades and master of none<br />- nghề gì cũng biết nhưng chẳng tinh nghề nào<br />!before you could say Jack Robinson<br />- đột ngột, rất nhanh, không kịp kêu lên một tiếng, không kịp ngáp<br />*  ngoại động từ<br />- ((thường) + up) kích lên (xe ô tô...)<br />- săn bằng đuốc, săn bằng đèn; câu bằng đuốc, câu bằng đèn<br />!to jack up<br />- bỏ, từ bỏ<br />=to jack up one''s job+ bỏ công việc<br />- (từ Mỹ,nghĩa Mỹ),  (thông tục) nâng, tăng (giá lương...)<br />- (từ Mỹ,nghĩa Mỹ),  (thông tục) quở trách, khiển, chỉnh (vì sao lãng...)</Q></N></I></F></C>'),
(67447, 'jacker', '<C><F><I><N><Q>@jacker<br />- xem jack</Q></N></I></F></C>'),
(67448, 'jackeroo', '<C><F><I><N><Q>@jackeroo<br />* danh từ<br />- (từ úc,  (thông tục)) công nhân trẻ không có kinh nghiệm ở trạm nuôi gia súc hoặc cừu</Q></N></I></F></C>'),
(67449, 'jacket', '<C><F><I><N><Q>@jacket /''dʤækit/<br />*  danh từ<br />- áo vét tông (đành ông), áo vét (đàn bà)<br />- (kỹ thuật) cái bao, áo giữ nhiệt (bọc máy...)<br />- bìa bọc sách; (từ Mỹ,nghĩa Mỹ) bìa tài liệu chính thức<br />- da, bộ lông (súc vật); vỏ (khoai tây)<br />=potatoes boiled in their jackets+ khoai tây luộc để cả vỏ<br />!to dust (dress down, trim, warm) someone''s jacket<br />- nện cho ai một trận<br />*  ngoại động từ<br />- mặc áo vét tông cho, mặc áo vét cho<br />- bọc, bao<br />- (từ lóng) sửa cho một trận</Q></N></I></F></C>'),
(67450, 'jacketed', '<C><F><I><N><Q>@jacketed<br />- xem jacket</Q></N></I></F></C>'),
(67451, 'jackets', '<C><F><I><N><Q>@jacket /''dʤækit/<br />*  danh từ<br />- áo vét tông (đành ông), áo vét (đàn bà)<br />- (kỹ thuật) cái bao, áo giữ nhiệt (bọc máy...)<br />- bìa bọc sách; (từ Mỹ,nghĩa Mỹ) bìa tài liệu chính thức<br />- da, bộ lông (súc vật); vỏ (khoai tây)<br />=potatoes boiled in their jackets+ khoai tây luộc để cả vỏ<br />!to dust (dress down, trim, warm) someone''s jacket<br />- nện cho ai một trận<br />*  ngoại động từ<br />- mặc áo vét tông cho, mặc áo vét cho<br />- bọc, bao<br />- (từ lóng) sửa cho một trận</Q></N></I></F></C>'),
(67452, 'jackfish', '<C><F><I><N><Q>@jackfish<br />* danh từ<br />- (động vật) cá chó</Q></N></I></F></C>'),
(67453, 'jackfruit', '<C><F><I><N><Q>@jackfruit<br />* danh từ<br />- cây mít; quả mít</Q></N></I></F></C>'),
(67454, 'jackhammer', '<C><F><I><N><Q>@jackhammer /''dɔæk,hæmə/<br />*  danh từ<br />- (kỹ thuật) búa chèn; búa khoan</Q></N></I></F></C>'),
(67455, 'jackhammers', '<C><F><I><N><Q>@jackhammer /''dɔæk,hæmə/<br />*  danh từ<br />- (kỹ thuật) búa chèn; búa khoan</Q></N></I></F></C>'),
(67456, 'jacking', '<C><F><I><N><Q>@jack /dʤæk/<br />*  danh từ<br />- quả mít<br />- (thực vật học) cây mít<br />- gỗ mít<br />*  danh từ<br />- (hàng hải) lá cờ ((thường) chỉ quốc tịch)<br />!Union Jack<br />- quốc kỳ Anh<br />*  danh từ (từ cổ,nghĩa cổ)<br />- áo chẽn không tay (của lính)<br />- bình bằng da (để đựng nước, rượu...) ((cũng) black jack)<br />*  danh từ<br />- Giắc (tên riêng, cách gọi thân mật của tên Giôn)<br />- người con trai, gã ((cũng) Jack)<br />=every man jack+ mọi người<br />=Jack and Gill (Jill)+ chàng và nàng<br />- (như) jack_tar<br />- nhân viên, thợ, người đi làm thuê làm mướn, người làm những công việc linh tinh ((cũng) Jack)<br />=Jack in office+ viên chức nhỏ nhưng hay làm ra vẻ ta đây quan trọng<br />- (đánh bài) quân J<br />- (từ Mỹ,nghĩa Mỹ),  (từ lóng) tiến<br />- (quân sự),  (từ lóng) lính quân cảnh<br />- (động vật học) cá chó nhỏ<br />- (kỹ thuật) cái kích ((cũng) cattiage jack); cái palăng; tay đòn, đòn bẩy<br />- giá, bệ đỡ<br />- cái đế rút giày ống ((cũng) boot jack)<br />- máy để quay xiên nướng thịt<br />- (từ Mỹ,nghĩa Mỹ) đuốc, đèn (để đi săn hoặc câu đêm) ((cũng) jack light)<br />!to be Jack of all trades and master of none<br />- nghề gì cũng biết nhưng chẳng tinh nghề nào<br />!before you could say Jack Robinson<br />- đột ngột, rất nhanh, không kịp kêu lên một tiếng, không kịp ngáp<br />*  ngoại động từ<br />- ((thường) + up) kích lên (xe ô tô...)<br />- săn bằng đuốc, săn bằng đèn; câu bằng đuốc, câu bằng đèn<br />!to jack up<br />- bỏ, từ bỏ<br />=to jack up one''s job+ bỏ công việc<br />- (từ Mỹ,nghĩa Mỹ),  (thông tục) nâng, tăng (giá lương...)<br />- (từ Mỹ,nghĩa Mỹ),  (thông tục) quở trách, khiển, chỉnh (vì sao lãng...)</Q></N></I></F></C>'),
(67457, 'jackpot', '<C><F><I><N><Q>@jackpot /''dʤækpɔt/<br />*  danh từ<br />- (đánh bài) số tiền góp<br />- (nghĩa bóng) giải xổ số<br />- (từ Mỹ,nghĩa Mỹ),  (thông tục) món lời ca nhất (trong việc kinh doanh)<br />!to hit the jackpot Mỹ, lóng<br />- (đánh bài) vớ hết số tiền góp<br />- vớ bở, thành công lớn</Q></N></I></F></C>'),
(67458, 'jackpots', '<C><F><I><N><Q>@jackpot /''dʤækpɔt/<br />*  danh từ<br />- (đánh bài) số tiền góp<br />- (nghĩa bóng) giải xổ số<br />- (từ Mỹ,nghĩa Mỹ),  (thông tục) món lời ca nhất (trong việc kinh doanh)<br />!to hit the jackpot Mỹ, lóng<br />- (đánh bài) vớ hết số tiền góp<br />- vớ bở, thành công lớn</Q></N></I></F></C>'),
(67459, 'jackrabbit', '<C><F><I><N><Q>@jackrabbit<br />* danh từ<br />- loại thỏ lớn (ở miền tây của Nam Mỹ)</Q></N></I></F></C>'),
(67460, 'jackrabbits', '<C><F><I><N><Q>@jackrabbit<br />* danh từ<br />- loại thỏ lớn (ở miền tây của Nam Mỹ)</Q></N></I></F></C>'),
(67461, 'jackroo', '<C><F><I><N><Q>@jackroo<br />* danh từ<br />- cũng jackaroo<br />- (từ úc,  (thông tục)) công nhân trẻ không có kinh nghiệm ở trạm nuôi gia súc hoặc cừu</Q></N></I></F></C>'),
(67462, 'jacks', '<C><F><I><N><Q>@jack /dʤæk/<br />*  danh từ<br />- quả mít<br />- (thực vật học) cây mít<br />- gỗ mít<br />*  danh từ<br />- (hàng hải) lá cờ ((thường) chỉ quốc tịch)<br />!Union Jack<br />- quốc kỳ Anh<br />*  danh từ (từ cổ,nghĩa cổ)<br />- áo chẽn không tay (của lính)<br />- bình bằng da (để đựng nước, rượu...) ((cũng) black jack)<br />*  danh từ<br />- Giắc (tên riêng, cách gọi thân mật của tên Giôn)<br />- người con trai, gã ((cũng) Jack)<br />=every man jack+ mọi người<br />=Jack and Gill (Jill)+ chàng và nàng<br />- (như) jack_tar<br />- nhân viên, thợ, người đi làm thuê làm mướn, người làm những công việc linh tinh ((cũng) Jack)<br />=Jack in office+ viên chức nhỏ nhưng hay làm ra vẻ ta đây quan trọng<br />- (đánh bài) quân J<br />- (từ Mỹ,nghĩa Mỹ),  (từ lóng) tiến<br />- (quân sự),  (từ lóng) lính quân cảnh<br />- (động vật học) cá chó nhỏ<br />- (kỹ thuật) cái kích ((cũng) cattiage jack); cái palăng; tay đòn, đòn bẩy<br />- giá, bệ đỡ<br />- cái đế rút giày ống ((cũng) boot jack)<br />- máy để quay xiên nướng thịt<br />- (từ Mỹ,nghĩa Mỹ) đuốc, đèn (để đi săn hoặc câu đêm) ((cũng) jack light)<br />!to be Jack of all trades and master of none<br />- nghề gì cũng biết nhưng chẳng tinh nghề nào<br />!before you could say Jack Robinson<br />- đột ngột, rất nhanh, không kịp kêu lên một tiếng, không kịp ngáp<br />*  ngoại động từ<br />- ((thường) + up) kích lên (xe ô tô...)<br />- săn bằng đuốc, săn bằng đèn; câu bằng đuốc, câu bằng đèn<br />!to jack up<br />- bỏ, từ bỏ<br />=to jack up one''s job+ bỏ công việc<br />- (từ Mỹ,nghĩa Mỹ),  (thông tục) nâng, tăng (giá lương...)<br />- (từ Mỹ,nghĩa Mỹ),  (thông tục) quở trách, khiển, chỉnh (vì sao lãng...)</Q></N></I></F></C>'),
(67463, 'jacks-in-the-box', '<C><F><I><N><Q>@jack-in-the-box /''dʤækinðəbɔks/<br />*  danh từ<br />- hộp hình nộm (có lò xo, khi mở nắp hộp thì hình nộm bật lên) (đồ chơi trẻ con)<br />- pháo hoa hộp<br />- (kỹ thuật) kích vít</Q></N></I></F></C>'),
(67464, 'jackssery', '<C><F><I><N><Q>@jackssery<br />* danh từ<br />- sự ngu đần; sự ngu ngốc; sự ngớ ngẩn</Q></N></I></F></C>'),
(67465, 'jacob''s ladder', '<C><F><I><N><Q>@jacob''s ladder /''dʤeikəbz''lædə/<br />*  danh từ<br />- (kinh thánh) cái thang của Gia-cốp<br />- (thông tục) thang dựng đứng khó trèo<br />- (hàng hải) thang dây<br />- (thực vật học) cây lá thang</Q></N></I></F></C>'),
(67466, 'jacob''s staff', '<C><F><I><N><Q>@jacob''s staff /''dʤeikəbz''stɑ:f/<br />*  danh từ<br />- (kinh thánh) cái gậy của Gia-cốp<br />- máy đẳng cao</Q></N></I></F></C>'),
(67467, 'jacobean', '<C><F><I><N><Q>@jacobean /,dʤækə''bi:ən/<br />*  tính từ<br />- thuộc thời vua Giêm I (Anh, 1603 1625)<br />=jacobean literature+ văn học dưới thời vua Giêm I<br />- màu gỗ sồi thẫm (đồ gỗ)</Q></N></I></F></C>'),
(67468, 'jacobian', '<C><F><I><N><Q>@jacobian<br />- định thức Jacôbi; (thuộc) Jacôbi</Q></N></I></F></C>'),
(67469, 'jacobin', '<C><F><I><N><Q>@jacobin /''dʤækəbin/<br />*  danh từ<br />- thầy tu dòng Đô-mi-ních<br />- người theo phái Gia-cô-banh (thời cách mạng Pháp, 1789)<br />*  danh từ<br />- (động vật học) bồ câu thầy dòng (có lông xù ở gáy, trông giống như mũ thầy dòng)</Q></N></I></F></C>'),
(67470, 'jacobinic', '<C><F><I><N><Q>@jacobinic /,dʤækə''binik/ (Jacobinical) /,dʤækə''binikəl/<br />*  tính từ<br />- (thuộc) phái Gia-cô-banh</Q></N></I></F></C>'),
(67471, 'jacobinical', '<C><F><I><N><Q>@jacobinical /,dʤækə''binik/ (Jacobinical) /,dʤækə''binikəl/<br />*  tính từ<br />- (thuộc) phái Gia-cô-banh</Q></N></I></F></C>'),
(67472, 'jacobinism', '<C><F><I><N><Q>@jacobinism /''dʤækəbinizm/<br />*  danh từ<br />- xu hướng chính tri Gia-cô-banh (thời cách mạng Pháp 1789)</Q></N></I></F></C>'),
