(67474, 'Jacobins', '<C><F><I><N><Q>@jacobin /''dʤækəbin/<br />*  danh từ<br />- thầy tu dòng Đô-mi-ních<br />- người theo phái Gia-cô-banh (thời cách mạng Pháp, 1789)<br />*  danh từ<br />- (động vật học) bồ câu thầy dòng (có lông xù ở gáy, trông giống như mũ thầy dòng)</Q></N></I></F></C>'),
(67475, 'jacobite', '<C><F><I><N><Q>@jacobite<br />* danh từ<br />- người ủng hộ Giêm II (sau cách mạng 1688)</Q></N></I></F></C>'),
(67476, 'jaconet', '<C><F><I><N><Q>@jaconet /''dʤækənət/<br />*  danh từ<br />- vải jagan (một loại vải trắng mỏng)</Q></N></I></F></C>'),
(67477, 'jacquard', '<C><F><I><N><Q>@jacquard<br />* danh từ<br />- khung dệt dệt hoa<br />- vải dệt hoa</Q></N></I></F></C>'),
(67478, 'jacquard loom', '<C><F><I><N><Q>@jacquard loom /dʤə''kɑ:d''lu:m/<br />*  danh từ<br />- khung dệt jăcka</Q></N></I></F></C>'),
(67479, 'jacquards', '<C><F><I><N><Q>@jacquard<br />* danh từ<br />- khung dệt dệt hoa<br />- vải dệt hoa</Q></N></I></F></C>'),
(67480, 'jactation', '<C><F><I><N><Q>@jactation /dʤæk''teiʃn/ (jactitation) /,dʤækti''teiʃn/<br />*  danh từ<br />- (y học) sự trăn trở, sự quằn quại (lúc ốm đau); chứng co giật<br />- (từ cổ,nghĩa cổ) thói khoe khoang khoác lác</Q></N></I></F></C>'),
(67481, 'jactitation', '<C><F><I><N><Q>@jactitation /,dʤækti''teiʃn/<br />*  danh từ<br />- ((pháp lý)) jactitation of marriage tội nhận xằng là vợ (là chồng) ai<br />- (xem) jactation</Q></N></I></F></C>'),
(67482, 'jactitations', '<C><F><I><N><Q>@jactitation /,dʤækti''teiʃn/<br />*  danh từ<br />- ((pháp lý)) jactitation of marriage tội nhận xằng là vợ (là chồng) ai<br />- (xem) jactation</Q></N></I></F></C>'),
(67483, 'jacuzzi', '<C><F><I><N><Q>@jacuzzi<br />* danh từ<br />- sự tắm ở nơi có mạch nước ngầm phụt lên</Q></N></I></F></C>'),
(67484, 'jade', '<C><F><I><N><Q>@jade /dʤeid/<br />*  danh từ<br />- ngọc bích<br />- mùa ngọc bích<br />*  danh từ<br />- ngựa tồi, ngựa già ốm<br />-(đùa cợt) con mụ, con bé<br />*  ngoại động từ ((thường) động tính từ quá khứ)<br />- bắt làm việc mệt nhoài; làm mệt lử</Q></N></I></F></C>'),
(67485, 'jaded', '<C><F><I><N><Q>@jaded /dʤeid/<br />*  tính từ<br />- mệt mỏi, mệt rã rời, kiệt sức; phải làm việc quá sức<br />- chán ứ, chán ngấy<br />=a jaded appetite+ ăn chán ứ không thấy ngon</Q></N></I></F></C><C><F><I><N><Q>@jade /dʤeid/<br />*  danh từ<br />- ngọc bích<br />- mùa ngọc bích<br />*  danh từ<br />- ngựa tồi, ngựa già ốm<br />-(đùa cợt) con mụ, con bé<br />*  ngoại động từ ((thường) động tính từ quá khứ)<br />- bắt làm việc mệt nhoài; làm mệt lử</Q></N></I></F></C>'),
(67486, 'jadedly', '<C><F><I><N><Q>@jadedly<br />- xem jaded</Q></N></I></F></C>'),
(67487, 'jadedness', '<C><F><I><N><Q>@jadedness<br />- xem jaded</Q></N></I></F></C>'),
(67488, 'jadeite', '<C><F><I><N><Q>@jadeite<br />* danh từ<br />- ngọc đổi màu</Q></N></I></F></C>'),
(67489, 'jadeitic', '<C><F><I><N><Q>@jadeitic<br />* tính từ<br />- thuộc ngọc đổi màu</Q></N></I></F></C>'),
(67490, 'jades', '<C><F><I><N><Q>@jade /dʤeid/<br />*  danh từ<br />- ngọc bích<br />- mùa ngọc bích<br />*  danh từ<br />- ngựa tồi, ngựa già ốm<br />-(đùa cợt) con mụ, con bé<br />*  ngoại động từ ((thường) động tính từ quá khứ)<br />- bắt làm việc mệt nhoài; làm mệt lử</Q></N></I></F></C>'),
(67491, 'jading', '<C><F><I><N><Q>@jade /dʤeid/<br />*  danh từ<br />- ngọc bích<br />- mùa ngọc bích<br />*  danh từ<br />- ngựa tồi, ngựa già ốm<br />-(đùa cợt) con mụ, con bé<br />*  ngoại động từ ((thường) động tính từ quá khứ)<br />- bắt làm việc mệt nhoài; làm mệt lử</Q></N></I></F></C>'),
(67492, 'jaeger', '<C><F><I><N><Q>@jaeger /''jeigə/<br />*  danh từ<br />- vải len jêgơ</Q></N></I></F></C>'),
(67493, 'jaffa', '<C><F><I><N><Q>@jaffa<br />* danh từ<br />- (thường) viết hoa loại cam lớn mọc ở Ixraen</Q></N></I></F></C>'),
(67494, 'jag', '<C><F><I><N><Q>@jag /dʤæg/<br />*  danh từ (từ Mỹ,nghĩa Mỹ),  (từ lóng)<br />- bữa rượu, bữa chè chén<br />- cơn say bí tỉ<br />*  danh từ<br />- đầu nhọn, mỏm nhọn<br />=a jag of rock+ một mỏm đá nhọn<br />*  ngoại động từ<br />- cắt lởm chởm; xé không đều; làm mẻ (dao...)</Q></N></I></F></C>'),
(67495, 'jagged', '<C><F><I><N><Q>@jagged /''dʤægid/<br />*  tính từ<br />- (từ Mỹ,nghĩa Mỹ),  (từ lóng) say bí tỉ<br />*  tính từ<br />- có mép lởm chởm (như răng cưa); lởm chởm, có nhiều cạnh nhọn<br />=jagged rocks+ đá lởm chởm</Q></N></I></F></C><C><F><I><N><Q>@jag /dʤæg/<br />*  danh từ (từ Mỹ,nghĩa Mỹ),  (từ lóng)<br />- bữa rượu, bữa chè chén<br />- cơn say bí tỉ<br />*  danh từ<br />- đầu nhọn, mỏm nhọn<br />=a jag of rock+ một mỏm đá nhọn<br />*  ngoại động từ<br />- cắt lởm chởm; xé không đều; làm mẻ (dao...)</Q></N></I></F></C>'),
(67496, 'jaggedly', '<C><F><I><N><Q>@jaggedly<br />- xem jagged</Q></N></I></F></C>'),
