(67614, 'jarred', '<C><F><I><N><Q>@jar /dʤɑ:/<br />*  danh từ<br />- vại, lọ, bình<br />- (điện học) chai<br />= Leyden jar+ chai lêdden<br />- ((thông tục)) on the jar; on a jar; on jar hé mở (cửa)<br />- tiếng động chói tai; tiếng ken két làm gai người<br />- sự rung chuyển mạnh, sự chao đảo mạnh (làm chói tai)<br />- sự choáng người, sự choáng óc; sự gai người; sự bực bội, sự khó chịu (thần kinh, cân não...)<br />=the news gave me a nasty jar+ tin đó làm tôi bực bội khó chịu<br />- sự va chạm (quyền lợi...), sự bất đồng, sự không hoà hợp (ý kiến...)<br />- sự bất hoà, sự cãi nhau<br />- (kỹ thuật) sự rung, sự chấn động<br />*  nội động từ<br />- phát ra tiếng động chói tai; kêu ken két làm gai người<br />- (+ upon) gây cảm giác khó chịu, gây bực bội<br />=to jar upon ear+ gây chói tai<br />=to jar uopn nerves+ gây bực bội thất kinh<br />- (+ upon,  against) cọ ken két, nghiến ken két<br />- ((thường) + with) va chạm, xung đột, bất đồng, mâu thuẫn, không hoà hợp (quyền lợi, ý kiến...)<br />- cãi nhau<br />- (kỹ thuật) rung, chấn động<br />*  ngoại động từ<br />- làm rung động mạnh, làm chấn động mạnh<br />- làm kêu chói tai, làm kêu ken két gai người<br />- làm choáng (óc), làm gai (người...), làm chói (tai...), làm bực bội, làm khó chịu (thần kinh, cân não...)</Q></N></I></F></C>'),
(67615, 'jarring', '<C><F><I><N><Q>@jarring /''dʤɑ:riɳ/<br />*  tính từ<br />- chói tai, nghịch tai, làm gai người<br />=a jarring sound+ tiếng chói tai<br />=a jarring note+ (âm nhạc) nốt nghịch tai<br />- làm choáng (óc...), làm bực bội, làm khó chịu (thần kinh, cân não...)<br />- va chạm, xung đột, mâu thuẫn, bất đồng, không hoà hợp<br />=jarring interests+ quyền lợi xung dột<br />=jarring opinions+ ý kiến bất đồng, ý kiến mâu thuẫn</Q></N></I></F></C><C><F><I><N><Q>@jar /dʤɑ:/<br />*  danh từ<br />- vại, lọ, bình<br />- (điện học) chai<br />= Leyden jar+ chai lêdden<br />- ((thông tục)) on the jar; on a jar; on jar hé mở (cửa)<br />- tiếng động chói tai; tiếng ken két làm gai người<br />- sự rung chuyển mạnh, sự chao đảo mạnh (làm chói tai)<br />- sự choáng người, sự choáng óc; sự gai người; sự bực bội, sự khó chịu (thần kinh, cân não...)<br />=the news gave me a nasty jar+ tin đó làm tôi bực bội khó chịu<br />- sự va chạm (quyền lợi...), sự bất đồng, sự không hoà hợp (ý kiến...)<br />- sự bất hoà, sự cãi nhau<br />- (kỹ thuật) sự rung, sự chấn động<br />*  nội động từ<br />- phát ra tiếng động chói tai; kêu ken két làm gai người<br />- (+ upon) gây cảm giác khó chịu, gây bực bội<br />=to jar upon ear+ gây chói tai<br />=to jar uopn nerves+ gây bực bội thất kinh<br />- (+ upon,  against) cọ ken két, nghiến ken két<br />- ((thường) + with) va chạm, xung đột, bất đồng, mâu thuẫn, không hoà hợp (quyền lợi, ý kiến...)<br />- cãi nhau<br />- (kỹ thuật) rung, chấn động<br />*  ngoại động từ<br />- làm rung động mạnh, làm chấn động mạnh<br />- làm kêu chói tai, làm kêu ken két gai người<br />- làm choáng (óc), làm gai (người...), làm chói (tai...), làm bực bội, làm khó chịu (thần kinh, cân não...)</Q></N></I></F></C>'),
(67616, 'jarringly', '<C><F><I><N><Q>@jarringly<br />- xem jar</Q></N></I></F></C>'),
(67617, 'jars', '<C><F><I><N><Q>@jar /dʤɑ:/<br />*  danh từ<br />- vại, lọ, bình<br />- (điện học) chai<br />= Leyden jar+ chai lêdden<br />- ((thông tục)) on the jar; on a jar; on jar hé mở (cửa)<br />- tiếng động chói tai; tiếng ken két làm gai người<br />- sự rung chuyển mạnh, sự chao đảo mạnh (làm chói tai)<br />- sự choáng người, sự choáng óc; sự gai người; sự bực bội, sự khó chịu (thần kinh, cân não...)<br />=the news gave me a nasty jar+ tin đó làm tôi bực bội khó chịu<br />- sự va chạm (quyền lợi...), sự bất đồng, sự không hoà hợp (ý kiến...)<br />- sự bất hoà, sự cãi nhau<br />- (kỹ thuật) sự rung, sự chấn động<br />*  nội động từ<br />- phát ra tiếng động chói tai; kêu ken két làm gai người<br />- (+ upon) gây cảm giác khó chịu, gây bực bội<br />=to jar upon ear+ gây chói tai<br />=to jar uopn nerves+ gây bực bội thất kinh<br />- (+ upon,  against) cọ ken két, nghiến ken két<br />- ((thường) + with) va chạm, xung đột, bất đồng, mâu thuẫn, không hoà hợp (quyền lợi, ý kiến...)<br />- cãi nhau<br />- (kỹ thuật) rung, chấn động<br />*  ngoại động từ<br />- làm rung động mạnh, làm chấn động mạnh<br />- làm kêu chói tai, làm kêu ken két gai người<br />- làm choáng (óc), làm gai (người...), làm chói (tai...), làm bực bội, làm khó chịu (thần kinh, cân não...)</Q></N></I></F></C>'),
(67618, 'jarvey', '<C><F><I><N><Q>@jarvey /''dʤɑ:vi/<br />*  danh từ<br />- người đánh xe ngựa thuê</Q></N></I></F></C>'),
