(67629, 'jaundice', '<C><F><I><N><Q>@jaundice /''dʤɔ:ndis/<br />*  danh từ<br />- (y học) bệnh vàng da<br />- (nghĩa bóng) cách nhìn lệch lạc thành kiến; sự hằn học, sự ghen tức<br />*  ngoại động từ<br />- làm mắc bệnh vàng da<br />- (nghĩa bóng) ((thường) động tính từ quá khứ) làm hằn học, làm ghen tức<br />=with a jaundiced eye+ với con mắt ghen tức</Q></N></I></F></C>'),
