(67647, 'jaw', '<C><F><I><N><Q>@jaw /dʤɔ:/<br />*  danh từ<br />- hàm, quai hàm<br />=upper jaw+ hàm trên<br />=lower jaw+ hàm dưới<br />- (số nhiều) mồm, miệng<br />=in the jaws of death+ trong tay thần chết<br />- (số nhiều) lối vào hẹp (thung lũng, vịnh, eo biển...)<br />- (số nhiều) (kỹ thuật) cái kẹp; má (kìm...), hàm (êtô...)<br />- (thông tục) sự lắm mồm, sự nhiều lời, sự ba hoa<br />- sự răn dạy; sự chỉnh, sự "lên lớp"  (nghĩa bóng)<br />=pi jaw+(ngôn ngữ nhà trường),  (từ lóng) sự chỉnh, sự "lên lớp" <br />!hold your jaw!<br />- thôi câm cái mồn đi, đừng ba hoa nữa!; thôi đừng "lên lớp" nữa!<br />*  động từ (từ lóng)<br />- nói lải nhải, nói dài dòng chán ngắt<br />- răn dạy, chỉnh, "lên lớp" (ai), thuyết cho (ai) một hồi</Q></N></I></F></C>'),
(67648, 'jaw-bone', '<C><F><I><N><Q>@jaw-bone /''dʤɔ:boun/<br />*  danh từ<br />- xương hàm</Q></N></I></F></C>'),
(67649, 'jaw-breaker', '<C><F><I><N><Q>@jaw-breaker /''dʤɔ:,breikə/<br />*  danh từ<br />- (thông tục) từ khó đọc, từ khó phát âm</Q></N></I></F></C>'),
(67650, 'jawed', '<C><F><I><N><Q>@jawed<br />* tính từ<br />- hàm<br />= square - jawed+quai hàm vuông</Q></N></I></F></C><C><F><I><N><Q>@jaw /dʤɔ:/<br />*  danh từ<br />- hàm, quai hàm<br />=upper jaw+ hàm trên<br />=lower jaw+ hàm dưới<br />- (số nhiều) mồm, miệng<br />=in the jaws of death+ trong tay thần chết<br />- (số nhiều) lối vào hẹp (thung lũng, vịnh, eo biển...)<br />- (số nhiều) (kỹ thuật) cái kẹp; má (kìm...), hàm (êtô...)<br />- (thông tục) sự lắm mồm, sự nhiều lời, sự ba hoa<br />- sự răn dạy; sự chỉnh, sự "lên lớp"  (nghĩa bóng)<br />=pi jaw+(ngôn ngữ nhà trường),  (từ lóng) sự chỉnh, sự "lên lớp" <br />!hold your jaw!<br />- thôi câm cái mồn đi, đừng ba hoa nữa!; thôi đừng "lên lớp" nữa!<br />*  động từ (từ lóng)<br />- nói lải nhải, nói dài dòng chán ngắt<br />- răn dạy, chỉnh, "lên lớp" (ai), thuyết cho (ai) một hồi</Q></N></I></F></C>'),
