(67781, 'jest', '<C><F><I><N><Q>@jest /dʤest/<br />*  danh từ<br />- lời chế nhạo, lời chế giễu, lời giễu cợt<br />=to make a jest of+ giễu cợt, chế nhạo<br />- lời nói đùa chơi, lời nói giỡn<br />=in jest+ nói đùa chơi<br />=between jest and earnest+ nửa đùa nửa thật<br />- trò cười (cho thiên hạ), đích để mọi người chế giễu<br />=a standing jest+ người thường xuyên làm trò cười cho thiên hạ<br />*  nội động từ<br />- nói đùa, nói giỡn, pha trò<br />- chế nhạo, chế giễu, giễu cợt</Q></N></I></F></C>'),
