(67784, 'jester', '<C><F><I><N><Q>@jester /''dʤestə/<br />*  danh từ<br />- người hay nói đùa, người hay pha trò<br />- anh hề (trong cung đình hay ở các nhà quyền quý xưa)</Q></N></I></F></C>'),
