(67798, 'jet', '<C><F><I><N><Q>@jet /dʤet/<br />*  tính từ<br />- bằng huyền<br />- đen nhánh, đen hạt huyền ((cũng) jet black)<br />*  danh từ<br />- huyền<br />=as black as jet+ đen nhánh, đen như hạt huyền<br />- màu đen nhánh, màu đen như hạt huyền<br />*  danh từ<br />- tia (nước, máu, hơi...)<br />- vòi (ống nước...)<br />- (kỹ thuật) vòi phun,  giclơ<br />- (thông tục) máy bay phản lực<br />*  động từ<br />- phun ra thành tia; làm bắn tia<br /><br />@jet<br />- (vật lí) tia, dòng; luồng<br />- gas j. tia khí<br />- propulsive j. động cơ phản lực; không khí dòng thẳng <br />- pulse j. động cơ phản lực, không khí xung</Q></N></I></F></C>'),
(67799, 'jet-engine', '<C><F><I><N><Q>@jet-engine /''dʤet,endʤin/<br />*  danh từ<br />- động cơ phản lực</Q></N></I></F></C>'),
